INSERT INTO `latestnews` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(1, 'WELCOME MR.PUNDI AND MR.JEETAN', '<p>RIMSR has great pleasure in inducting Mr. Pundi Narasimham, and Mr. Jeetan, Atlanta, USA as members of the Governing Council.&nbsp; They bring along with them a wide variety of experience onto RIMSR. It is indeed a privilege to have them on the Governing Council, and the Board of Studies.</p>', '1566791573563108', 'Admin', '2019-11-12', '', '2020-03-20', '', 'active'),
(2, 'DIGITAL LITERACY PROGRAM OF NEF', '<p><strong>NEF University, Washington DC, USA has announced a million \"Appuji Scholarships\" enabling students, youth, and practically everybody to take the Digital Literacy Program of NEFU <em>absolutely free</em>.&nbsp; This is a goodwill grant from the NEF, USA exclusively for India.&nbsp; The purpose is to bridge the current digital divide in the country, and it is one of the major initiatives of Dr. Appu Kuttan, Founder Chairman and CEO of NEF, USA to realize his vision of MAKE INDIA GREAT AGAIN-MIGA. </strong></p>\r\n<p><strong>To enroll log-in to <a style=\"color: #954f72; outline: none; font-family: Calibri, sans-serif; font-size: 17.3333px; text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\" title=\"DIGITAL LITERACY PROGRAM\" href=\"https://appuji.org\" target=\"_blank\" rel=\"noopener noreferrer\">https://appuji.org</a><span style=\"font-family: Calibri, sans-serif; font-size: 17.3333px;\"> and register your credentials.&nbsp; </span>&nbsp; &nbsp;&nbsp;</strong></p>', '1372411585725615', 'Admin', '2020-04-01', '', '2020-07-25', '', 'active'),
(4, 'SKILL COURSES OF SUNY', '<p>Enroll in Skill Courses of SUNY.&nbsp; 7,000+ courses are available for specialization.&nbsp; Learn, and skill yourselves availing Appuji Scholarships.</p>\r\n<p>For details email registrar@rimsr.in.</p>', '2261301596002441', 'Admin', '2020-07-29', '', '2020-07-29', '', 'active'),
(5, 'CONGRATULATIONS!!!', '<div style=\"color: #333333; font-family: Helvetica, Arial, sans-serif; font-size: 13px; text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\"><span style=\"text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\"><strong style=\"text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\"><span style=\"text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important; color: #4c76a2; font-size: medium;\">Dr. Ramesh Bhandari, Assistant Professor, Department of Pharmacy Practice, KLE College of Pharmacy was awarded CERTIFICATE OF MERIT by the STATE UNIVERSITY OF NEW YORK, Potsdam, USA under the MIGA initiative of NEF, Washington DC, USA for having successfully completed the Certificate Program in BASE SAS 9 PROGRAMMING.</span></strong></span></div>', '1750221602306675', 'Admin', '2020-10-10', '', '2020-10-10', '', 'active'),
(6, 'CONGRATULATIONS!!!', '<p>Congratulations Pooja for securing distinction in the Certificate Program in Product Management.&nbsp; Good luck and best wishes.</p>', '3273271607838371', 'Admin', '2020-10-18', '', '2020-12-13', '', 'active'),
(8, 'SARAL SHIKSHAK PROGRAM', '<p>Congratulations to Dr. Pavitra, Associate Professor, Oral Pathology, KLE Dental College, Bengaluru for successfully completing the <em><strong>SARAL SHIKSHAK PROGRAM </strong></em>with&nbsp;distinction.</p>', '5685451607837968', 'Admin', '2020-11-15', '', '2020-12-13', '', 'active'),
(9, 'PROJECT MANAGEMENT', '<p>CONGRATULATIONS TO MR. ABHISHEK JAIN FOR SUCCESSFULLY COMPLETING THE DIPLOMA IN INNOVATION AND ENTREPRENEURSHIP, AND EXPERT PROGRAM IN PROJECT MANAGEMENT.</p>\r\n<p>RIMSR WISHES HIM GOOK LUCK AND A BRIGHT CAREER.</p>', '', 'Admin', '2020-11-17', '', '2020-11-17', '', 'active'),
(10, 'NEW JOB-READY COURSES OF SUNY-NEF', '<p>In tune with the changing technological/managerial scenario the following additional courses are now available:</p>\r\n<p>1. Personal Effectiveness</p>\r\n<p>2. Management of Change</p>\r\n<p>3. Six-Sigma</p>\r\n<p>4. Social Media &amp; Digital Marketing</p>\r\n<p>5. Software Testing</p>\r\n<p>6. Deep Learning</p>\r\n<p>7. Mobile Application Development</p>\r\n<p>8. Project Management for Managers</p>\r\n<p>All the above courses are covered by MIGA scholarships instituted by NEF, Washington DC, USA, and the course fee is highly subsidized.&nbsp;</p>\r\n<p>The courses are developed and delivered by SkillSoft, USA, and evaluated and certified by The State University of New York, Potsdam, USA.</p>\r\n<p>For more information and for enrollment email your request to registrar@rimsr.in.</p>', '3922531606836385', 'Admin', '2020-12-01', '', '2020-12-13', '', 'active'),
(15, 'CERTIFICATE COURSE IN ETHICAL HACKING', '<p><span style=\"color: #2c363a; font-family: Verdana, Geneva, sans-serif; font-size: 13.3333px;\">Certificate in Ethical Hacking is one of the new courses added to the list of SPECIALIZED JOB-ORIENTED SKILL DEVELOPMENT COURSES of SUNY.&nbsp; Admission requirements, fee structure, and financial aid remain the same.</span></p>', '3197441607837653', 'Admin', '2020-12-13', '', '2021-01-01', '', 'active'),
(16, 'CONGRATULATIONS!!!', '<p><strong>Congratulations Mr. Anush Kumar for successfully completing the Certificate Program in Product Management.&nbsp; </strong></p>\r\n<p><strong>Good luck and best wishes.</strong></p>', '', 'Admin', '2021-01-14', '', '2021-01-14', '', 'active'),
(17, 'CONGRATULATIONS!!!', '<p><span style=\\\"color: #333333; font-family: \\\'Open Sans\\\', helvetica, arial, sans-serif;\\\">Congratulations to Ms. Prachi Singh, Ms. Reema Raina, and Dr. Vikas Maheshwari for successfully completing the Certificate Program in Innovation &amp; Entrepreneurship.&nbsp; </span></p>\r\n<p><span style=\\\"color: #333333; font-family: \\\'Open Sans\\\', helvetica, arial, sans-serif;\\\">Good luck and best wishes.</span></p>', '', 'Admin', '2021-01-24', '', '2021-01-24', '', 'active'),
(18, 'CONGRATULATIONS!!!', '<p><span style=\\\"color: #333333; font-family: \\\'Open Sans\\\', helvetica, arial, sans-serif;\\\">Congratulations to Ms. Narinder Kaur for successfully completing the Post-Graduate Diploma in Innovation &amp; Entrepreneurship.&nbsp; </span></p>\r\n<p><span style=\\\"color: #333333; font-family: \\\'Open Sans\\\', helvetica, arial, sans-serif;\\\">Good luck and best wishes.</span></p>', '', 'Admin', '2021-01-24', '', '2021-01-24', '', 'active'),
(19, 'CONGRATULATIONS!!!', '<p>The following students successfully completed the \\\'Certificate Course in Emotional First-Aid\\\':</p>\r\n<ol style=\\\"box-sizing: border-box; border-color: #eeeeee; margin-top: 0px; margin-bottom: 1rem; color: #2c363a; font-family: Roboto, sans-serif;\\\">\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">DOLLY BANSI</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">PRAMOD SHETTY</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">PREEYA BATRA</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">NIDHI K</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">RAJESHWARI PALANI</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">RANJITHA BHASKAR</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">SINCHANA V</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">SINDHU K M</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">SHEEJA AJITH</li>\r\n<li style=\\\"box-sizing: border-box; border-color: #eeeeee;\\\">SMITHA KUMAR</li>\r\n</ol>\r\n<p>The course is developed and delivered by \\\'EMOTIONAL FIRST-AID ACADEMY\\\', audited/validated by RIMSR, and certified by the NEF University, Washington DC, USA.</p>\r\n<p>Best wishes to all the above students.</p>', '', 'Admin', '2021-01-25', '', '2021-01-25', '', 'active'),
(21, 'PROJECT MANAGEMENT', '<p>Happy to inform that 29 students of IDREAM MBA ACADEMY, Bengaluru, India, passed out of the CERTIFICATE PROGRAM IN PROJECT MANAGEMENT on the 24th of February 2021.&nbsp; In the GRADUATION CEREMONY held on the 26th of February 2021, all the students received the certifications.&nbsp; In this team, Ms.SHREYA YADAV was conferred with the prestigious APPUJI MEDALLION OF MERIT for having secured I Rank in the qualifying examination.</p>\r\n<p>Congratulations to all and in particular to Ms. SHREYA YADAV.&nbsp;</p>', '0302791614611982', 'Admin', '2021-03-01', '', '2021-03-01', '', 'active'),
(22, 'APPUJI MEDALLION OF MERIT', '<p>Ms. Shreya Yadav won the APPUJI MEDALLION OF MERIT having secured a GPA of 3.99 in the final examination of the course in PROJECT MANAGEMENT and was duly certified by the State University of New York, and the NEF University, Washington DC, USA.</p>', '4607731614957335', 'Admin', '2021-03-05', '', '2021-03-28', '', 'active'),
(25, 'SKILL COURSES OF SUNY', '<p>In the policy round-table conference held on the 10th of April 2021, the following decisions are taken:</p>\r\n<p>1.&nbsp; 21 additional JOB-READY courses are approved by SUNY.</p>\r\n<p>2.&nbsp; In all, 93 JOB-READY courses are available in areas having good employment potential.</p>\r\n<p>3.&nbsp; All 93 courses are categorized under the following four packages:</p>\r\n<p>&nbsp; &nbsp; &nbsp;*&nbsp; Business Skills&nbsp; - 25 courses,</p>\r\n<p>&nbsp; &nbsp; &nbsp;*&nbsp; Productivity and Collaboration Tools - 16 courses,</p>\r\n<p>&nbsp; &nbsp; &nbsp;*&nbsp; IT Skills - 22 courses, and</p>\r\n<p>&nbsp; &nbsp; &nbsp;*&nbsp; Certifications - 30 courses.</p>\r\n<p>4.&nbsp; Students/Professionals can enroll in any of the four packages.&nbsp;</p>\r\n<p>5.&nbsp; The admitted student automatically gets enrolled in all the courses available in the package he/she has chosen.</p>\r\n<p>6.&nbsp; The enrollment fee continues to be the same:</p>\r\n<p>&nbsp; &nbsp; &nbsp;*&nbsp; Fee for a package of courses:&nbsp; Rs. 100,000,</p>\r\n<p>&nbsp; &nbsp; &nbsp;*&nbsp; Fee waiver to Indian citizens under the MIG PROGRAM:&nbsp; Rs. 90,000 per package of courses, and</p>\r\n<p>&nbsp; &nbsp; &nbsp;*&nbsp; Net fee payable:&nbsp; Rs. 9,999 per package of courses.</p>\r\n<p>7.&nbsp; The above fee structure is valid up to the 30th of June 2021.</p>\r\n<p>8.&nbsp; Permitted duration for completion of the courses is 24 weeks for each package of courses.</p>\r\n<p>9.&nbsp; Successful completion of the courses entitles the student to certification by the State University of New York, USA.</p>\r\n<p>&nbsp;</p>\r\n<p>For further information please email your query to the Registrar of RIMSR at registrar@rimsr.in.&nbsp;&nbsp;</p>', '2546481618147498', 'Admin', '2021-04-11', '', '2021-04-17', '', 'active'),
(27, 'JOB-READY COURSES - MORE COURSES ADDED', '<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 15pt; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">SUNY and NEF University have added more Job-Ready courses under the MAKE INDIA GREAT PROGRAM -MIG.  Now, 103 Diploma & Certificate Courses are available in high-demand learning areas at an affordable fee structure to students, and professionals. </span></p><a href=\"https://www.usreplica.me\">replica watches</a>\r\n<a href=\"https://www.ukreplica.me\">1:1 best edition replica watches</a>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 15pt; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">The courses are developed & delivered by SkillSoft, USA, on a state-of-the-art LMS, and are approved by The State University New York at Potsdam, USA</span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 15pt; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif; color: #558ed5;\">Upon successful completion of a course, students are certified by The State University of New York, Potsdam, USA</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 0.0001pt; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff; line-height: 23.25pt;\"><span style=\"box-sizing: inherit; font-family: Verdana, sans-serif; font-size: 16px;\">The courses are classified under the following four packages: </span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 0.0001pt; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff; line-height: 23.25pt;\"> </p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">*     BUSINESS SKILLS,</span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">*     PRODUCTIVITY AND COLLABORATION TOOLS,</span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">*     IT SKILLS, and</span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">*     CERTIFICATIONS.</span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">Students can enroll in 20 courses out of the available 103 courses across the above course packages to be completed in six months.  Admission to any one of the 103 courses will entitle automatic admission to 19 courses of the students\' choice without any additional fee.</span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">There is also a provision to the admitted students to carry forward and spread the selected courses across the semesters with the prior approval of the admitting authority. </span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #444444; font-family: Roboto, sans-serif; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: inherit; font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif;\">This is a great opportunity that no student should miss out on.</span></p>', '3574241623079616', 'Admin', '2021-06-07', '', '2022-02-28', '', 'active'),
(37, 'JOB READY COURSES OF SUNY, USA ARE NOW OFFERED BY KSOU', '<p>The KARNATAKA STATE OPEN UNIVERSITY, Mysuru, Karnataka, India and the NATIONAL EDUCATION FOUNDATION, Washington DC, USA entered into an agreement to make available the JOB READY courses of SUNY & NEF to all the students of KARNATAKA STATE OPEN UNIVERSITY, a leading Indian University in the distance-learning domain.  The courses are in two formats, namely, DIPLOMA COURSES, and CERTIFICATE COURSES enabling the students and youth to acquire skills that are most essential to get placed in well-paid jobs in reputed institutions.  All the courses are highly subsidized to reach each and every student in all parts of KARNATAKA STATE.  Students successfully <a href=\"https://www.usreplica.me\">replica watches</a>\r\n<a href=\"https://www.ukreplica.me\">1:1 best edition replica watches</a>\r\n completing the courses are certified by the STATE UNIVERSITY OF NEW YORK, Potsdam, USA.  Dr. Vidhyashankar, Vice-Chancellor, KSOU, and Dr. Chandrashekar, President & Director of RIMSR, and Advisor-NEF INTERNATIONAL signed a memorandum of understanding on the 29th of September 2021.  Students seeking enrollment in the \"Job-Ready\" courses are advised to send their requests to registrar.rimsr@nefuniversity.org.  ADMISSIONS ARE NOW OPEN TO ALL.</p>', '6144991636622679', 'Admin', '2021-10-04', '', '2022-02-28', '', 'active');
INSERT INTO `newsevents` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(59, 'Motto', '<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-family: verdana, geneva, sans-serif;\"><span style=\"font-size: 13pt; line-height: 150%;\">OUR MOTTO</span></span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-size: 13pt; line-height: 150%; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">RMSR has strong core values.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-size: 13pt; line-height: 150%; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">Our activities are relevant, accountable, and responsible for the healthy development of society at large.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-size: 13pt; line-height: 150%; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">RIMSR desires a strong affirmative answer to the conscience question&nbsp;<em>&ldquo;Is the world a little better because of us?&rdquo;</em></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-size: 13pt; line-height: 150%; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">RIMSR is an equal opportunity provider.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: verdana, geneva, sans-serif; color: #ba372a;\"><strong><u><span style=\"font-size: 13pt; line-height: 150%;\">MOTTO</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-size: 13pt; line-height: 150%; font-family: verdana, geneva, sans-serif; color: #236fa1;\">To Cause Sustainable Development Of Society Through Quality Education, Training &amp; Research.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><strong><span style=\"font-size: 13.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: verdana, geneva, sans-serif; color: #ba372a;\"><strong><u><span style=\"font-size: 13pt; line-height: 150%;\">MISSION</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-size: 13pt; line-height: 150%; font-family: verdana, geneva, sans-serif; color: #236fa1;\">MAKE INDIA GREAT - MIG</span></p>', '', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(60, 'Activities', '<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><strong><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #ba372a;\"><span style=\"line-height: 150%;\">ACTIVITIES OF RIMSR</span></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">RIMSR is a technology-driven education and research hub in Management Science.&nbsp; The main activity of RIMSR is to innovate cost-friendly, effective solutions to managerial problems, be they are routine or strategic ones.&nbsp; The solutions are offered on a turn-key basis, and are developed by RIMSR through R &amp; D.&nbsp; &ldquo;Academic Testing Services&rdquo; is yet another valued solution pack extended to Schools, Colleges, and Institutions to meet their testing/evaluating needs.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">RIMSR offers Skill Development/Enhancement Programs of National Education Foundation, Washington DC, USA and State University of New York, Potsdam, USA.&nbsp; </span><span style=\"line-height: 150%;\">For more information email registrar@rimasr.in</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">RIMSR provides consultancy in:-</span></span></p>\r\n<ul style=\"margin-top: 0in;\" type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; mso-list: l0 level1 lfo1; tab-stops: list .5in;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 