ss=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; mso-list: l1 level1 lfo2; tab-stops: list .5in;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">Big Data Analytics</span></span></li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; mso-list: l1 level1 lfo2; tab-stops: list .5in;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">Portfolio Management</span></span></li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; mso-list: l1 level1 lfo2; tab-stops: list .5in;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">MSME Management</span></span></li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; mso-list: l1 level1 lfo2; tab-stops: list .5in;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">Business Simulation Game</span></span></li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; mso-list: l1 level1 lfo2; tab-stops: list .5in;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">International Business</span></span></li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; mso-list: l1 level1 lfo2; tab-stops: list .5in;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt; color: #236fa1;\"><span style=\"line-height: 150%;\">Saral Shikshak Program</span></span></li>\r\n</ul>', '', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(84, 'Sadagopan', '<p style=\"background: white; text-align: justify;\"><strong><span lang=\"EN-IN\" style=\"font-family: verdana, geneva, sans-serif; color: #ba372a;\">PROF. (DR.) SADAGOPAN</span></strong></p>\r\n<p style=\"background: white; text-align: justify;\"><span lang=\"EN-IN\" style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">Prof. (Dr.) Sadagopan, Founder and Ex-Director of IIIT, Bengaluru, India is a graduate of Madras University, India, and Purdue University, USA. He taught for 25+ years at IIT Kanpur, IIM Bangalore, IIT Madras, and IIITBangalore in addition to short teaching assignments at RUTGERS, USA and AIT, Bangkok.</span></p>\r\n<p style=\"background: white; text-align: justify;\"><span lang=\"EN-IN\" style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">He has authored seven books, several book chapters, and papers. He is also a Fellow of IEE (UK) and the Computer Society of India. He is a Senior Member of IEEE, ACM, and AIS.</span></p>\r\n<p style=\"background: white; text-align: justify;\"><span lang=\"EN-IN\" style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">Prof. Sadagopan consults widely across different industry segments (Auto, Manufacturing, Banking, IT, and Social Sector) and lectures extensively at corporations, industry events, and universities in North America, South America, Europe, Middle East, Asia, Australia, and New Zealand on all aspects of IT.</span></p>\r\n<p style=\"background: white; text-align: justify;\"><span lang=\"EN-IN\" style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">He serves on the boards of Bharat Electronics, Neyveli Lignite Corporation, and Indian Renewable Energy Agency and IIIT Bhubaneshwar, IIIT-Delhi and IBAB earlier he was also on the Board of Bank of India, NMDC, VisualSoft, Megasoft, Informatics, and Shawman Software. Prof. Sadagopan is a Member of the Karnataka Knowledge Commission, Chief Minister\'s Vision Group on IT, NASSCOM Regional Council, and ISA Executive Council. He is the Chair of IEEE Computer Society, Bangalore Chapter, and a Member of ACM India Council.</span></p>\r\n<p style=\"background: white; text-align: justify;\"><span style=\"color: #236fa1; font-family: verdana, geneva, sans-serif;\"><span lang=\"EN-IN\"><!-- [if !supportLineBreakNewLine]--><!--[endif]--></span><span lang=\"EN-IN\">Prof. (Dr.) Sadagopan is the Chairman of the Governing Council of RIMSR.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 10.4pt; line-height: 150%; background: white; text-align: justify;\">&nbsp;</p>', '1474081531917136', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(85, 'Our Motto', '<p class=\"MsoNormal\"><strong><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #ba372a;\">OUR MOTTO</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">RIMSR has strong core values.&nbsp;Our activities are socially relevant, accountable, and responsible for society at large.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">RIMSR desires a strong affirmative answer to the conscience question &ldquo;is the world a little better because of us?&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">RIMSR is an equal opportunity provider.</span></p>\r\n<div style=\"mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; background: #C00000;\">\r\n<p class=\"MsoNormal\" style=\"text-align: center; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: none; padding: 0cm;\" align=\"center\"><strong><u><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; color: white; mso-themecolor: background1;\">OUR MOTTO</span></u></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: none; padding: 0cm;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; color: white; mso-themecolor: background1;\">To Cause Sustainable Development Of Society Through Quality Education, Training &amp; Research.</span></strong></p>\r\n</div>\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; color: #558ed5; mso-themecolor: text2; mso-themetint: 153; mso-style-textfill-fill-color: #558ED5; mso-style-textfill-fill-themecolor: text2; mso-style-textfill-fill-alpha: 100.0%; mso-style-textfill-fill-colortransforms: \'lumm=60000 lumo=40000\';\">&nbsp;</span></strong></p>\r\n<div style=\"mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; background: #C00000;\">\r\n<p class=\"MsoNormal\" style=\"text-align: center; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: none; padding: 0cm;\" align=\"center\"><strong><u><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; color: white; mso-themecolor: background1;\">OUR MISSION</span></u></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: none; padding: 0cm;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; color: white; mso-themecolor: background1;\">MAKE OUR PLANET A PROSPEROUS, HARMONIOUS, PEACEFUL, AND HAPPY PLACE.</span></strong></p>\r\n</div>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\">&nbsp;</p>', '9302551531987845', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(86, 'Objectives', '<p class=\"MsoNormal\" style=\"text-align: left;\" align=\"center\"><span style=\"color: #ba372a;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14pt; line-height: 115%; font-family: Verdana, \'sans-serif\';\">OBJECTIVES</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The objectives of RIMSR are:</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">&middot;</span><span style=\"font-family: Verdana, \'sans-serif\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Verdana, \'sans-serif\';\">Impart quality management education at graduate, post-graduate, and doctoral levels.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">&middot;</span><span style=\"font-family: Verdana, \'sans-serif\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Verdana, \'sans-serif\';\">Inspire, Promote, &amp; Support Research and Innovation to make mankind happy, healthy, and prosperous.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">&middot;</span><span style=\"font-family: Verdana, \'sans-serif\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Verdana, \'sans-serif\';\">Instill skills, knowledge, and attitude in students and executives to make them effective problem-solvers.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">&middot;</span><span style=\"font-family: Verdana, \'sans-serif\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Verdana, \'sans-serif\';\">Conduct capacity-building programs, and skill training through \"Job-Ready\" courses.&nbsp;&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">&middot;</span><span style=\"font-family: Verdana, \'sans-serif\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Verdana, \'sans-serif\';\">Enlighten students and youth of their civic duties and social responsibilities.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">&middot;</span><span style=\"font-family: Verdana, \'sans-serif\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Verdana, \'sans-serif\';\">Impart life skills through digital, financial, and business literacy programs.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">&middot;</span><span style=\"font-family: Verdana, \'sans-serif\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Verdana, \'sans-serif\';\">Become a vision-driven role-model institution.</span></span></p>', '1979451531988437', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(87, 'Activities of RIMSR', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">ACTIVITIES OF RIMSR</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">RIMSR is a technology-driven education and research hub in Management Science.&nbsp; The main activity of RIMSR is to innovate cost-friendly, effective solutions to managerial problems, be they are routine or strategic ones.&nbsp; The solutions are offered on a turn-key basis, and are developed by RIMSR through R &amp; D.&nbsp; &ldquo;Academic Testing Services&rdquo; is yet another valued solution pack extended to Schools, Colleges, and Institutions to meet their testing/evaluating needs.</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">RIMSR provides consultancy in:-</span></p>\r\n<ul style=\"margin-top: 0cm;\" type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Business Strategy.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Customized Solutions to Organizational Challenges.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Institutional Capacity Building.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Corporate Planning, Developing Mission Statements, and &lsquo;Customized Road Mapping&rsquo;.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Supply-Chain Management.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Designing Procurement Policies to meet the specific needs of clients.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Angel Investment for Industries in Financial Distress.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Venture Capital assistance to &ldquo;Start-Ups.&rdquo;</span></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Besides, RIMSR conducts the following Certificate Courses:-</span></p>\r\n<ul style=\"margin-top: 0cm;\" type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Credit Risk Management &ndash; Assessment, and Mitigation: Techniques &amp; Methodologies.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Project Appraisal, Implementation, and Monitoring.</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">NPA Management</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Business Finance</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Health Care Management</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Supply-Chain Management</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Project Management</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Production Management</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Entrepreneurial Development</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Digital, Financial and Business Literacy</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Business Analytics</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Big Data Analytics</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Business Simulation Games</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Portfolio Management</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">MSME Management</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Saral Shikshak Program</span></li>\r\n<li class=\"MsoNormal\" style=\"color: #323e4f; margin-top: 6.9pt; margin-bottom: 6.9pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;\"><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; color: #236fa1;\">Skill Development Programs of NEF University, Washington DC, and the State University of New York, Potsdam, USA.</span></li>\r\n</ul>', '5615271531991527', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(88, 'Academic Testing Services', '<p class=\"MsoNormal\" style=\"line-height: 115%; text-align: justify;\"><span style=\"color: #ba372a;\"><strong>ACADEMIC TESTING SERVICES</strong></span></p>\r\n<h4 style=\"line-height: 200%; background: white; margin: 6.9pt 0in; text-align: justify;\"><span style=\"font-size: 12pt; line-height: 200%; font-family: verdana, geneva, sans-serif; color: #236fa1; letter-spacing: 0.7pt;\">It is one of the important activities of RIMSR. Schools, Colleges, and Professional Institutions avail the Testing Services to conduct tests and examinations to students, apprentices, and employees on a virtual platform.</span></h4>\r\n<h4 style=\"line-height: 200%; background: white; box-sizing: border-box; font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px; margin: 6.9pt 0in; text-align: justify;\"><span style=\"font-size: 12pt; line-height: 200%; font-family: verdana, geneva, sans-serif; color: #236fa1; letter-spacing: 0.7pt;\">Under this activity, institutions can avail end-to-end testing solutions, that is, right from the stage of setting the test paper, conducting the test/examination on the scheduled date and time, evaluation of the answer scripts, preparation of a statement of grades/marks, and submission of the results to the institutions.&nbsp; However, the testing process can be customized to meet the needs of the participating institutions.</span></h4>\r\n<h4 style=\"line-height: 200%; background: white; box-sizing: border-box; font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px; margin: 6.9pt 0in; text-align: justify;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 12pt;\"><span style=\"line-height: 200%; color: #236fa1; letter-spacing: 0.7pt;\">The testing process is on a secured online platform with double-end encryption.&nbsp; Secrecy and security of the examination process are 100% without any scope for loose-ends at any stage.&nbsp; RIMSR enters into &ldquo;NON-DISCLOSURE(SECRECY) AGREEMENT&rdquo; with schools/colleges/</span><span style=\"line-height: 200%; color: #236fa1; letter-spacing: 0.7pt;\">institutions availing the testing services.</span></span></h4>', '3692241531992622', 'Admin', '0000-00-00', '', '2021-11-22', '', 'active');
INSERT INTO `newsevents` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(89, 'Expert Certificate Programs', '<p class=\"MsoNormal\"><span style=\"color: #ba372a;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">EXPERT CERTIFICATE PROGRAM</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Courses in the \"Expert Certificate Program\" are in the following specializations:</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -0.25in; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Project Management</span></strong></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Data Science</span></strong></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Machine Learning</span></strong></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">CyberSecurity</span></strong></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Big Data</span></strong></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Cloud Computing &amp; Virtualization</span></strong></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">BlockChain</span></strong></span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent: -0.25in; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Deep Learning</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">All the above are \"Post-Graduate Diploma Courses\" and are offered in a package of three courses.&nbsp; It\'s the student\'s choice to select any of the above courses and build a customized package based on his learning needs.&nbsp; The maximum duration for completion of the courses chosen is 12 months.&nbsp;&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">CERTIFICATION:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Successful students are eligible for joint certification by the STATE UNIVERSITY OF NEW YORK, Potsdam &amp; the NATIONAL EDUCATION FOUNDATION, Washington DC, USA.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The STATE UNIVERSITY OF NEW YORK is an accredited University by the Department of Education, Government of the United States of America, and also recognized by the UNIVERSITY GRANTS COMMISSION, Government of India.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">COURSE WORK:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><em><u><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Foundation Courses (Common to all the Expert Certificate Programs):</span></u></em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">FC 607 Management Basics&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">FC 608 Basics of Economics and Statistics</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">FC 609 Fundamentals of Accounting &amp; Strategic Financial Management</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">FC 610 Managing the Human Resource in The 21st Century</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">FC 611 Effective Marketing &amp; Basic Selling Skills</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">(*Exempted for ACA, AICWA, ACS, FCA, M.Com, MBA, B.Com, BBM, BBA Graduates, and others as decided by RIMSR).</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><em><u><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Concentration Courses:</span></u></em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><em><u><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">PROJECT MANAGEMENT</span></u></em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CC 501 Principles of Project Management</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CC 502 Project Leadership</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CC 503 Project Best Practices &ndash; I</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CC 504 Project Best Practices &ndash; II</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CC 505 Project Practicum.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><em><u><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">DATA SCIENCE</span></u></em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 001 Data Science Essentials</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 002 Python for Data Science</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 003 Data Science Using R</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 004 Streaming Data Architectures</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 005 Implementing Data Access &amp; Governance Policies</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 006 Statistics for Data Science #1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 007 Statistics for Data Science #2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 008 MongoDB for Data Wrangling</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 009 Trifacta for Data Wrangling</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 010 Deploying Data Tools for All Users</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 012 Data Engineering Fundamentals</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 013 Data Lakes in Practice</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 014 Integrating Data Sources from the Edge</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 015 Creating Data APIs for Customers</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 016 Raw Data to Insights</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 017 Data Research in Practice</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 018 Enterprise Value Through Data</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 019 Using Data to Find Data</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 020 Data Visualization with Tableau for Beginners</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 021 Data Visualization Essentials</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 022 Tableau Data Visualization and Analytics</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 023 Talend Data Integration</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDS 024 Math for Data Science</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><em><u><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">MACHINE LEARNING</span></u></em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCML 001 Perform Cloud Data Science with Azure Machine Learning</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCML 002 Powering Recommendation Engines</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCML 003 Linear Regression Models</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;