>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 011 Balancing the Four Vs of Data</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 012 Apache Storm Introduction</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 013 Apache Kafka</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 014 Apache Solr Essentials</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 015 Designing and Implementing Big Data Analytics</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 016 Big Data Development with Apache Spark</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 017 Hadoop-Data Modeling, Installation and Maintenance</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 018 Hadoop Operations</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 019 Hadoop Ecosystem</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBD 020 Getting Started with Hadoop</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><em><u><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">CLOUD COMPUTING &amp; VIRTUALIZATION</span></u></em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 001 Cloud and Virtualization Fundamentals</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 002 Cloud Computing for Business Professionals</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 003 Cloud Computing for IT Professionals</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 004 Cloud Computing Technology Fundamentals</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 005 CompTIA Cloud+ CVO-002</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 006 Getting Started with Cloud Services</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 007 Cloud Computing for Support Engineers</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 008 Major Cloud Run and Compute Platforms</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 009 Cloud Standards</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 010 Cloud Security</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 011 Cloud Security Management</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 012 Cloud Platform Security</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 013 Cloud Computing Security</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 014 Business Continuity Management</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 015 Certified Cloud Security Professional</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 016 Cloud Security Administration</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 017 CloudOps</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCCV 018 Hybrid Cloud</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><em><u><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">BLOCKCHAIN</span></u></em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 001 Blockchains &amp; Ethereum: Introduction</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 002 Blockchains &amp; Ethereum: Performing Transactions in Ethereum</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 003 Blockchains &amp; Ethereum: Mining and Smart Contracts in Ethereum</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 004 Blockchains &amp; Ethereum: Storing Data</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 005 Blockchains &amp; Ethereum: Smart Contract Development</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 006 Blockchains &amp; Ethereum: Metmask &amp; the Ethereum Wallet</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 007 Blockchains &amp; Ethereum: The Geth Client</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 008 Blockchains &amp; Ethereum: Lifecycle of a Smart Contract</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">CCBC 009 Blockchains &amp; Ethereum: Tool for Smart Contract Development&nbsp;</span><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">&amp; Ethereum</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 010 Blockchains CCBC 010 Blockchains &amp; Ethereum</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 011 Blockchain Smart Contracts Programmer</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 012 Blockchain Engineer</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCBC 013 Blockchain Solutions Architect</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><em><u><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">DEEP LEARNING</span></u></em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 001 Getting Started with Neural Networks</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 002 Building Neural Networks</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 003 Training Neural Networks</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 004 Convolutional Neural Networks</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 005 Sequence Models</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 006 Recurrent Neural Networks</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 007 ML Algorithms</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 008 Linear Algebra</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 009 Linear Regression Models</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 010 Computational Theory</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 011 Model Management</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 012 Bayesian Methods</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 013 Reinforcement Learning</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 014 Math for Machine Learning</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 015 Building ML Training Sets</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">CCDL 016 Linear Models and Gradient Descent</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">ADMISSION CRITERIA:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The following are the admission requirements:-</span></p>\r\n<ul style=\"text-align: justify;\" type=\"disc\">\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Bachelor&rsquo;s Degree from a Recognized University.</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">An average score of 50% and above in the Bachelor&rsquo;s Degree Program.</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Test Score of any one of the following:- CAT/MAT/XAT/ATMA/CMAT or Any Other Management Aptitude Test (Subject to Review/Waiver)</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Performance in the Entrance Test, and/or Pre-Admission Interview.</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Official Transcripts from every undergraduate and graduate institution attended.</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Work experience is preferred and may entitle waiver of any of the eligibility criteria given above. The decision of NEF University in this regard is final and binding.</span></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">CRITERIA FOR GRADUATION:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The grading criteria for a pass in the tests/ examinations will be as per the norms prescribed by RIMSR, as detailed below:-</span></p>\r\n<ul style=\"text-align: justify;\" type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"color: #00b050; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo2; tab-stops: list .5in;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">A grade of &ldquo;A&rdquo; signifies an exceptional, clear, and creative grasp of the concepts of the course with a demonstrated ability to apply this knowledge to specific problem situations. It also means that the student has actively participated in in-class activities and has completed all material in a neat and timely manner. The material indicates that the student spent extra time, personal energy, and critical reflection to demonstrate exceptional work.&nbsp;&nbsp;</span><span style=\"color: #169179;\"><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Grades of 90% and above are rated as &ldquo;A&rdquo; and deemed to have passed the examination in the First Division.</span></strong></span></span></li>\r\n<li class=\"MsoNormal\" style=\"color: #00b050; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo2; tab-stops: list .5in;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">A grade of &ldquo;B&rdquo; signifies a solid and required understanding of the major concepts of the course and the ability to apply those concepts. It also means that the student&rsquo;s effort and class participation have exceeded the minimal basic requirements for the course. All assignments are judged to be solid in content and completed within time. This is deemed to be the minimum criteria acceptable for graduate-level student performance.&nbsp;</span><span style=\"color: #169179;\"><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Grades in the range of 60% and 89% are rated as &ldquo;B&rdquo; and deemed to have passed the examination in the Second Division.</span></strong></span></span></li>\r\n<li class=\"MsoNormal\" style=\"color: red; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo2; tab-stops: list .5in;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">A grade of &ldquo;C&rdquo; signifies a below-average demonstration and application of the concepts of the course and/or inadequate preparation in-class activities.&nbsp;</span><span style=\"color: #e03e2d;\"><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">Grades below 60% are rated as &ldquo;C&rdquo; and deemed to have failed in the examination.</span></strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Segoe UI\';\">&nbsp;</span></span></span></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">FEE STRUCTURE:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The fee for a package of three(3) courses is Rs. 150,000 that including e-tutorials, reading materials, assignments, tests, examinations, and certification.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The fee is payable through bank transfer and the details are as below:</span></p>\r\n<table class=\"MsoNormalTable\" style=\"background: white;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 1.75in; border-width: 1pt; border-image: initial; padding: 0in;\" width=\"210\">\r\n<p class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">BANK:</span></p>\r\n</td>\r\n<td style=\"width: 310.5pt; border-top-width: 1pt; border-right-width: 1pt; border-bottom-width: 1pt; border-image: initial; border-left: none; padding: 0in;\" width=\"518\">\r\n<p class=\"MsoNormal\"><span style=\"font-family: Ve