INSERT INTO `newsevents` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(90, 'Certificate Programs', '<p class=\"MsoNormal\"><span style=\"color: #ba372a;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">CERTIFICATE PROGRAMS:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The following Certificate Programs are offered:</span></p>\r\n<ul style=\"text-align: justify;\" type=\"disc\">\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Big Data Analytics</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Business Analytics</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Supply Chain Management</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Project Management</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Business Finance</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">International Business</span></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">All the above are \"Post-Graduate Certificate Courses\" and are offered in a package of three courses.&nbsp; It\'s the student\'s choice to select any of the above courses and build a customized package based on his learning needs.&nbsp; The maximum duration for completion of the courses chosen is 6 months.&nbsp;&nbsp;</span><u></u></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">ELIGIBILITY CRITERIA:</span></u></strong></span></p>\r\n<ul style=\"text-align: justify;\" type=\"disc\">\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Bachelor&rsquo;s Degree from a recognized university.</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Students pursuing graduate programs in their final semester can apply.</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Official transcripts from every undergraduate and graduate institution attended.</span></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Students in the final semester of their degree programs are permitted to take the above programs, subject to the submission of the degree certificate before receiving the certificate of completion of the program.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">All the courses are delivered online.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">CERTIFICATION:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Successful students are eligible for joint certification by the STATE UNIVERSITY OF NEW YORK, Potsdam, and the NATIONAL EDUCATION FOUNDATION, Washington DC, USA.&nbsp; The STATE UNIVERSITY OF NEW YORK is an accredited University by the Department of Education, Government of the United States of America, and also recognized by the UNIVERSITY GRANTS COMMISSION, Government of India.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">COURSE WORK:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-family: Verdana, \'sans-serif\';\">CERTIFICATE PROGRAM ON BIG DATA ANALYTICS</span></u></strong></span></p>\r\n<table class=\"MsoNormalTable\" style=\"width: 358.8pt; background: white;\" border=\"1\" width=\"598\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; height: .3in;\">\r\n<td style=\"width: 372.7pt; border-width: 1pt; border-image: initial; padding: 0in; height: 0.3in;\" width=\"621\">\r\n<p class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">COURSES</span></p>\r\n</td>\r\n<td style=\"width: 79.4pt; border-top-width: 1pt; border-right-width: 1pt; border-bottom-width: 1pt; border-image: initial; border-left: none; padding: 0in; height: 0.3in;\" width=\"132\">\r\n<p class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">NUMBER</span></p>\r\n</td>\r\n</tr>\r\n<tr style=\"mso-yfti-irow: 1; height: .3in;\">\r\n<td style=\"width: 372.7pt; border-right-width: 1pt; border-bottom-width: 1pt; border-left-width: 1pt; border-image: initial; border-top: none; padding: 0in; height: 0.3in;\" width=\"621\">\r\n<p class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Big Data Fundamentals</span></p>\r\n</td>\r\n<td style=\"width: 79.4pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-right-width: 1pt; padding: 0in; height: 0.3in;\" width=\"132\">\r\n<p class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">BDCP-001</span></p>\r\n</td>\r\n</tr>\r\n<tr style=\"mso-yfti-irow: 2; height: .3in;\">\r\n<td style=\"width: 372.7pt; border-right-width: 1pt; border-bottom-width: 1pt; border-left-width: 1pt; border-image: initial; border-top: none; padding: 0in; height: 0.3in;\" width=\"621\">\r\n<p class=\"MsoNormal\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #