dana, \'sans-serif\'; color: #236fa1;\">The grading system is as follows:</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">A grade of &ldquo;A&rdquo; signifies an exceptional, clear, and creative grasp of the concepts of the course with a demonstrated ability to apply this knowledge to specific problem situations. It also means that the student has actively participated in &ldquo;in-class&rdquo; activities, has completed all the material on time, has put in extra effort, and demonstrates exceptional work.&nbsp;</span><span style=\"color: #169179;\"><strong><span style=\"font-family: Verdana, \'sans-serif\';\">Grading of 90% and above is rated as an &ldquo;A&rdquo;, meaning the student has passed the program in the First Division.</span></strong></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">A grade of &ldquo;B&rdquo; signifies a solid and required understanding of the major concepts of the course and the ability to apply those concepts. It also means that the student&rsquo;s effort and participation have exceeded the minimal basic requirements for the course. All assignments are judged to be solid in content and completed on time. This is deemed to be the minimum criteria acceptable.&nbsp;</span><span style=\"color: #169179;\"><strong><span style=\"font-family: Verdana, \'sans-serif\';\">Grading in the range of 60% and 89% is rated as a &ldquo;B&rdquo; grade, meaning the student has passed the program in the Second Division.</span></strong></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, \'sans-serif\';\">A grade of &ldquo;C&rdquo; signifies a below-average demonstration and application of the concepts of the course and/or inadequate preparation in-class activities. It may also indicate that assignments were not completed in a satisfactory or timely manner.&nbsp;</span><span style=\"color: #e03e2d;\"><strong><span style=\"font-family: Verdana, \'sans-serif\';\">Grades of below 60% are rated as &ldquo;C&rdquo; and are deemed to have failed.</span></strong></span><span style=\"font-family: Verdana, \'sans-serif\';\">&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\';\"><a style=\"color: #236fa1;\" href=\"https://www.rimsr.in/applicationgen.php\">CLICK HERE TO ENROLL</a></span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\';\"><a style=\"color: #236fa1;\" href=\"https://nefuniversity.skillport.com/skillportfe/login.action\">CLICK HERE TO SIGN-IN</a></span></strong></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: \'Verdana\',\'sans-serif\';\">&nbsp;</span></p>', '1143421531994184', 'Admin', '0000-00-00', '', '2021-12-22', '', 'active');
INSERT INTO `newsevents` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(91, 'SKILL ENHANCEMENT COURSES â€“ REGULATIONS', '<h4 style=\"line-height: 200%; margin: 6.9pt 0in 6.9pt 0in;\"><span style=\"text-decoration: underline;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, sans-serif; color: #323e4f; letter-spacing: 0.7pt; text-decoration: underline;\">SPECIALIZED SKILL DEVELOPMENT PROGRAM</span></strong></span></h4>\r\n<h4 style=\"line-height: 200%; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">The SPECIALIZED SKILL courses are designed to make the students \"job-ready.\"&nbsp; T</span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">he course structure, tutorials/ lessons, reading materials, assignments, case studies, tests, and examinations are developed by SKILLSOFT </span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">and Certified by the State University of New York, Potsdam, USA, and the NEF University, Washington DC, USA.&nbsp; </span></strong></h4>\r\n<h4 style=\"line-height: 200%; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">In India, the courses are delivered by RIMSR, an official partner, and an affiliate of NEF University, USA.</span></strong></h4>\r\n<h4 style=\"line-height: 200%; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">The courses give intensive exposure to theories behind </span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">concepts, and practical techniques to utilize the domain knowledge on&nbsp;</span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">the job.&nbsp;&nbsp;</span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">The highlights of the Program are:-</span></strong></h4>\r\n<h4 style=\"text-indent: -.25in; line-height: 200%; mso-list: l0 level1 lfo1; tab-stops: list .5in; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt .5in;\"><strong><span style=\"box-sizing: border-box; word-wrap: break-word;\"><!-- [if !supportLists]--><span style=\"font-size: 10pt; line-height: 200%; font-family: Symbol; color: #323e4f; letter-spacing: 0.7pt;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\"> &nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">Each course package provides 24/7 access.</span></span></strong><strong><span style=\"box-sizing: border-box; word-wrap: break-word;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">&nbsp;</span></span></strong></h4>\r\n<h4 style=\"text-indent: -.25in; line-height: 200%; mso-list: l0 level1 lfo1; tab-stops: list .5in; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt .5in;\"><strong><span style=\"box-sizing: border-box; word-wrap: break-word;\"><!-- [if !supportLists]--><span style=\"font-size: 10pt; line-height: 200%; font-family: Symbol; color: #323e4f; letter-spacing: 0.7pt;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\"> &nbsp;&nbsp;&nbsp; </span></span></span></strong><strong style=\"color: inherit; text-indent: -0.25in;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">The Course duration is 6 weeks.&nbsp;&nbsp;</span><span style=\"box-sizing: border-box; word-wrap: break-word;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">However, </span></span></strong><strong style=\"color: inherit; text-indent: -0.25in;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">the duration may be&nbsp;</span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">extended by 4 more weeks.</span></strong></h4>\r\n<h4 style=\"text-indent: -.25in; line-height: 200%; mso-list: l0 level1 lfo1; tab-stops: list .5in; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt .5in;\"><strong><!-- [if !supportLists]--><span style=\"font-size: 10pt; line-height: 200%; font-family: Symbol; color: #323e4f; letter-spacing: 0.7pt;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp; &nbsp; &nbsp;</span></span></strong><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">T</span></strong><strong style=\"color: inherit; text-indent: -0.25in;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">he courses are content-rich and world-class. Presented on a user-friendly LMS with online mentoring by subject specialists drawn from world-over.&nbsp; Additional hand-holding by professors and subject specialists is organized on-campus by RIMSR. </span></strong><strong style=\"color: inherit; text-indent: -0.25in;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">&nbsp;</span></strong></h4>\r\n<h4 style=\"text-indent: -.25in; line-height: 200%; mso-list: l0 level1 lfo1; tab-stops: list .5in; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt .5in;\"><strong><span style=\"box-sizing: border-box; word-wrap: break-word;\"><!-- [if !supportLists]--><span style=\"font-size: 10pt; line-height: 200%; font-family: Symbol; color: #323e4f; letter-spacing: 0.7pt;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\"> &nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">For courses completed with a score of 80% or more, the students get </span></span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\"><span style=\"box-sizing: border-box; word-wrap: break-word;\">course completion certificates from the State University of New York</span></span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">, Potsdam, USA, and the NEF University, Washington DC, USA.&nbsp; &nbsp;</span></strong></h4>\r\n<p><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">The courses are available in four (4) modules, namely:-</span></strong></p>\r\n<p style=\"line-height: 200%; margin: 0in 0in 6.9pt 0in;\"><strong><u><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">MODULE-I - BUSINESS SKILLS</span></u></strong></p>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, sans-serif; color: #323e4f; letter-spacing: 0.7pt;\">Business skills courses and simulations are available in the following specializations:-</span></strong></h4>\r\n<p><strong>Business Analysis;&nbsp;Change;&nbsp;Communications Skills; Corporate Social Responsibility;&nbsp;Customer Service;&nbsp;Finance and Accounting;&nbsp;Global Business;&nbsp;Human Resources;&nbsp;Industry Overviews;&nbsp;Leadership;&nbsp;Management;&nbsp;Marketing;&nbsp;Operations Management;&nbsp;Professional Effectiveness;&nbsp;Project Management;&nbsp;Sales;&nbsp;Strategy and Innovation; Technology in Business.&nbsp;</strong></p>\r\n<p style=\"line-height: 200%; margin: 0in 0in 6.9pt 0in;\"><strong><u><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">MODULE-II - PRODUCTIVITY TOOLS</span></u></strong></p>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, sans-serif; color: #323e4f; letter-spacing: 0.7pt;\">Productivity Tools are for professionals and students in the following specializations:-</span></strong></h4>\r\n<p><strong>Business Applications; Google; Graphics and Design; Internet; Microsoft Office 2010; Microsoft Office 2013; Microsoft Office 2016; Microsoft Office 365; Microsoft Office for Mac 2011; Mobile Devices and Computer Skills; Operating Systems; Productivity Tools and Supply-Chain Management.&nbsp;</strong></p>\r\n<p style=\"line-height: 200%; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><strong style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; word-wrap: break-word; text-decoration-line: underline;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">MODULE - III IT SKILLS</span></span></strong></p>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, sans-serif; color: #323e4f; letter-spacing: 0.7pt;\">IT Skills courses are available in the following specializations:-</span></strong></h4>\r\n<p><strong>Business Skills for IT Professionals; Cloud Computing and Virtualization; Data and Databases; Enterprise Resource Planning (ERP); Networks and Telecommunications; Operating Systems and Servers; Project Management; Software Design &amp; Development; Web Development and Graphic Design, Artificial Intelligence, Robotics, Internet of Things, Big Data, Business Analytics, Cybersecurity, Machine Learning, Data Science and many super-specialized areas.&nbsp;</strong></p>\r\n<p style=\"line-height: 200%; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><strong style=\"box-sizing: border-box;\"><u><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">MODULE-IV CERTIFICATIONS:-</span></u></strong></p>\r\n<h4 style=\"line-height: 200%; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, sans-serif; color: #323e4f; letter-spacing: 0.7pt;\">Courseware is available for the following certifications:-</span></strong></h4>\r\n<p><strong>(ISC)2;&nbsp;Amazon;&nbsp;American Society for Quality (ASQ);&nbsp;BCS Professional Certification;&nbsp;Cisco;&nbsp;CompTIA;&nbsp;International Software Testing Qualification Board (ISTQB);&nbsp;ITIL&reg; 4;&nbsp;Juniper;&nbsp;Linux Professional Institute (LPI);&nbsp;Microsoft;&nbsp;Oracle;&nbsp;Red Hat;&nbsp;Society for Human Resource Management (SHRM); TOGAF.&nbsp;</strong></p>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"text-decoration: underline;\"><span style=\"box-sizing: border-box; word-wrap: break-word;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, sans-serif; color: #323e4f; letter-spacing: 0.7pt; text-decoration: underline;\">FEE STRUCTURE FOR MODULES III AND IV</span>:-</span></span></strong></h4>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">All-inclusive, the fee per course is Rs. 40,000=00.&nbsp; </span></strong></h4>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">Students are eligible for MIGA scholarships instituted by NEF, Washington DC, USA in the form of fee waiver.&nbsp; The quantum of fee waiver will be decided upon by NEF, USA on case to case basis.</span></strong></h4>\r\n<p style=\"line-height: 200%; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><strong><span style=\"text-decoration: underline;\"><span style=\"box-sizing: border-box; word-wrap: break-word;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, sans-serif; color: #323e4f; letter-spacing: 0.7pt; text-decoration: underline;\">V HOW TO APPLY?</span></span></span></strong></p>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\"><a style=\"box-sizing: border-box; word-wrap: break-word;\" href=\"http://rimsr.in/applicationgen.php\"><span style=\"color: #323e4f; text-decoration-line: none;\">CLICK HERE</span></a>.</span></strong></h4>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, sans-serif; color: #323e4f; letter-spacing: 0.7pt;\">EMAIL&nbsp;<a style=\"box-sizing: border-box; word-wrap: break-word;\" href=\"mailto:registrar@rimsr.in\"><span style=\"color: #323e4f; text-decoration-line: none;\">registrar@rimsr.in</span></a></span></strong></h4>\r\n<p style=\"line-height: 200%; margin: 0in 0in 6.9pt 0in;\"><strong><span style=\"text-decoration: underline;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: 