hade: 191;\">414901010035609</span></strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"mso-yfti-irow: 7; box-sizing: border-box;\">\r\n<td style=\"width: 1.75in; padding: 0in 0in 0in 0in; box-sizing: border-box;\" width=\"168\">\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191;\">ACCOUNT NAME:</span></strong></h4>\r\n</td>\r\n<td style=\"width: 310.5pt; padding: 0in 0in 0in 0in; box-sizing: border-box;\" width=\"414\">\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191;\">RANGNEKAR INSTITUTE OF MANAGEMENT STUDIES AND RESEARCH</span></strong></h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 1.75in; padding: 0in 0in 0in 0in;\" width=\"168\">\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191;\">IMPORTANT NOTE:</span></strong></h4>\r\n</td>\r\n<td style=\"width: 310.5pt; padding: 0in 0in 0in 0in;\" width=\"414\">\r\n<h4 style=\"line-height: 200%; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">No fees shall be refunded after the commencement of the program.</span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191;\">&nbsp;</span></strong></h4>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h4 style=\"line-height: 200%; margin: 6.9pt 0in 6.9pt 0in;\">&nbsp;</h4>\r\n<h4 style=\"line-height: 200%; box-sizing: border-box; color: inherit; margin: 6.9pt 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">Under MIGA (MAKE INDIA GREAT AGAIN), SUNY-NEF-RIMSR has instituted a MERIT CERTIFICATION PROGRAM in professional colleges, educational institutions, and universities which helps the enrollees to ramp-up their professional skills to international expectations and place themselves on a global job-platform.&nbsp; For more information please email registrar@rimsr.in.&nbsp;&nbsp;</span></strong></h4>', '3433711531994774', 'Admin', '0000-00-00', '', '2020-09-16', '', 'active'),
(92, 'Study Abroad Facilitation', '<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-family: Verdana, \'sans-serif\';\">STUDY ABROAD FACILITATION(SAF) PROGRAM</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; margin-bottom: .0001pt;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Get Expert advice from top educationists about studying abroad.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.9pt 0cm; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">You are facilitated in the choice of Universities abroad, fulfilling admission formalities, preparation of &ldquo;STATEMENT OF PURPOSE,&rdquo; required financial certifications, recommendations, filing of applications, and assistance for the submission of visa applications; all wrapped up in one.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.9pt 0cm; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Post admission you are assisted in the choice of airlines, and accommodation at the place of your study.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.9pt 0cm; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">We monitor your academic program throughout your study period.&nbsp; Your sponsors are updated on your academic progress.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.9pt 0cm; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">We facilitate you in your internship and job placements.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.9pt 0cm; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Professionals from the Indian Diaspora will guide and counsel you at every stage.</span></p>\r\n<p class=\"MsoNormal\" style=\"background: white; margin: 6.9pt 0cm; text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Get admitted to top-rated Universities in the United States of America, Canada, Australia, and Europe.</span></p>', '7630381531996599', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(93, 'Business Game', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; margin-bottom: 15.0pt; line-height: 21.0pt; background: white;\"><span style=\"color: #ba372a;\"><strong><u><span style=\"font-size: 14pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">BUSINESS SIMULATION GAME</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Experience running your business in your own way and build your own strategies to succeed.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">&ldquo;MY BUSINESS-MY STRATEGIES&rdquo; &ndash; A Business Simulation Game that takes you closest to real-life situations and gives you an engaging business experience.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">What Is The Game About?</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Business and the markets in which we operate constantly evolve. But whether you manufacture the latest wearable electronics or sell tickets to upcoming events, the essential building blocks of business &ndash; Marketing, Finance, and Operations Management &ndash; remain the same.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Through the game, you get a chance to develop a holistic understanding of basic business principles from the very beginning in an engaging learning experience.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Each business discipline has its broad body of knowledge and can be mastered in theory, but the experience of how business works in practice can be the ideal foundation for deep and ongoing learning.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">The game introduces the basics of business parameters and demonstrates how the parameters are interlinked to each other and the nuances.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">The Game allows you to know business right from the stage of ideation to converting that into a business idea.&nbsp; It takes you through various stages of project preparation, project costing, marketing, production, sales, and business metrics. By running a whole business, you not only get a practical introduction to individual disciplines but develop a realistic context as the basis for a more complete understanding.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Key concepts include making essential decisions in production, finance, marketing/sales, exploring the cause-and-effect relationships between functional areas, and&nbsp;conducting competitive analysis.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">The Game is ideal for an introduction to business, accounting, management, and marketing executives, start-ups, and budding entrepreneurs. It has the flexibility to be used either in a team situation or individually.&nbsp; Whether you are a start-up enterprise or looking for a footing to establish your business, you stand to gain immensely by participating in this Game.&nbsp; Purely for this purpose, the cost of the game is kept unusually low.&nbsp;&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">Why Use The Business Game?</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Establishing a solid understanding of the basics of business is critical. Research shows people learn best by doing. The Simulation Game allows you to experience the inevitable compromises and trade-offs inherent in the decisions managers make every day in finance, operations, marketing, and other areas.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">To grasp how the individual business parameters impact the entire organization, nothing beats the experience of running a business in a competitive marketplace. The game provides that experience &mdash; without the real-world risk &mdash;along with the opportunity to build a product portfolio, manage costs, analyze the market and develop forecasts, all with an eye on cash flow and profitability.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">Highlights of the Business Game:</span></u></strong></span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 12pt; text-indent: -0.25in; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12.0pt; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\';\">Learn </span><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">to understand common business terminologies, business parameters, and their inter-relationships that form the foundation of a business.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 12pt; text-indent: -0.25in; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">Learn how marketing integrates with other business parameters.</span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 12pt; text-indent: -0.25in; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12.0pt; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\';\">Learn how finance relates to production.</span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 12pt; text-indent: -0.25in; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">Learn How marketing/sales strategies impact profitability.</span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 12pt; text-indent: -0.25in; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; &nbsp; </span></span></span><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">Importantly, learn in a risk-free environment the nuances of successfully establishing a business firm, and profitably running your firm. By making mistakes and learning how to correct them, you experience cross-functional integration firsthand. </span></span><span style=\"color: #236fa1;\"><span style=\"font-size: 12pt; font-family: Symbol;\"><span style=\"mso-list: Ignore;\"><span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;</span></span></span><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">&nbsp;&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: 21pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><u><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">What is the Fee?</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">The fee for a <strong>four-hour interactive business game (MB-MS)</strong> is INR 999/- for the Indian version and $ 99 for the US version.&nbsp;&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">For bulk registrations by Institutions email the Registrar of RIMSR at <a style=\"color: #236fa1;\" href=\"mailto:registrar@rimsr.in\"><span style=\"text-decoration: none;\">registrar@rimsr.in</span></a>.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\"><strong><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Under the \"MAKE INDIA GREAT GREAT PROGRAM\" the Business Game is available for free till the end of December 2022.</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\"><span style=\"font-size: 14pt; font-family: Verdana, \'sans-serif\'; color: #ba372a; letter-spacing: 0.7pt;\"><a style=\"color: #ba372a;\" title=\"Business Game\" href=\"../business/\"><span style=\"text-decoration: underline;\"><strong>CLICK HERE TO PLAY THE BUSINESS GAME</strong></span></a>&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: center;\">&nbsp;</p>', '0688591531997090', 'Admin', '0000-00-00', '', '2022-02-13', '', 'active'),
(94, 'William', '<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">PROF. (DR.) WILLIAM S LIGHTFOOT</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><span style=\"font-family: Verdana, sans-serif; color: #236fa1;\">Dr. William S Lightfoot holds an MS degree in Engineering from the University of North Carolina, Chapel Hill, USA, and an MBA from the prestigious UNC - Kenan-Flagler Business School, Chapel Hill, North Carolina, USA.&nbsp; He did his Ph.D. in Management from the famous Capella University, Minneapolis, USA.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><span style=\"font-family: Verdana, sans-serif; color: #236fa1;\">As Dean, College of Business and Mass Communication, Brenau University, Georgia, USA, he led a team of 27 full-time and over 130 part-time employees that doubled tuition revenue, while significantly improving quality (as measured by external assessment). By developing market-driven programs, and revitalizing marketing efforts, the College grew to over 1200 students at 5 campus locations and online. Developed innovative partnerships (Oxford @ Brenau) that increased the stature of the University in the community, which in turn helped increase enrollment in the MBA program, specifically from ~ 200 to over 600 students making it one of the most successful programs in Georgia, USA.&nbsp; </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><span style=\"font-family: Verdana, sans-serif; color: #236fa1;\">He completed an assignment in Tanzania where he transformed Village Inc. Africa into a collaborative initiative that provides capital and expertise that empowers rural communities in Sub-Saharan Africa through building healthy, high-quality homes and producing and installing locally sourced materials. Dr. Lightfoot worked for Jim Jacoby, COO of Jacoby Development.&nbsp; A born thinker and innovator, he initiated several innovative projects combining Jacoby\'s focus on creating a more sustainable environment.&nbsp; Over the past decade, he has led the creation of several social ventures including R.I.S.E., and Village Inc. Africa.&nbsp; He was also a partner in SCILS Management Training Center in Helsinki, Finland, and EPOCH Management in Atlanta, Georgia.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><span style=\"font-family: Verdana, sans-serif; color: #236fa1;\">He is currently Vice President of Product Operations at Southern New Hampshire University, USA.&nbsp; </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><span style=\"font-family: Verdana, sans-serif; color: #236fa1;\">He has a penchant for community development activities.&nbsp; His dearest vertical in RIMSR is the \"BUSINESS &amp; FINANCIAL LITERACY PROGRAM FOR THE RURAL ENTREPRENEUR.\" One of his missions is to identify and nurture a million entrepreneurs and start-ups in India and the world over.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%; font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: justify; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"font-family: Verdana, sans-serif; color: #236fa1;\">Dr. Lightfoot has lived in North America, Europe, and Africa, and has extensively toured all over India.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%; font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: justify; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"font-family: Verdana, sans-serif; color: #236fa1;\">He is Chief Advisor and on the Governing Council &amp; Board of Studies of RIMSR.</span></p>', '0360211531997575', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(95, 'SAMBASHIVAIAH', '<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">DR. S. SAMBASHIVAIAH</span></strong></p>\r\n<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\">An MBBS, MD in Internal Medicine, he is a Senior Physician in the medical fraternity. He served for over four decades as District Surgeon of major districts of Karnataka administering and managing huge hospitals of over 2000 beds each, having a patient load of 500 patients each day. During his term, he turned around the hospitals and made them well resourced, systems-oriented, patient-centric public hospitals. A thorough professional with a penchant for constant improvement in the medical services rendered to the general public at large. He is the Chairman of the Board of Studies and on the Governing Council of RIMSR.</span></strong></p>', '6526041531997967', 'Admin', '0000-00-00', '', '2019-07-26', '', 'active');
INSERT INTO `newsevents` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(96, 'PANKAJ SHARMA', '<p style=\"line-height: 115%; background: white; margin: 0cm 0cm 6.9pt 0cm;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">MR. PANKAJ SHARMA</span></strong></span></p>\r\n<p style=\"line-height: 115%; background: white; margin: 0cm 0cm 6.9pt 0cm;\"><span style=\"font-size: 11.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-bidi-font-family: \'Segoe UI\'; color: black;\">&nbsp;</span></p>\r\n<p style=\"line-height: 200%; background: white; box-sizing: border-box; overflow-wrap: break-word; margin: 0in 0in 6.9pt; text-align: justify;\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Mr. Pankaj Sharma brings a unique background of both technology and business acumen, with years of experience working with both Internet of Things (IoT), and connected car solutions. He is Vice-President-Product Management in \'VERRA MOBILITY\', a US-based enterprise.&nbsp; \'VERRA MOBILITY\' is a global leader in smart transportation.&nbsp; The Company serves customers by working behind the scenes to provide technology solutions to make mobility safer and easier.&nbsp; </span></p>\r\n<p style=\"line-height: 200%; background: white; box-sizing: border-box; overflow-wrap: break-word; margin: 0in 0in 6.9pt; text-align: justify;\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Before joining \'VERRA MOBILITY,\' Mr. Pankaj Sharma worked as Vice-President in \'NexTraq\' (one of the group companies of MICHELIN), and Product Manager at \'VERIZON,\' incubating connected car technologies and launching products including usage-based insurance programs and consumer telematics solutions.&nbsp; Prior to these positions, he worked in \'Wipro Technologies\' on implementing connectivity solutions for major cities and countries.</span></p>\r\n<p style=\"line-height: 200%; background: white; box-sizing: border-box; overflow-wrap: break-word; margin: 0in 0in 6.9pt; text-align: justify;\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Mr. Pankaj Sharma holds a Master of Science (MS) degree in Electrical Engineering from the University of California at San Jose, USA and a Master of Business Administration (MBA) from Georgia Institute of Technology, Atlanta, USA, an Ivy-Club University in the USA, specializing in Product Strategy and Marketing. He is also certified in \'Six Sigma Black Belt and Management of Technology\' by Scheller College of Business, USA.</span></p>\r\n<p style=\"line-height: 200%; background: white; box-sizing: border-box; overflow-wrap: break-word; margin: 0in 0in 6.9pt; text-align: justify;\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Mr. Pankaj Sharma is on the Board of Trustees of RIMSR, a member of the Governing Council, and a member of the Board of Studies.</span></p>', '1553401531998654', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(97, 'Chandrashekar', '<h2 style=\"background: white; margin: 13.85pt 0cm 6.9pt 0cm;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">PROF. (DR.) CHANDRASHEKAR</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">Has 3+ decades of experience in Senior and Top Management positions, pan-India and abroad. An alumnus of the prestigious HAL Management Academy, Bengaluru.</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">Dr. Chandrashekar was formerly Executive Director-Finance, Karnataka State Financial Corporation where he had rich experience for nearly three decades in all the phases of Project Management and assisted 5,000+ projects, both green, and brownfield projects. He specializes in \"Risk Management,\" and \"International Business.\"&nbsp;</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">With his wide network, he is responsible for the success of the \"e-hand-shake program,\" which is a launching platform for Indian MSMEs to go on the global platform and reach out to International Firms, Venture Capitalists, and Angel Investors. Apart, his passion is to build vocational skill-sets in teenagers as part of CSR initiatives and has developed a unique training module named \"Digital and Business Literacy Program\" so that teenagers become socially and economically relevant at an early age without giving scope for them to drift away from the main course.</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">With the vast experience he has in Project Management, he has developed the Business Simulation Game \"My Business-My Strategies,\" a great learning platform to understand the nuances of business.&nbsp;</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">His international experience includes work experience in the United Nations as Technical Advisor/Chief Technical Advisor for three years.</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">Dr. Chandrashekar is Director, NEF(India) since April 2020.&nbsp; H</span></strong><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">e is the \'Managing Trustee\' and \'President &amp; Director\' of RIMSR.&nbsp; He is on the Governing Council and Board of Studies of RIMSR.</span></strong></span></h2>', '0005251531999011', 'Admin', '0000-00-00', '', '2022-02-17', '', 'active'),
(98, 'HARSHA KESTUR', '<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; letter-spacing: 0.7pt;\">MR. HARSHA KESTUR</span></strong></span></p>\r\n<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">Graduated in Mechanical Engineering from the prestigious National Institute of Technology, Surathkal, Karnataka, India.&nbsp; He is a certified Materials Manager from the Indian Institute of Materials Management.&nbsp; He worked as General Manager &ndash; Global Procurement, at Wipro Technologies for over three decades. His specialization is in Supply-Chain Management, and Strategic Vendor Management.&nbsp;</span></p>\r\n<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><span style=\"color: #236fa1;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; letter-spacing: 0.7pt;\">Mr. Harsha is the </span><span style=\"font-family: Arial, sans-serif; letter-spacing: 0.933333px;\">Vice President of the Indian Institute of Materials Management, Bangalore Chapter.&nbsp; He </span><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; letter-spacing: 0.7pt;\">is on the Governing Council and Board of Studies of RIMSR.</span></span></p>', '6983091531999466', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(99, 'CHETHAN NAGARJ', '<h2 style=\"background: white; margin: 13.85pt 0cm 6.9pt 0cm;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">DR. CHETHAN NAGARAJ</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">An MBBS, MS (ORTHO), DNB (ORTHO), and MNAMS (ORTHO). An Orthopedic Surgeon of repute, with a specialization in Arthroscopy &amp; Sports Medicine, ISAKOS. Has a fellowship in Arthroscopy, and Arthroplasty from Australia. Expert in knee surgery with a fellowship in Australia. Fellowship in shoulder and elbow surgery from Australia and New Zealand. Additionally, he has a Fellowship in knee and shoulder surgery from Japan. He was heading the Orthopedic Department in \'Vikram Hospital\', and currently heads the Orthopedic Department in the Sagar Hospital,\' Bangalore, a reputed Corporate Hospital of international standard. He is on the Governing Council and Board of Studies of RIMSR. He also heads the \'Health Care Management and Nursing Education Committee\' at RIMSR.&nbsp;</span></strong></span></h2>', '0458441531999840', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(100, 'SUNIL NAGARAJ', '<h2 style=\"background: white; margin: 13.85pt 0cm 6.9pt; text-align: justify;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">MR. SUNIL NAGARAJ</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">A professional manager, engineer, and entrepreneur. Did his BS in Computer Science at the University of North Carolina, Chapel Hill, and an MBA from Harvard University, USA. He was Vice President at Bessemer Venture Partners, San Francisco, USA.&nbsp; Now, he is a Venture Capital Investor, and Managing Partner at \"Ubiquity Ventures\" in Palo Alto, California, USA. Prof. Sunil is a member of the Harvard Global Management Board, a coveted position, where he forms, shapes, and shares business strategies with Global Business Leaders.</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">He is on the Governing Council of RIMSR.&nbsp;</span></strong></span></h2>', '3956821532000925', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(101, 'CHANDRASHEKAR KAMDOLI', '<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; letter-spacing: 0.7pt;\">MR. CHANDRASHEKAR KAMDOLI</span></strong></span></p>\r\n<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; color: #236fa1; letter-spacing: 0.7pt;\">An M.Tech from Indian Institute of Science, Bengaluru, India, and a PMP, PMI, USA.&nbsp; Currently, he is Database Expert at APPLE Inc, San Francisco, Bay Area. Previously worked in CISCO Systems, Silicon Valley Bank,&nbsp; as Head of IT Department, Karnataka State Financial Corporation, Bengaluru, India for over fifteen years. He was keenly involved in the design, development, and implementation of IT interventions of the Government of Karnataka in its digital initiatives for good governance. A thoroughbred professional popularly called by his colleagues and peers as &lsquo;Database Champion.&rsquo; A seasoned IT Professional with vast experience. Prof. Kamdoli is on the Governing Council and Board of Studies of RIMSR.</span></p>', '4464431532001307', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(102, 'Prathap Singh', '<h2 style=\"background: white; margin: 13.85pt 0cm 6.9pt; text-align: justify;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">MR. PRATHAP SINGH</span></strong></span></h2>\r\n<h2 style=\"line-height: 150%; background: white; margin: 13.85pt 0in 6.9pt; text-align: justify;\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt; font-weight: normal;\">A management professional representing the US County/City Governments as International Marketing &amp; Business Development Coordinator with strong Government connections in India &amp; the US.&nbsp; He was Director, NASDAQ &amp; Bombay Stock Exchange-listed IT Companies, Empire State Building, New York; International Economic Development Coordinator for the Government in the US; Director, IT &amp; Services Company, Atlanta, Georgia; Vice President for Asian Indian Chamber of Commerce, Atlanta, Georgia, USA; Business Partner for LG CNS, a $ 150 billion South Korean conglomerate.&nbsp; His core skill-sets include Marketing, Business Development, CRM, PR, M&amp;A, International Liaison &amp; Lobbying with Governments, Stock Exchange listings, mergers, reverse mergers, demergers, fundraising, IPO, extensive connections with Investment bankers, Private Equity firms, Foreign Institutional Investors, Wall Street, NYSE, NASDAQ, Mumbai, London, Honk Kong &amp; Australian stock exchanges and high net worth Non-Resident Indians.&nbsp; Business apart, he is an avid baseball player. He is on the Governing Council of RIMSR.</span></strong></span></h2>', '1611931532002241', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active');
INSERT INTO `newsevents` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(103, 'MENTORS', '<p><strong>Programs of RIMSR are unique in nature, because, students have flexibility in their learning pattern and pace.&nbsp; However, students are always guided and facilitated by mentors whenever they have issues and find themselves at \"cross-roads.\" </strong></p>\r\n<p><strong>Mentoring is the USP of RIMSR\'s programs as students get exposed to \"business-knowledge\" as well as \"business-wisdom.\"&nbsp; </strong></p>\r\n<p><strong>Here are some of our mentors:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"104\" height=\"104\" /></p>\r\n<p><strong>PROF. SUNIL NAGARAJ </strong></p>\r\n<p><strong>A professional manager, engineer, \"space-nut\", and entrepreneur. Did BS in Computer Science at the University of North Carolina, Chapel Hill, and MBA from Harvard University, USA. He was Vice-President at Bessemer Venture Partners, San Francisco, USA. Now, he is a Venture Capital Investor, and Managing Partner at \"UBIQUITY VENTURES,\" Palo Alto, California, USA.&nbsp; Prof. Sunil is a member of the Harvard Global Management Board, a coveted position, where he forms, shapes, and shares business strategies with Global Business Leaders.&nbsp; He is one of the key mentors, apart from being on the Governing Council of RIMSR.</strong><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: \'Arial\',\'sans-serif\'; color: #323e4f; mso-themecolor: text2; mso-themeshade: 191; letter-spacing: .7pt;\"> &nbsp;</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"95\" height=\"101\" /></p>\r\n<p><strong>PROF. Venkatesh Hullikal.</strong> &nbsp;<strong>A brilliant engineer, and a solution provider. Currently, works for WIPRO holding a senior position.&nbsp; Has rich experience in applying IT to provide total solutions to management problems.&nbsp; Has rich international work experience.&nbsp; A charismatic leader and a team leader.&nbsp; Has a good blend of academics and experience.&nbsp; He is an asset to the institution he works for.&nbsp; Prof. Kullikal is on the Board of Studies of RIMSR.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"91\" height=\"96\" /></p>\r\n<p><strong>PROF. ANAND MIRJI.</strong>&nbsp; <strong>He brings in about 25 + years of experience from Wipro, HP, ANZ IT and Yahoo in wide-ranging domains. His strong execution experience comes from his vast experience in the areas of project execution, system development &amp; implementation, process &amp; quality. He has been a Six Sigma expert and driven execution excellence in many of his endeavors. Prof. Mirji is on the Board of Studies of RIMSR.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"93\" height=\"93\" /></p>\r\n<p><strong>PROF. CHANDRASHEKAR KAMDOLI.</strong>&nbsp; <strong>Senior IT professional and Database expert at APPLE Inc, San Francisco, Bay Area.&nbsp; Previously worked in CISCO Systems and Silicon Valley Bank. Did Masters in Computer Science in the Indian Institute of Science. He is a PMP, PMI, USA. Popularly called by his colleagues and peers as &lsquo;Database Champion.&rsquo;&nbsp; A seasoned IT Professional with vast experience.&nbsp; Prof. Kamdoli is on the Governing Council and Board of Studies of RIMSR.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"93\" height=\"93\" /></p>\r\n<p><strong>PROF. (DR.) MAHESH KUMAR, K.R</strong>.&nbsp; <strong>A Ph.D. in Management. Presently, Principal at Indo-Asian Academy, UG and PG Centre, Bangalore. He has a string of Post-Graduate Degrees. Highly rated faculty in Financial Management, and Marketing Management with over two and half decades of experience. His USP is his aptitude for teaching and research. Has authored more than 20 books covering various topics in Management.&nbsp; Prof. Mahesh Kumar is on the Board of Studies of RIMSR.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/jpeg;base64,\" alt=\"\" /></p>\r\n<p><strong>PROF. (DR.) CHETHAN NAGARJ, MBBS, MS (ORTHO), DNB(ORTHO), MNAMS (ORTHO)</strong>.&nbsp; <strong>An orthopedic surgeon of repute, with a specialization in Arthoscopy &amp; Sports Medicine, ISAKOS.&nbsp; Has a fellowship in Arthoscopy, and Arthroplasty from Australia.&nbsp; Expert in knee surgery with a fellowship in Australia.&nbsp; Fellowship in shoulder and elbow surgery from Australia and New Zealand. Additionally, he has a Fellowship in knee and shoulder surgery from Japan.&nbsp; Currently, heads the Orthopedic Department in Vikram Hospital in Bangalore, which is a 1000 bed reputed Corporate Hospital of international standard.&nbsp; He is on the Board of Studies of RIMSR.&nbsp; With his rich experience in hospitals internationally, he is the Prime Faculty in the Health Care Management Program of RIMSR.</strong></p>', '0448611532005443', 'Admin', '0000-00-00', '', '2019-11-19', '', 'active');
INSERT INTO `newsevents` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(104, 'About Us', '<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Verdana\',\'sans-serif\';\"><span style=\"color: #236fa1;\">RANGNEKAR INSTITUTE OF MANAGEMENT STUDIES AND RESEARCH</span><span style=\"color: #236fa1;\"> - RIMSR, is headquartered in Bengaluru, Karnataka, India.&nbsp; It is a &ldquo;not-to-profit&rdquo; education trust registered under the Indian Trusts Act, 1832.&nbsp; Established in 2007 as EFS, it became an educational trust in 2010.&nbsp;&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif; color: #236fa1;\"><a style=\"color: #236fa1;\" href=\"https://www.nefuniversity.org/\">NATIONAL EDUCATION FOUNDATION</a> (NEF) is a 501 (c) (3) nonprofit organization, headquartered in Washington D.C., USA.&nbsp; Founded in 1989, after consultations with national leaders including former President of the USA Bill Clinton and INTEL founder Dr. Gordon Moore, NEF is the world\'s leading nonprofit organization bridging the employment, digital and academic divides by providing high-quality affordable 21st Century online education to millions of students and job seekers in the US and India.&nbsp; NEF offers 10,000+ high-quality online courses and mentoring using the state-of-the-art Learning Management Systems (LMS) and an interactive video platform.&nbsp; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif; color: #236fa1;\">In India, RIMSR is a major partner/affiliate of the <a href=\"nefuniversity.org\">NATIONAL EDUCATION FOUNDATION, Washington DC, USA.</a></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif; color: #236fa1;\">NEF-RIMSR offers world-class courses in niche high-demand areas focusing on Skill-Development, Re-Skilling, Skill-Enhancement, and Job-Ready courses using learning methodologies most suited both to freshers and working professionals.&nbsp; The courses of NEF-RIMSR are highly adaptive and sensitive to the changing training needs of students &amp; professionals, and the course curricula are updated once a fortnight to ensure that the students get the latest course content.&nbsp; &nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif; color: #236fa1;\">The India-specific mission of NEF-RIMSR is to implement the program \"MAKE INDIA GREAT\".&nbsp; Under the MIG program, NEF has instituted \"Appuji Scholarships\" to help the economically challenged, minorities, and the disadvantaged communities to acquire high-end specialized skills through \"Job-Ready\" courses of SKILLSOFT, USA with certifications of the <a href=\"potsdam.edu\">STATE UNIVERSITY OF NEW YORK,</a> Potsdam, USA, the largest University in the US, at the most affordable fee structure.&nbsp;</span><span style=\"color: #236fa1;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif;\">Further, to motivate the high-achievers, NEF has instituted \"APPUJI MEDALLION OF MERIT\" which is awarded to the best-performing students.&nbsp; NEF also facilitates placements/internships to students successfully completing technology courses with distinction.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif; color: #236fa1;\">NEF-RIMSR is known for its openness, transparency in operations, and relevance.&nbsp; The academics of NEF-RIMSR is regulated and monitored by a Governing Council (GC) consisting of distinguished professionals drawn from industry, banking, and other fields.&nbsp; The GC is assisted by the Board of Studies comprising academicians, scholars, scholar-practitioners, and captains of industry.&nbsp; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"color: #236fa1;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif;\"><a href=\"https://en.wikipedia.org/wiki/Appu_Kuttan\">Prof. (Dr.) Appu Kuttan</a>, the Founder-Chairman of the National Education Foundation, Washington DC, USA, is the Chairman of RIMSR.&nbsp;&nbsp;</span><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif;\">Prof. (Dr.) Sadagopan. S, a respected IT visionary pan India and abroad, and founder/ex-director of the famous \'International Institute of Information Technology, Bengaluru, India\' is the Chairman of the Governing Council of RIMSR.&nbsp;&nbsp;</span><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif;\">Prof. (Dr.) William S Lightfoot, Vice-President - Product Operations at Southern New Hampshire University, USA is the Principal Advisor to RIMSR.&nbsp;&nbsp;</span><span style=\"font-size: 12pt; line-height: 150%; font-family: Verdana, sans-serif;\">The Board of Studies is headed by Dr. Pundi Narasimham, </span><span style=\"font-family: Verdana, sans-serif; font-size: 12pt;\">Founder &amp; Chief Mentor of STS Worldwide, Alpharetta, Georgia, USA.&nbsp;&nbsp;</span><span style=\"font-family: Verdana, sans-serif; font-size: 12pt;\">The Board of Trustees is headed by Prof. (Dr.) Chandrashekar, President &ndash; RIMSR &amp; Director - NEF (India).&nbsp;&nbsp;</span></span></p>', '3955611532506887', 'Admin', '0000-00-00', '', '2022-02-17', '', 'active'),
(105, 'Facilities', '<p><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; font-family: Verdana, \'sans-serif\'; font-weight: normal;\">RIMSR is a \"virtual college.\" All the programs are delivered online. Learning Management System is the technology platform utilized for the delivery of tutorials, case-study analysis, business games, podcasts, webinars, assignments, evaluation, and certifications. The programs are supported by</span></strong><strong><span style=\"font-size: 11pt; font-family: Verdana, \'sans-serif\'; font-weight: normal;\">, </span></strong><strong><span style=\"font-size: 11pt; font-family: Verdana, \'sans-serif\'; font-weight: normal;\">experienced and well-qualified mentors. The student-mentor connect is the USP of the programs of RIMSR.</span></strong></span></p>\r\n<h2><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; font-weight: normal;\"><a style=\"color: #ba372a;\" href=\"#\"><strong>Location</strong></a></span></strong></span></h2>\r\n<p id=\"prof1\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; font-family: Verdana, \'sans-serif\'; font-weight: normal;\">It is located in the heart of Bengaluru and is easily accessible through public transport.&nbsp;</span></strong></span></p>\r\n<p><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; font-family: Verdana, \'sans-serif\'; font-weight: normal;\">RIMSR has two overseas centers, one in Atlanta, USA, and the second in Kigali, Rwanda.</span></strong></span></p>\r\n<h2><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 11pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; font-weight: normal;\"><a style=\"color: #ba372a;\" href=\"#\"><strong>Library</strong></a></span></strong></span></h2>\r\n<p id=\"prof1\"><span style=\"color: #236fa1;\"><strong><span style=\"font-size: 11pt; font-family: Verdana, \'sans-serif\'; font-weight: normal;\">The e-library has a rich collection of e-books covering all specializations in Management. Relevant e-periodicals too are subscribed to.</span></strong></span></p>', '2584401532507496', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(106, 'Payment', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-outline-level: 3;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-fareast-language: EN-IN;\">FOR PAYMENT OF FEE TO JOB-READY COURSES THROUGH BANK TRANSFER</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-outline-level: 4;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Here are the bank particulars:</span></p>\r\n<div align=\"center\">\r\n<table class=\"MsoNormalTable\" style=\"border-collapse: collapse; border: none; mso-border-alt: dashed #BBBBBB .75pt; mso-yfti-tbllook: 1184;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; height: 1.0cm;\">\r\n<td style=\"border: dashed #BBBBBB 1.0pt; mso-border-alt: dashed #BBBBBB .75pt; padding: .75pt .75pt .75pt .75pt; height: 1.0cm;\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">BANK:</span></p>\r\n</td>\r\n<td style=\"border: dashed #BBBBBB 1.0pt; border-left: none; mso-border-left-alt: dashed #BBBBBB .75pt; mso-border-alt: dashed #BBBBBB .75pt; padding: .75pt .75pt .75pt .75pt; height: 1.0cm;\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\">UNION BANK OF INDIA</span></p>\r\n</td>\r\n</tr>\r\n<tr style=\"mso-yfti-irow: 1; height: 1.0cm;\">\r\n<td style=\"border: dashed #BBBBBB 1.0pt; border-top: none; mso-border-top-alt: dashed #BBBBBB .75pt; mso-border-alt: dashed #BBBBBB .75pt; padding: .75pt .75pt .75pt .75pt; height: 1.0cm;\">\r\n<p class=\"MsoNormal\" style=\"ma