(107, 'Directors Blog', '<p class=\"MsoNormal\"><span style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">It was nice to read what George Clooney said along with a host of other stars; ....will start a public high school in LA to train teens for jobs in Hollywood...</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">There are two keywords in his statement TRAIN and JOBS.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">That\'s exactly what NEFU is doing; offering JOB-READY courses, except that the emphasis is on students in colleges and higher educational institutions.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">Use the opportunity to its hilt when it is available!!!</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">Enroll in the courses right away when they are available to you at the most affordable fee.</span></p>', '3880161532510782', 'Admin', '0000-00-00', '', '2021-11-15', '', 'active'),
(108, 'Notifications', '<h2 style=\"box-sizing: border-box; font-family: \'open sans\'; line-height: 1.2; margin-top: 20px; margin-bottom: 10px; font-size: 20px; letter-spacing: 1px; text-decoration-line: underline; text-align: center;\"><span style=\"box-sizing: border-box; word-wrap: break-word; color: #993300;\"><span style=\"box-sizing: border-box; font-weight: normal !important;\">NOTIFICATION</span></span></h2>\r\n<hr style=\"box-sizing: content-box; height: 0px; color: #333333; font-family: \'open sans\'; font-size: 12px; letter-spacing: 1px; text-align: justify;\" size=\"2\" width=\"100%\" />\r\n<div class=\"col-md-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; width: 823px; color: #333333; font-family: \'open sans\'; font-size: 12px; letter-spacing: 1px; text-align: justify;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 10px; word-wrap: break-word;\">&nbsp;</h3>\r\n<h3><strong>This is to notify that admissions are open to the following programs:-</strong></h3>\r\n<ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px;\">\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Certificate Program in Project Management</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Certificate Program in Supply Chain Management</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Certificate Program in Business Finance</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Certificate Program in Business Analytics</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Certificate Program in Big Data Analytics</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Certificate Program in International Business</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Saral Shikshak Program</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Saral Ganith Program</strong></h3>\r\n</li>\r\n</ol>\r\n<h3><strong>The admission process involves:-</strong></h3>\r\n<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px;\">\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Submission of application online by prospective students to RIMSR,</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Due-diligence by RIMSR,</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Submission of the prima-facie cleared applications before the selection committee of the Board of Studies,</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Finalization of the selected candidates,</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Communication to the selected candidates,</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Payment of Program fee,</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Issuance of ID and &ldquo;Key&rdquo; to the selected candidates; and,</strong></h3>\r\n</li>\r\n<li style=\"box-sizing: border-box;\">\r\n<h3><strong>Initiation of the Program.</strong></h3>\r\n</li>\r\n</ul>\r\n<h3><strong>Students interested in enrolling themselves in any of the above programs are advised to submit their applications online on the official website of RIMSR (www.rimsr.in). </strong><strong>Scholarships are available, in the form of a fee waiver.&nbsp; Applications to avail scholarships should be submitted to the Registrar, RIMSR, upon the confirmation of admission to the PGDPM.&nbsp; For further information and assistance email registrar@rimsr.in.</strong><strong>This notification is issued with the approval of the Board of Studies.</strong></h3>\r\n<h3><strong>Mrs. Rajeshwari. C</strong></h3>\r\n<h3><strong>Registrar &ndash; RIMSR</strong></h3>\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 10px; word-wrap: break-word;\"><strong>registrar@rimsr.in&nbsp;</strong></h3>\r\n</div>', '9269361532513103', 'Admin', '0000-00-00', '', '2020-01-10', '', 'active'),
(109, 'Rajeshwari', '<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; letter-spacing: 0.7pt;\">MRS. RAJESHWARI</span></strong></span></p>\r\n<p><span style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">Mrs. Rajeshwari has over three decades of work experience backed by the passion to do her might to the society at large, and in particular to the disadvantaged lot. RIMSR is a product of her dream to give all that she has to the good of the community.&nbsp; She focuses on training and educating the youth, and helps them make the right choices in life. A well-meaning, empathizing, and caring individual who always puts others\' interests first.</span></p>\r\n<p><span style=\"font-family: verdana, geneva, sans-serif; color: #236fa1;\">She is one of the Founder Trustees of RIMSR and a member of the Governing Council of RIMSR.</span></p>', '', 'Admin', '2019-02-25', '', '2021-11-15', '', 'active'),
(110, 'Sunita', '<p style=\"line-height: 24pt; background: white; margin: 0cm 0cm 6.9pt; text-align: justify;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 11pt; font-family: Verdana, \'sans-serif\'; letter-spacing: 0.7pt;\">MS. SUNITA MANI</span></strong></span></p>\r\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: justify; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"color: #236fa1; font-size: 12pt;\"><strong><span style=\"font-family: Verdana, \'sans-serif\'; font-weight: normal;\">Prof. Sunita Mani is a \"Clinical Psychologist\" by profession.&nbsp; She is the CEO of EFAA (Emotional First-Aid Academy). EFA Academy is started with the vision:</span></strong></span></p>\r\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: justify; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"color: #236fa1; font-size: 12pt;\"><strong><span style=\"font-family: Verdana, \'sans-serif\'; font-weight: normal;\">- To make a difference in schools, educational institutions, and corporates by providing training and extending support in setting up an Emotional Health Centre,</span></strong></span></p>\r\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: justify; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"color: #236fa1; font-size: 12pt;\"><strong><span style=\"font-family: Verdana, \'sans-serif\'; font-weight: normal;\">- To promote learning for personal growth through a structured relationship with a trained professional Develop lifelong learning as a discipline of study and field of practice in mental health,</span></strong></span></p>\r\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: justify; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"color: #236fa1; font-size: 12pt;\"><strong><span style=\"font-family: Verdana, \'sans-serif\'; font-weight: normal;\">- To promote the mental and emotional well-being of individuals, and</span></strong></span></p>\r\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: justify; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"color: #236fa1; font-size: 12pt;\"><strong><span style=\"font-family: Verdana, \'sans-serif\'; font-weight: normal;\">- Creating an opportunity for those in distress to seek help without the fear of social stigma.</span></strong></span></p>\r\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: justify; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"color: #236fa1; font-size: 12pt;\"><strong><span style=\"font-family: Verdana, \'sans-serif\'; font-weight: normal;\">Ms. Sunita is on the Governing Council of RIMSR.</span></strong></span></p>', '', 'Admin', '2019-02-25', '', '2021-11-22', '', 'active'),
(111, 'Saral Shikshak', '<p class=\"MsoNormal\" style=\"margin-bottom: 15.0pt; background: white;\"><strong><span style=\"font-size: 11.5pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #c00000; mso-fareast-language: EN-IN;\">WHAT IS THE PROGRAM ABOUT?</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">SARAL SHIKSHAK is a unique program based on the most famous learning model \"Learning How to Learn\" by Prof. (Dr.) Barbara Oakley, and Prof. (Dr.) Terrence Sejnowski, along with Prof. (Dr.) Alistair McConville, all from the United States of America.&nbsp; The program is successfully implemented in many countries like Japan, Russia, China, and others.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The program is an invaluable tool of the choice to instill learning skills efficiently, scientifically, and sustainably. Exposure to this program helps acquire superior learning skills.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">It helps minimize &ldquo;learning deficiencies,&rdquo; which makes children competent &amp; confident to compete with the best.&nbsp; The program also helps students, youth, and teens figure out they are as gifted as anyone else; an attitude that provides the right eco-system to further their academic progress, and enables them to unlock analytic power &amp; acquire/sharpen skills for numbers.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">SARAL SHIKSHAK (Learning How to Learn) program breaks through obstacles to learning and discovers hidden potential. It makes the process of studying - learning how to study, simple. With quick, easily understood study skills, \"SARAL SHIKSHAK\" is user-friendly, and lots of fun. Students enjoy the program and they get a lifetime of enhanced study skills that will take them on a journey filled with knowledge.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">It is an online program; however, with an option for mentoral-support at an extra cost.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">It\'s recommended that teachers in schools and colleges are first exposed to this program.&nbsp; Subsequently, the trained teachers could be utilized to train the students in good numbers.&nbsp; &nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><strong><span style=\"font-size: 11.5pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #c00000; mso-fareast-language: EN-IN;\">WHO SHOULD TAKE THIS PROGRAM?</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Students of all Grades, from Colleges to Schools. Teachers and Trainers. All Youth and Teens.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; background: white; text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\';\">Adults, professionals, and practically every person.</span><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\';\">&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><strong><span style=\"font-size: 11.5pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #c00000; mso-fareast-language: EN-IN;\">PROGRAM FEE:</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">For Indian students (per participant) the fee is Rs. 5,000/-, or US $ 99/- for all others.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The fee includes tuition, program material, text/examinations, library, technology fee, and certification fee.&nbsp; Mentoral support, if needed, costs extra.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Dr. Kuttan, Founder-Chairman, NEF, USA; President, Appuji University, USA, and Chairman, RIMSR, India has instituted scholarships in the form of fee-waiver up to 90% for Indian students.&nbsp; These are available to socially and economically challenged applicants.&nbsp; To avail, email your request to the registrar @rimsr.in&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The fee is payable through a bank transfer in favor of &lsquo;A/C 414901010035609, UNION BANK OF INDIA, RAJAJINAGAR BRANCH, BANGALORE 560010, KARNATAKA, INDIA&rsquo;.&nbsp; The bank details are as below:-</span></p>\r\n<table class=\"MsoNormalTable\" style=\"width: 517.5pt; background: white;\" border=\"1\" width=\"690\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; height: 1.0cm;\">\r\n<td style=\"width: 126pt; border-width: 1pt; border-color: #dddddd; border-image: initial; padding: 0cm; height: 1cm;\" width=\"168\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">BANK:</span></p>\r\n</td>\r\n<td style=\"width: 310.5pt; border-top-width: 1pt; border-right-width: 1pt; border-bottom-width: 1pt; border-top-color: #dddddd; border-right-color: #dddddd; border-bottom-color: #dddddd; border-image: initial; border-left: none; padding: 0cm; height: 1cm;\" width=\"414\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">UNION BANK OF INDIA</span></p>\r\n</td>\r\n</tr>\r\n<tr style=\"mso-yfti-irow: 1; height: 1.0cm;\">\r\n<td style=\"width: 126pt; border-right-width: 1pt; border-bottom-width: 1pt; border-left-width: 1pt; border-right-color: #dddddd; border-bottom-color: #dddddd; border-left-color: #dddddd; border-image: initial; border-top: none; padding: 0cm; height: 1cm;\" wid