(112, 'pundi', '<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; letter-spacing: 0.7pt;\">DR. PUNDI NARASIMHAM</span></strong></span></p>\r\n<p><span style=\"color: #236fa1;\">Pundi Narasimham (Pundi), is the Founder &amp; Chief Mentor of STS Worldwide, USA. &nbsp;An MS in Chemical Engineering from the prestigious Indian Institute of Science Bangalore, India, and an MS in Materials Engineering from Washington State University, Pullman, Washington.&nbsp; As a &nbsp;pioneer in the IT domain, he has in the last four decades, successfully steered many IT companies in India, Malaysia, the Philippines, and the USA.&nbsp; He has published 14 research papers and holds 4 US Patents in optical fiber research.</span></p>\r\n<p><span style=\"color: #236fa1;\">Started his Company, STS Worldwide, in the basement of his house in Atlanta in 1980. Today, it is a public company with revenue exceeding 500 million.</span></p>\r\n<p><span style=\"color: #236fa1;\">Pundi has represented state and local governments to promote bilateral trade and service internationally. The high-point is the rich and diverse experience he has in Life Sciences, Bio-Technology, Analytics &amp; Risk Management, Global Marketing, Global Talent Acquisition &amp; Retention, Resource Raising, M&amp;A, and Liaison with Government and Trade bodies.</span></p>\r\n<p><span style=\"color: #236fa1;\">Nominated as International Business Development Representative, by the Fulton County and City of Valdosta in the state of Georgia, US, he represented the Fulton County Government (Georgia) promoting bilateral trade &amp; services between India and the US, and also led trade delegations from Georgia to the Silicon Valley capital of India (Bangalore) and led a team of delegates, comprising of senior Bureaucrats, Businessmen &amp; Politicians of India and the US promoting bilateral trade.</span></p>\r\n<p><span style=\"color: #236fa1;\">Pundi is on the Governing Council and the Chairman of the Board of Studies of RIMSR.</span></p>', '', 'Admin', '2019-11-08', '', '2021-11-15', '', 'active'),
(113, 'jeetan', '<p style=\"line-height: 200%; background: white; box-sizing: border-box; word-wrap: break-word; margin: 0in 0in 6.9pt 0in;\"><span style=\"color: #ba372a;\"><strong><span style=\"font-size: 10.5pt; line-height: 200%; font-family: Arial, \'sans-serif\'; letter-spacing: 0.7pt;\">MR. JEETAN SINGH</span></strong></span></p>\r\n<p><span style=\"color: #236fa1;\">Jeetan Singh,&nbsp;Founder &amp; Ex-President/CEO, Datamatics Inc, USA; Founder-YouScore.net, an EdTech Startup in the US; and President, HighPoints Learning, USA.&nbsp; An alumnus of Delhi University and IIIT, Kharagpur, with over 32 years of experience as a professional/ entrepreneur. Worked as Software Engineer in National Informatics Centre, India; in BAKST International, New Zealand, and Sydney, Australia. For the last 2 decades, he is in the US as an entrepreneur.&nbsp;</span></p>\r\n<p><span style=\"color: #236fa1;\">In his experience of over three decades, he has provided high-quality, value-based software consultancy &amp; professional services to Fortune 500 companies in the USA.&nbsp; Apart, he is a passionate &ldquo;skill-developer&rdquo; providing software products and services in STEM for elementary to high school students in the USA.&nbsp;</span></p>\r\n<p><span style=\"color: #236fa1;\">In the last 8+ years, the eLearning program developed by him has been approved by the Dept of Education, USA in 26 states as Supplemental Educational Program.&nbsp; Recently he has launched a new global brand &lsquo;YouScore&rsquo;, a social-media-based platform focusing on STEM programs in the K12 space.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #236fa1;\">Mr. Jeetan is on the Governing Council and Board of Studies of RIMSR.</span></p>', '', 'Admin', '2019-11-08', '', '2021-11-15', '', 'active');
INSERT INTO `newsevents` (`id`, `title`, `description`, `image`, `postedby`, `postedon`, `tags`, `dateofpost`, `category`, `status`) VALUES
(114, 'Saral Ganith', '<p class=\"MsoNormal\" style=\"margin-bottom: 15.0pt; line-height: normal; background: white;\"><strong><span style=\"font-size: 11.5pt; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #c00000; mso-fareast-language: EN-IN;\">WHAT IS THE PROGRAM ABOUT?</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">Mathematics is all around; math has an important role in our life. Math itself expresses almost everywhere in our life. We use math skill everywhere without realizing. We use mathematical tools everywhere from the kitchen to the office and school to the playground. Even a simple man uses math in his daily life. Most of us start our day with math, how many more minutes I can sleep, how much time is left for the meeting? If a housewife going to buy groceries she would need to use basic math concepts.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">But, most of the students have a math phobia. This is more because of how it is taught, than other reasons. It&rsquo;s precisely this that &ldquo;HighPoints&rdquo; has addressed in the &ldquo;Saral Ganith Program.&rdquo; &nbsp;&ldquo;HighPoints&rdquo; is a US-based institution with its focus on teaching mathematics an easy and effective way for more than a decade. Over three million students have immensely and directly benefited from their program.&nbsp; It is this successful program that is being brought to benefit the Indian students in the form of the &ldquo;Saral Ganith Program.&rdquo;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">The program employs a research-based, balanced, comprehensive approach to teaching mathematics and delivers a full suite of powerful educational tools. It includes grade-level assessments, benchmark tests, real-time progress tracking, remediation tools, individualized student learning plans, custom assignments, guided math practice, instant feedback, and many other features.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">The &ldquo;Saral Ganith Program&rdquo; is interwoven with three critical aspects of Math Teaching essential for the academic growth of the students.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">1. Mathematical Concepts, &nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">2. Computer-Assisted Instruction, and</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">3. Progress Trackers -Appraisal of the progress on a real-time basis.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #c00000; mso-fareast-language: EN-IN;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\"><strong><span style=\"font-size: 11.5pt; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #c00000; mso-fareast-language: EN-IN;\">WHO SHOULD TAKE THIS PROGRAM?</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: Verdana, sans-serif; color: #236fa1;\">Students of all Grades, from Grade 2 to Grade 12.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #c00000; mso-fareast-language: EN-IN;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; line-height: normal; background: white; text-align: justify;\"><strong><span style=\"font-size: 11.5pt; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #c00000; mso-fareast-language: EN-IN;\">PROGRAM FEE:</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">For Indian students (per participant) the fee is Rs. 5,000/-, or US $ 99/- for all others.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">The fee includes tuition, program material, text/examinations, library, technology fee, and certification fee.&nbsp; Mentoral support, if needed, costs extra.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">Dr. Kuttan, Founder-Chairman, NEF, USA; President, Appuji University, USA, and Chairman, RIMSR, India has instituted scholarships in the form of fee-waiver up to 90%.&nbsp; These are available to socially and economically challenged applicants.&nbsp; To avail, email your request to the Registrar at registrar@rimsr.in.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; background: white; text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">The fee is payable through a bank transfer in favor of &lsquo;A/C 414901010035609, UNION BANK OF INDIA, RAJAJINAGAR BRANCH, BANGALORE 560010, KARNATAKA, INDIA&rsquo;.&nbsp; The bank details are as below:-</span></p>\r\n<table class=\"MsoNormalTable\" style=\"width: 517.5pt; background: white;\" border=\"1\" width=\"690\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; height: 25.5pt;\">\r\n<td style=\"width: 126pt; border-width: 1pt; border-color: #dddddd; border-image: initial; padding: 0cm; height: 25.5pt;\" width=\"168\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: #236fa1;\">BANK:</span></p>\r\n</td>\r\n<td style=\"width: 310.5pt; border-top-width: 1pt; border-right-width: 1pt; border-bottom-width: 1pt; border-top-color: #dddddd; border-right-color: #dddddd; border-bottom-color: #dddddd; border-image: initial; border-left: none; padding: 0cm; height: 25.5pt;\" width=\"414\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: #236fa1;\">UNION BANK OF INDIA</span></p>\r\n</td>\r\n</tr>\r\n<tr style=\"mso-yfti-ir