r-bottom-color: #dddddd; border-left-color: #dddddd; border-image: initial; border-top: none; padding: 0cm; height: 25.5pt;\" width=\"168\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: #236fa1;\">ACCOUNT NAME:</span></p>\r\n</td>\r\n<td style=\"width: 310.5pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: #dddddd; border-right-width: 1pt; border-right-color: #dddddd; padding: 0cm; height: 25.5pt;\" width=\"414\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: #236fa1;\">RANGNEKAR INSTITUTE OF MANAGEMENT STUDIES AND RESEARCH</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"MsoNormal\" style=\"line-height: normal; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>', '', 'Admin', '2020-01-07', '', '2021-11-15', '', 'active');
