(115, 'Nef Courses', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 23.25pt; text-align: center;\" align=\"center\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 14pt; color: #ba372a;\"><strong><u>JOB-READY SKILL COURSES</u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The National Education Foundation (NEF), Washington DC, USA, is an international nonprofit leader in bridging the employment, digital, academic, economic, and social divides.&nbsp;&nbsp;</span><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">In association with the State University of New York at Potsdam, NEF has made available 120+ Diploma &amp; Certificate Courses in high-demand learning areas at an affordable fee structure to students, and professionals. The courses are world-class in content developed &amp; delivered by SkillSoft, USA, on a state-of-the-art LMS.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 23.25pt; text-align: justify;\"><span style=\"color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px;\">The courses are available in the following four categories:&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">*&nbsp; &nbsp; &nbsp;BUSINESS SKILLS,</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">*&nbsp; &nbsp; &nbsp;PRODUCTIVITY AND COLLABORATION TOOLS,</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">*&nbsp; &nbsp; &nbsp;IT SKILLS, and</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, sans-serif; color: #236fa1;\">*&nbsp; &nbsp; &nbsp;CERTIFICATIONS.</span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-family: Verdana, sans-serif; font-size: 12pt;\">Students can seek enrollment across 120+ courses to be completed in 24 weeks.</span></span><strong style=\"color: #236fa1;\"><span style=\"font-size: 12.0pt; font-family: \'Verdana\',\'sans-serif\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-size: 12.0pt; font-family: \'Verdana\',\'sans-serif\';\"><strong style=\"color: #000000; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif; font-size: medium;\"><u><span style=\"font-size: 16.0pt; line-height: 115%; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #3333ff; mso-fareast-language: EN-IN;\">CERTIFICATION:</span></u></strong></span></span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-size: 12.0pt; font-family: \'Verdana\',\'sans-serif\';\">Successful completion of courses entitles Certification by the State University of New York at Potsdam, USA.&nbsp;</span></span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\"><strong style=\"color: #000000; font-family: -apple-system, BlinkMacSystemFont,