gin: 0in 0in 12.0pt .25in;\"><strong><span lang=\"EN-IN\" style=\"font-size: 13pt; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">SAS</span></strong></p>\r\n</td>\r\n<td style=\"width: 3.25in; padding: 0in 5.4pt 0in 5.4pt; height: .4in;\" width=\"390\">\r\n<p class=\"MsoNormal\" style=\"line-height: normal; margin: 0in 0in .0001pt .25in;\"><strong><span lang=\"EN-IN\" style=\"font-size: 13pt; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">ISOGRAD</span></strong></p>\r\n</td>\r\n</tr>\r\n<tr style=\"mso-yfti-irow: 12; height: .4in;\">\r\n<td style=\"width: 3.25in; padding: 0in 5.4pt 0in 5.4pt; height: .4in;\" width=\"390\">\r\n<p class=\"MsoNormal\" style=\"line-height: normal; margin: 0in 0in 12.0pt .25in;\"><strong><span lang=\"EN-IN\" style=\"font-size: 13pt; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">TOGAF</span></strong></p>\r\n</td>\r\n<td style=\"width: 3.25in; padding: 0in 5.4pt 0in 5.4pt; height: .4in;\" width=\"390\">\r\n<p class=\"MsoNormal\" style=\"line-height: normal; margin: 0in 0in .0001pt .25in;\"><strong><span lang=\"EN-IN\" style=\"font-size: 13pt; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">Linux Professional Institute (LPI)</span></strong></p>\r\n</td>\r\n</tr>\r\n<tr style=\"mso-yfti-irow: 13; mso-yfti-lastrow: yes; height: .4in;\">\r\n<td style=\"width: 3.25in; padding: 0in 5.4pt 0in 5.4pt; height: .4in;\" width=\"390\">\r\n<p class=\"MsoNormal\" style=\"line-height: normal; margin: 0in 0in 12.0pt .25in;\"><strong><span lang=\"EN-IN\" style=\"font-size: 13pt; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">International Software Testing Qualification Board (ISTQB)</span></strong></p>\r\n</td>\r\n<td style=\"width: 3.25in; padding: 0in 5.4pt 0in 5.4pt; height: .4in;\" width=\"390\">\r\n<p class=\"MsoNormal\" style=\"line-height: normal; margin: 0in 0in .0001pt .25in;\"><strong><span lang=\"EN-IN\" style=\"font-size: 13pt; font-family: \'Times New Roman\', \'serif\'; color: #236fa1;\">International Institute of Business Analysis (IIBA)</span></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, \'sans-serif\'; color: #236fa1;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 9pt; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 9pt; text-align: justify;\"><strong><u><span style=\"font-size: 16.0pt; line-height: 115%; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #3333ff; mso-fareast-language: EN-IN;\">EXAMINATION AND GRADING NORMS:</span></u></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The final examination is conducted by SUNY.&nbsp; It is a screen-based examination of MCQs and short notes. The duration of the final examination is 60 minutes on the date and time determined by SUNY.&nbsp; Students will be kept informed of the course, date, and time of the examination two weeks prior to the examination.&nbsp;&nbsp;&nbsp; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The grading system is as follows:</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-bidi-font-family: \'Times New Roman\';\"><span style=\"color: #236fa1;\">A grade of &ldquo;A&rdquo; signifies an exceptional, clear, and creative grasp of the concepts of the course with a demonstrated ability to apply this knowledge to specific problem situations. &nbsp;It also means that the student has actively participated in &ldquo;in-class&rdquo; activities, has completed all the material on time, has put in extra effort, and demonstrates exceptional work.</span>&nbsp;&nbsp;</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-bidi-font-family: \'Times New Roman\'; color: #00b050;\">Grading of 90% and above is rated as an &ldquo;A&rdquo; grade, meaning the student has passed the course with distinction.&nbsp;&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">Apart from being certified by the State University of New York, a student securing a GPA of 4 on a scale of 4.0 is conferred with the coveted <strong>&ldquo;Appuji Medallion of Merit,&rdquo; </strong>an honor in recognition of student\'s merit.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-bidi-font-family: \'Times New Roman\';\"><span style=\"color: #236fa1;\">A grade of &ldquo;B&rdquo; signifies a solid and required understanding of the major concepts of the course and the ability to apply those concepts. &nbsp;It also means that the student&rsquo;s effort and participation have exceeded the minimal basic requirements for the course. &nbsp;All assignments are judged to be solid in content and completed on time. &nbsp;This is deemed to be the minimum criteria acceptable.</span>&nbsp;&nbsp;</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-bidi-font-family: \'Times New Roman\'; color: #00b050;\">Grading of 60% up to 89% is rated as a &ldquo;B&rdquo; grade, meaning the student has passed the course.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-bidi-font-family: \'Times New Roman\';\"><span style=\"color: #236fa1;\">A grade of &ldquo;C&rdquo; signifies a below-average demonstration and application of the concepts of the course and/or inadequate preparation in-class activities. &nbsp;It may also indicate that assignments were not completed in a satisfactory or timely manner.</span>&nbsp;&nbsp;</span><span style=\"font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif; color: red;\">Grades below 60% are rated as &ldquo;C&rdquo; and are deemed to have failed.</span><strong><span style=\"font-size: 12pt; line-height: 18.4px; font-family: Verdana, sans-serif; color: red;\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">However, the failed students are eligible to repeat the course work without any additional fee, subject to prior approval of NEF-RIMSR. Such a provision to reappear for the examination is available twice.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #444444; mso-fareast-language: EN-IN;\"><strong style=\"color: #000000; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif; font-size: medium;\"><u><span style=\"font-size: 16.0pt; line-height: 115%; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #3333ff; mso-fareast-language: EN-IN;\">FEE STRUCTURE:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The National Education Foundation, Washington DC, USA has launched a mission-driven initiative titled &ldquo;MAKE INDIA GREAT &ndash; MIG&rdquo; with the intent of upskilling and making the Indian students &ldquo;Job Ready&rdquo; with 21<sup>st</sup>-century skills.&nbsp; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; mso-bidi-font-family: \'Times New Roman\';\">The regular fee for a pathway is $1,650.&nbsp; However, under the aegis of the MIG program, the National Education Foundation has subsidized the fee up to 90% per pathway.&nbsp;&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana, \'sans-serif\'; color: #236fa1;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The course fee includes tutorials, reading materials, assignments, online mentoring (wherever available), tests, exams, and certification.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">The above fee structure is valid up to the 31st of May 2022.&nbsp; Fresh admissions from the 1st of June 2022 will be governed by the new fee structure.&nbsp; However, enrollees on or before 31st May 2022 get 24 weeks to complete their coursework. The fee structure is subject to change as it is contingent upon donations from the donors.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">As per our regulations, there is no refund policy.&nbsp; However, RIMSR will provide all the support to complete the coursework of the course that you have rolled in.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\"><strong style=\"color: #000000; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif; font-size: medium;\"><u><span style=\"font-size: 16.0pt; line-height: 115%; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #3333ff; mso-fareast-language: EN-IN;\">PRIVACY:</span></u></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1; font-family: Verdana, \'sans-serif\'; font-size: 16px;\">A student enrolling in the course/s of NEF-RIMSR-SUNY should endeavor to keep confidential the coursework and should use it only for his.&nbsp; No information related to the coursework, tests, examinations, assignments, exercises, case studies, videos, pre-recorded webinars, and such other related information shall be shared with any person, institution, or organization in any form as all such knowledge/coursework continues to remain as assets owned by NEF-RIMSR-SUNY.&nbsp; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: #236fa1; font-family: Verdana, \'sans-serif\'; font-size: 16px;\">By enrolling in the course/s of NEF-RIMSR-SUNY, the enrolled student automatically agrees to abide by these terms both explicitly and implicitly.&nbsp; Breach of this condition is liable for appropriate action.&nbsp;</span><u></u><u></u></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: Verdana, \'sans-serif\'; color: #236fa1;\">For further details email your query to <a href=\"mailto:registrar.rimsr@nefuniversity.org\">registrar.rimsr@nefuniversity.org</a>.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: center;\"><a href=\"https://www.rimsr.in/applicationgen.php\"><span style=\"color: #ba372a; font-family: verdana, geneva, sans-serif; font-size: 14pt;\"><strong>Click Here To Enroll</strong></span></a></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify;\">&nbsp;</p>', '', 'Admin', '2020-10-06', '', '2022-03-04', '', 'active');
