(116, 'ksou', '<p><strong style=\"box-sizing: inherit; color: #0000ff; font-family: Verdana, sans-serif; font-size: 20px; text-align: center; background-color: #ffffff;\">WELCOME TO THE JOB-READY SPECIALIZED SKILL COURSES OF KSOU-SUNY-NEF</strong></p>\r\n<p id=\"para\" style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">Karnataka State Open University, Mysuru, India, the State University of New York at Potsdam, USA, and the National Education Foundation at Washington DC, USA have come together to accomplish the objective of the mission-driven Skill Development Program titled &ldquo;Make India Great &ndash; MIG.&rdquo;</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">The purpose of this confluence is to train one million Indian youth in high-end 21st-century skills and place them on a global platform transforming India into a powerhouse of &ldquo;skilled human-resource.&rdquo;</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">The objective is to provide high-end technology and business skill courses in high-demand learning areas with good employment opportunities to Indian youth making them &ldquo;job-ready&rdquo; pan India and abroad at the most affordable fee structure.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">The courses are world-class, comprehensive in content, developed keeping in focus application of the domain knowledge on the job, and delivered online by SkillSoft, USA, a world-renowned education content provider with joint certifications by the KSOU, SUNY, and NEF.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">The &rdquo;Job-Ready Courses&rdquo; of SUNY-NEF that are offered by KSOU are listed below:</p>\r\n<table style=\"box-sizing: inherit; border-spacing: 0px; background-color: #ffffff; margin: 15px 0px; width: 1080px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify;\">\r\n<tbody style=\"box-sizing: inherit;\">\r\n<tr style=\"box-sizing: inherit;\">\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: center;\"><strong>Sl.No.</strong></td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: center;\"><strong>Name of the Skill Training Program</strong></td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: center;\"><strong>No. of Credits</strong></td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: center;\"><strong>Course Duration</strong></td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: center;\"><strong>Eligibility Criteria</strong></td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: center;\"><strong>Course Fee in Rs.</strong></td>\r\n</tr>\r\n<tr style=\"box-sizing: inherit;\">\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: left;\">01</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: left;\"><a style=\"box-sizing: inherit; background-color: transparent; color: blue; text-decoration-line: none; transition: all 0.3s ease 0s;\" href=\"../KSOU.php#01\">Artificial Intelligence</a></td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">3</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">3 Months</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: left;\">Pursuing/ Completed Bachelor&rsquo;s Degree</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">5,000</td>\r\n</tr>\r\n<tr style=\"box-sizing: inherit;\">\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">02</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: left;\"><a style=\"box-sizing: inherit; background-color: transparent; color: blue; text-decoration-line: none; transition: all 0.3s ease 0s;\" href=\"../KSOU.php#02\">Big Data Management</a></td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">5</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">3 Months</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: left;\">Pursuing/ Completed Bachelor&rsquo;s Degree</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">5,000</td>\r\n</tr>\r\n<tr style=\"box-sizing: inherit;\">\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">03</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: left;\"><a style=\"box-sizing: inherit; background-color: transparent; color: blue; text-decoration-line: none; transition: all 0.3s ease 0s;\" href=\"../KSOU.php#03\">Business Analysis</a></td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">5</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">3 Months</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd; text-align: left;\">Pursuing/ Completed Bachelor&rsquo;s Degree</td>\r\n<td style=\"box-sizing: inherit; padding: 10px; border: 1px solid #dddddd;\">5,000</td>\r\n</tr>\r\n<tr style=\"box-sizing: 