y; background-color: #ffffff;\">Admitted students are provided with recorded video lectures online by eminent academicians drawn around the world by SkillSoft, USA, and supported by online mentoring. Assignments, exercises, reading materials, and tests are embedded in the tutorials. Project work is part of the learning process.</span></p>\r\n<p><strong style=\"color: red; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; box-sizing: inherit;\">ELIGIBILITY CRITERIA</strong></p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">Bachelor&rsquo;s Degree from a recognized university.<br style=\"box-sizing: inherit;\" />Students pursuing degree programs are also eligible to take the above programs.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\"><span style=\"color: #e03e2d;\"><strong style=\"box-sizing: inherit;\">COURSE FEE</strong></span></p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">The fee is Rs. 5,000/- per course that includes e-tutorials, reading materials, assignments, tests, examinations, and certification.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">The fee is payable through bank transfer and the details are as below:</p>\r\n<table style=\"box-sizing: inherit; border-spacing: 0px; background-color: #ffffff; margin: 15px 0px; width: 1080px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify;\">\r\n<tbody style=\"box-sizing: inherit;\">\r\n<tr style=\"box-sizing: inherit;\">\r\n<td style=\"box-s