izing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">The final examination is screen-based. The duration of the final examination is 60 minutes on the date and time determined by SUNY-NEF-RIMSR. Students will be kept informed of the course, date, and time of the examination two weeks before.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">The grading system is as follows:</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">A grade of &ldquo;A&rdquo; signifies an exceptional, clear, and creative grasp of the concepts of the course with a demonstrated ability to apply this knowledge to specific problem situations. It also means that the student has actively participated in &ldquo;in-class&rdquo; activities, has completed all the material on time, has put in extra effort, and demonstrates exceptional work.&nbsp;<span style=\"box-sizing: inherit; color: green;\">Grading of 90% and above is rated as an &ldquo;A&rdquo; grade, meaning the student has passed the course with distinction.</span></p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">A grade of &ldquo;B&rdquo; signifies a solid and required understanding of the major concepts of the course and the ability to apply those concepts. It also means that the student&rsquo;s effort and participation have exceeded the minimal basic requirements for the course. All assignments are judged to be solid in content and completed on time. This is deemed to be the minimum criteria acceptable.&nbsp;<span style=\"box-sizing: inherit; color: green;\">Grading of 60% up to 89% is rated as a &ldquo;B&rdquo; grade, meaning the student has passed the course.</span></p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">A grade of &ldquo;C&rdquo; signifies a below-average demonstration and application of the concepts of the course and/or inadequate preparation in-class activities. It may also indicate that assignments were not completed in a satisfactory or timely manner.&nbsp;<span style=\"box-sizing: inherit; color: red;\">Grades below 60% are rated as &ldquo;C&rdquo; and are deemed to have failed.</span></p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">&nbsp;</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; background-color: #ffffff; text-align: center;\"><a href=\"https://rimsr.in/applicationksou.php\"><span style=\"font-size: 14pt;\"><strong><span style=\"box-sizing: inherit; color: red;\"><span style=\"color: #3598db;\"><span style=\"font-size: 18pt;\"><span style=\"text-decoration: underline;\"><span style=\"color: #e03e2d; text-decoration: underline;\">CLICK HERE TO ENROLL</span></span></span></span></span></strong></span></a></p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\">&nbsp;</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #236fa1; font-family: Verdana, sans-serif; font-size: 16px; text-align: justify; background-color: #ffffff;\"><span style=\"text-decoration: underline;\"><span style=\"box-sizing: inherit; color: red; text-decoration: underline;\"><strong style=\"box-sizing: inherit; font-size: 18px; text-align: center;\">DETAILS OF COUR