(26, 'SCM2021-15', 'SCMEXAM', 'Exam', '<p>&nbsp;<b>INSTRUCTIONS:</b></p>\r\n<ol start=\"1\" type=\"1\">\r\n    <li class=\"MsoNormal\" style=\"line-height: normal;\"><b>All the questions are to be answered.<o:p></o:p></b></li>\r\n    <li class=\"MsoNormal\" style=\"line-height: normal;\"><b>Do not take any external help.<o:p></o:p></b></li>\r\n    <li class=\"MsoNormal\" style=\"line-height: normal;\"><b>The total duration of the examination is 60 minutes.<o:p></o:p></b></li>\r\n    <li class=\"MsoNormal\" style=\"line-height: normal;\"><b>The clock is set to the RIMSR&rsquo;s server time. To facilitate you there is a timer on the screen that displays the available time to complete the examination. When the timer reaches zero, the examination will end by itself and the answer script will be withdrawn automatically by the system.<o:p></o:p></b></li>\r\n    <li class=\"MsoNormal\" style=\"line-height: normal;\"><b>There is no negative marking system.&nbsp; However, you are advised to avoid guessing your answers.<o:p></o:p></b><b>&nbsp;</b></li>\r\n    <li class=\"MsoNormal\" style=\"line-height: normal;\"><b>Write the answer of your choice in the given space below the choices.&nbsp; To do so, first click in the space provided and the cursor appears.&nbsp; Write the alphabet of the answer of your choice.&nbsp; To illustrate, if your choice is statement&nbsp;B, write the alphabet&nbsp;B&nbsp;in the given space and click on the&nbsp;NEXT&nbsp;button to move on to the next question.&nbsp;</b></li>\r\n    <li class=\"MsoNormal\" style=\"line-height: normal;\"><strong>For theory questions, write your answers in the space given below each question.&nbsp;&nbsp;</strong></li>\r\n    <li class=\"MsoNormal\" style=\"line-height: normal;\"><b>You cannot leave any questions blank.&nbsp; Because without answering a question you cannot move forward as the &quot;next&quot; button will be activated only when you write your answer.&nbsp;&nbsp;</b></li>\r\n    <li class=\"MsoNormal\" st