INSERT INTO `rim_quizquestion` (`Id`, `Quizid`, `Question`, `Answer`, `Correctans`, `Mark`, `Dateofpost`) VALUES
(2, 2, '________is the primary activity of supply chain management.', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:15.0pt;text-indent:-.25in;line-height:&#10;130%;mso-list:l0 level1 lfo1\"><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">&nbsp;</span><span style=\"color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">A. Demand Management</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">B. Supply Planning i.e matching assets with demand</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">C. Analytics Workbench</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">D. All of the above</p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\"><o:p></o:p></span></p>', 'D', 1, '2020-06-24'),
(3, 2, 'The purpose of supply chain management is to_______.', '<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;</span></span><span style=\"color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">A. increase the production level</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">B. Manage and integrate supply and demand management</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">C. Enhance the quality of a product and services</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">D. Provide satisfaction to the customer</p>', 'B', 1, '2020-06-24'),
(178, 21, '______ is not a part of flows involved in Supply Chain Management.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Information Flow</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Title Flow<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Physical Flow<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Virtual Flow<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(179, 21, '___________ involves transformation, movement, and storage of goods and materials.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Virtual Flow</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Physical Flow<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Title Flow<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Information Flow<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(180, 21, 'A supply chain is a sequence of firms that perform activities required to ______', '<p><span style=\"color: windowtext;\">A. to create synergy in their training programs</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\">B. to facilitate wholesalers inventory selections</p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. to find products that are similar<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. to create and deliver goods to consumers<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(4, 2, 'In Supply Chain Management, ATP stands for _________.', '<div>\r\n<p class=\"feature-stem\"><span style=\"color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">A. Acquire Track &amp; Perform</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">B. Available To Promise</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">C. Active Transport Protocol</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">D. Access To Point</p>\r\n</div>', 'B', 0, '2020-06-24'),
(181, 21, 'Which of the following is true for supply chain management?', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A.&nbsp; The physical material moves in the direction of the end of chain <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B.&nbsp; Flow of cash backwards through the chain <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C.&nbsp; Exchange of information moves in both the direction <o:p></o:p></span></p>\r\n<p><span style=\"color: windowtext;\">D.</span><span style=\"color: windowtext;\">&nbsp; </span><span style=\"color: windowtext;\">All of the above</span>&nbsp;</p>', 'D', 1, '2021-06-27'),
(182, 21, 'The sequence of a typical manufacturing supply chain is ', '<p>&nbsp;<span style=\"color: windowtext;\">A.</span><span style=\"color: windowtext;\">&nbsp; </span><span style=\"color: windowtext;\">Storage&ndash;Supplier&ndash;manufacturing&ndash;storage&ndash;distributor&ndash;retailer&ndash;customer</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B.&nbsp; Supplier&ndash;Storage-manufacturing&ndash;storage&ndash;distributor&ndash;retailer&ndash;customer <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C.&nbsp; Supplier&ndash;Storage-manufacturing&ndash; distributor&ndash;storage&ndash;retailer&ndash;customer <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D.&nbsp; Supplier&ndash;Storage-manufacturing&ndash;storage&ndash; retailer&ndash;distributor&ndash;customer&nbsp;<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(183, 21, 'Logistics is the part of a supply chain involved with the forward and reverse flow of', '<p><span style=\"color: windowtext;\">A.</span><span style=\"color: windowtext;\">&nbsp; </span><span style=\"color: windowtext;\">Goods</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B.&nbsp; Services <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C.&nbsp; Cash <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D.&nbsp; All of the above&nbsp;<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(5, 2, 'In supply chain management, after planning, the next step involves ______________.', '<p><span style=\"color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">A. Developing</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">B. Building a strong relationship with suppliers</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">C. Sourcing</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">D. All of the above</p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></p>', 'D', 1, '2020-06-24'),
(184, 21, 'Seasonal inventory is extra stock produced to cope with expected increases in customer demand. Extra beach wear in summer and extra rain wear in winter are examples of seasonal inventory.', '<p><span style=\"color: windowtext;\">A. True</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(185, 21, 'In the following, one is not a key driver of Supply Chain Management. Identify', '<p><span style=\"color: windowtext;\">A. Production</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Ownership<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Inventory<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Location<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">E. Information<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">F. Transportation</span></p>', 'B', 1, '2021-06-27'),
(186, 21, 'Why would service organizations adopt supply chain management strategies? Options: 1.To improve their processes, 2. To reduce costs, 3. To increase customer satisfaction, 4. To compete with manufacturing companies, 5. To find new markets', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. 1,2,3<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. 3,4,5<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. 5,2,3<o:p></o:p></span></p>\r\n<p><span style=\"color: windowtext;\">D. 1,2,4</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(6, 2, 'Why would service organizations adopt supply chain management strategies?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. To improve their processes<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. To reduce costs<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. To increase customer satisfaction<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. To compete with manufacturing      companies<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. To find new markets<o:p></o:p></span></p>', 'B', 1, '2020-06-24'),
(187, 21, 'Variations in output occur because people are variable. It^s unrealistic to expect everyone to always work at the same pace or be able to produce identical results. ', '<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt;\">A. True</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:&#10;EN-IN\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(7, 2, 'Identify the true statements about capacity in service organizations.', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Capacity is not as important in      service organizations as it is in manufacturing<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Service capacity is dependent on      the number of employees<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Service organizations have no      products<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Service capacity must be aligned to      customer demand<o:p></o:p></span></p>\r\n<p>&nbsp;</p>', 'D', 1, '2020-06-24'),
(188, 21, 'Capacity in service organizations refers to the level of service a company can provide with its resources. The larger its capacity, lesser is the level of service it can provide. ', '<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt;\">A. True</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(189, 21, 'Efficiency in service supply chains relies on _____________ and ___________ between various employees and teams in order to get products out in a timely fashion.', '<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt;\">A. direction and coordination</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:&#10;EN-IN\">B. sensitivity and reaction time<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:&#10;EN-IN\">C. efficient staffing and communication<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:&#10;EN-IN\">D. coordination and communication<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(8, 2, 'The term supply chain management was first coined by ______.', '<p><span style=\"color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">A. Frankel &amp; Paulraj</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">B. Peter Drucker</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">C. Keith Oliver</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">D. Philip Kotler</p>\r\n<p>&nbsp;</p>', 'C', 1, '2020-06-24'),
(190, 21, 'The delivery of a company^s services greatly depends on people and their ability to produce ________ work for their customers on time.', '<p><span style=\"font-family: Arial, sans-serif;\">A. quality</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. quantity<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. quality and quantity<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">D. good<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(9, 2, 'An electronics company is looking to target advanced users with its sophisticated new mp3 player. Which business strategy is this company likely to use?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Differentiation<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Cost leadership<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Differentiation focus<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Cost focus<o:p></o:p></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'C', 0, '2020-06-24'),
(191, 21, 'Reliance on people isn^t limited to the back office workers involved in producing services.', '<p><span style=\"font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(192, 21, 'Variations in output are very common in manufacturing. However, variations are more likely to be identified early and controlled at every step of the supply chain if necessary adjustments are made to machines and equipment.', '<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(10, 2, 'What are the main aims of the Lean production approach?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. To reduce waste<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. To improve process flow<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. To find the cheapest supplier<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. To reduce the workforce<o:p></o:p></span></p>', 'B', 1, '2020-06-24'),
(193, 21, 'Establishing open communication and information sharing enables organizations to confront and resolve any potential problems before they begin to affect workflow adversely.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. True<o:p></o:p></span></p>\r\n<p><span style=\"font-family: Arial, sans-serif;\">B. False</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(194, 21, 'Identify the true statements about capacity in service organizations. Options: 1. Capacity isn^t as important in service organizations as it is in manufacturing, 2. Service capacity is dependent on the number of employees, 3. Service organizations have no products, 4. Service capacity must be aligned to customer demand.', '<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">A.1 &amp; 2<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. 2 &amp; 4<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">C. 1 &amp; 3<o:p></o:p></span></p>\r\n<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">D. 3 &amp; 4</span>&nbsp;</p>', 'B', 1, '2021-06-27'),
(12, 2, 'The initial stage of the supply chain process is the _____________.', '<p><span style=\"color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">A. Sourcing stage</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">B. Organizing stage&nbsp;&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">C. Planning stage</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(38, 40, 45); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px;\">D. Directing stage</p>\r\n<p>&nbsp;</p>', 'C', 1, '2020-06-29'),
(13, 2, 'Identify the true statements about the logistics of a supply chain strategy.', '<p><span lang=\"EN-IN\" style=\"font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif;\">A. Companies should choose one      strategy and stick to it<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif;\">B. A Lean strategy is preferable to an      agile one<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif;\">C. Companies must understand the needs      of their customers<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif;\">D. Supply chain strategy is influenced      by product lead time<o:p></o:p></span></p>', 'C', 1, '2020-06-29'),
(173, 21, 'In Operations & Supply Chain Management, Kaizen is a Japanese term meaning __________.', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. Change for the better<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Continuous Performance<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Top-level quality<o:p></o:p></span></p>\r\n<p><span style=\"color: windowtext;\">D. Use of Kaizala app</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(174, 21, 'According to Frankel, Bolumole, Eltantawy, Paulraj& Gundlach, (2008), these are the four functions identi?ed as foundational – Operations, Logistics, Supply Management, __________.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Marketing</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Production<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Materials<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Procurement<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
