(195, 21, 'Companies can use a number of generic business strategies in order to strengthen their position in the market, the important ones are differentiation, cost leadership, differentiation focus, and cost focus.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. True<o:p></o:p></span></p>\r\n<p><span style=\"font-family: Arial, sans-serif;\">B. False</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(196, 21, 'An electronics company is looking to target advanced users with its sophisticated new mp3 player. Which business strategy is this company likely to use? Options: 1. Differentiation, 2. Cost leadership, 3. Differentiation focus, 4. Cost focus.', '<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">A.1, 4, &amp; 3</span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. 4 &amp; 1<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">C. 2<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">D. 3<o:p></o:p></span></p>', 'D', 0, '2021-06-27'),
(197, 21, '___________ performance can help your company save money. By identifying what^s working well and what needs to be improved, you can better decide what direction your company should take in the future.', '<p><span style=\"font-family: Arial, sans-serif;\">A. Measuring</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Monitoring<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Qualifying </span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Strategizing</span></p>', 'A', 1, '2021-06-27'),
(15, 2, 'Why should companies measure the performance of their supply chains?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. To identify areas of possible      improvement<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. To save money<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. To identify which employees aren^t      performing<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. To find a new supply chain strategy<o:p></o:p></span></p>', 'A', 1, '2020-06-29'),
(198, 21, 'Lean production is a cost-added methodology that aims to eliminate waste and bottlenecks in a process to improve process flow and reduce cost.', '<p><span style=\"font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(199, 21, 'There are two main characteristics of Lean production: the ________________ and the ______________ to production. ', '<p><span style=\"font-family: Arial, sans-serif;\">A. elimination of waste and the pull approach</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. push approach and cost consciousness<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. value management and inventory management<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">D. efficiency focus and team management<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(16, 2, 'Reverse logistics is required because', '<p><span style=\"font-size: larger;\">A. Goods are defective</span></p>\r\n<p><span style=\"font-size: larger;\">B. Goods are unsold</span></p>\r\n<p><span style=\"font-size: larger;\">C. The customers simply change their minds</span></p>\r\n<p><span style=\"font-size: larger;\">D. All of the above</span></p>', 'D', 1, '2020-06-29'),
(200, 21, 'What are the main aims of the Lean production approach? Options: 1. To reduce waste, 2. To improve process flow, 3. To find the cheapest supplier, 4. To reduce the workforce', '<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">A.1 &amp; 2<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. 2 &amp; 3<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">C. 1 &amp; 4<o:p></o:p></span></p>\r\n<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">D. 3 &amp; 4</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(201, 21, 'Identify the true statements about the logistics of a supply chain strategy. Options: 1. Companies should choose one strategy and stick to it, 2. A Lean strategy is preferable to an agile one, 3. Companies must understand the needs of their customers, 4. Supply chain strategy is influenced by product lead time', '<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">A. 3 &amp; 4</span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. 1 &amp; 2<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">C. 2 &amp; 3<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">D. 1 &amp; 4<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(202, 21, 'Despite the success of Lean production, coping with the needs of an ever-changing market has led companies to develop another supply chain strategy, that is, ________________________.', '<p><span style=\"font-family: Arial, sans-serif;\">A. customization and value addition.</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. costcentric and efficiency monitoring.<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. business analysis and big data.<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">D. agile and mass customization.&nbsp;<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(203, 21, 'The principle of postponement allows companies to reconfigure their logistics and standardize inventory management.', '<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(204, 21, 'After products have been mass produced, _________________ process allows for companies to customize their products later in the production process.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">A. mass customization<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. logistics<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">C. procurement <o:p></o:p></span></p>\r\n<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">D. distribution</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(17, 2, 'Distribution requirement planning is a system for', '<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">A.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp;</span></span><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Inventory management<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:15.0pt;text-indent:-.25in;line-height:&#10;130%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">B.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Distribution planning<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:15.0pt;text-indent:-.25in;line-height:&#10;130%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">C.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;