(205, 21, 'Mass customization is a Lean Production strategy that involves customizing products that have been mass produced.', '<p>A. True</p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(206, 21, 'There are two important considerations every company needs to take into account when determining its supply chain strategy: ___________ and ', '<p>A. lean strategy and agile management.</p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\">B. production and operations management.<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\">C. inventory management and purchase strategies.<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\">D. lead time and characteristics of demand.<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(207, 21, 'When determining your approach, it^s important to keep in mind that ______ strategies aren^t always better than _______ strategies, and vice versa.', '<p><span style=\"font-family: Arial, sans-serif;\">A. logistics &ndash; lean</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. lean &ndash; agile<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. agile &ndash; pull<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">D. customization &ndash; costing<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(18, 2, 'Consider the inventory in your company. How well do you think your company manages that inventory?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">A.Very well&nbsp; </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">B. Fairly well&nbsp; </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">C. Poorly</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'B', 1, '2020-06-29'),
(208, 21, 'Why should companies measure the performance of their supply chains? Options: 1. To identify areas of possible improvement, 2. To save money, 3. To identify which employees aren^t performing, 4. To find a new supply chain strategy', '<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">A. 3 &amp; 4</span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. 1 &amp; 4<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">C. 3 &amp; 4<o:p></o:p></span></p>\r\n<p class=\"feature-stem\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">D. 1 &amp; 2<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(209, 21, 'Supply chain performance measurement is based on four significant areas: planning, operations, delivery, and post-delivery', '<p><span style=\"font-family: Arial, sans-serif;\">A. planning &ndash; operations &ndash; delivery &ndash; post-delivery.</span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. cost overrun &ndash; lean &ndash; agile &ndash; time overrun.<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. inventory analysis &ndash; purchase strategy.<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">D. sales campaign &ndash; marketing strategies.<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(210, 21, 'The ______, and _________________ are used in a situation when inventory should be replenished quickly and demand is unpredictable. ', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. customization, costcentric<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. agile, quick response approach<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. lean, quick response approach<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">D. inventory, lean approach<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(19, 2, 'What are the advantages of effective inventory management?', '<p style=\"text-indent: 0px; \"><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">A. Costs are reduced&nbsp; </span></p>\r\n<p style=\"text-indent: 0px; \"><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">B</span><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;</span></span><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Sales are increased&nbsp; </span></p>\r\n<p style=\"text-indent: 0px; \"><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">C</span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;</span></span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">Waste is reduced&nbsp; </span></p>\r\n<p style=\"text-indent: 0px; \"><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">D.&nbsp;</span><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Production meets customer demand&nbsp; </span></p>\r\n<p style=\"text-indent: 0px; \"><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">E.&nbsp;</span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">Demand remains steady</span></p>', 'C', 1, '2020-06-29'),
(158, 21, 'The initial stage of the supply chain process is the _____________.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Sourcing Stage</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Organizing Stage<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Planning stage<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Directing Stage<o:p></o:p></span></p>', 'C', 1, '2021-06-27'),
(159, 21, 'The term supply chain management was first coined by ______.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Frankel &amp; Paulraj</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Peter Drucker<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Keith Oliver<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Philip Kotler<o:p></o:p></span></p>', 'C', 1, '2021-06-27');
INSERT INTO `rim_quizquestion` (`Id`, `Quizid`, `Question`, `Answer`, `Correctans`, `Mark`, `Dateofpost`) VALUES
(160, 21, 'In supply chain management, after planning, the next step involves ______________.', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. Developing<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Building a strong relationship with suppliers<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Sourcing<o:p></o:p></span></p>\r\n<p><span style=\"color: windowtext;\">D. All of the above</span>&nbsp;</p>', 'D', 1, '2021-06-27'),
(20, 2, 'A construction company is having problems with an unreliable supplier. Deadlines are being missed because the supplies aren^t arriving to building sites on time. Because of this, the company decides to start maintaining extra stocks. What type of inventory is this?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Seasonal<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. In transit<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Safety<o:p></o:p></span></p>', 'A', 1, '2020-06-29'),
(21, 2, 'The major decision areas in supply chain management are', '<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">A. Location, production, distribution, inventory </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">B. Planning, production, distribution, inventory </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">C. Location, production, scheduling, inventory </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">D. Location, production, distribution, marketing</span><span lang=\"EN-IN\" style=\"line-height: 130%; color: rgb(73, 75, 67); font-size: 13.3333px;\"><font face=\"verdana, geneva\">&nbsp;</font></span></p>', 'A', 1, '2020-06-29'),
(211, 21, 'The Lean planning and execution approach is used when there^s unpredictable demand and replenishment lead times are short.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. True<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(212, 21, 'The first step in improving your supply chain is to ________________________', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. streamline production process.<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. have an efficient HR policy.<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. measure its performance.<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">D. monitor progress in performance.<o:p></o:p></span></p>', 'C', 1, '2021-06-27'),
(213, 21, 'A company that effectively manages its inventory is able to ensure it always has enough supplies and goods to meet customer demand while optimizing various inventory-associated costs.', '<p class=\"secondlevel-text\" style=\"line-height:115%\"><span lang=\"EN-IN\">A. True<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"line-height:115%\"><span lang=\"EN-IN\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(214, 21, 'If a company manages its inventory correctly, it could end up with too few supplies to meet customer demand.', '<p class=\"secondlevel-text\" style=\"line-height:115%\"><span lang=\"EN-IN\">A. True<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"line-height:115%\"><span lang=\"EN-IN\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(215, 21, 'When a company manages its inventory, it aims to align its production with customer demand. This enables it to ensure that it isn^t producing too few or too many products. Increasing inventory reduces costs, such as purchasing costs, storage costs, and administration costs.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. True<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(216, 21, 'In order to manage your inventory, it is not necessary to predict what supplies you^ll need to meet customer demand. Because customer demand fluctuates, you must ensure that you can adjust your inventory levels as needed.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. True<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(217, 21, 'Performance measurement can be used to discover the weak points within a company.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. True<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(218, 21, 'The four areas where performance should be measured are planning, operations, delivery, and transportation.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. True<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(22, 2, 'What characteristics and challenges must a service organization bear in mind when implementing inventory management?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Inventories perish<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Direct customer contact<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Capacity must be planned and      managed<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Inventory and capacity are linked<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. Supplies are always tangible<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">F. Service supplies are cheaper<o:p></o:p></span></p>', 'B', 1, '2020-06-29'),
(219, 21, 'A key performance indicator in the _______________operations stage is order lead time.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Operations<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Logistics<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Inventory<o:p></o:p></span></p>\r\n<p><span style=\"font-family: Arial, sans-serif;\">D. Efficiency Index</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(220, 21, 'The simplest way to categorize inventory is by what it is 1.___________ 2.__________ and 3.________________', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;\">A.1.<span style=\"color:#494B43\">raw materials, 2.work in progress, 3.finished goods <o:p></o:p></span></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B.1.work in progress, 2.production capacity, 3.ABC analysis<o:p></o:p></span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">C.1.finished goods, 2.FIFO, 3.warehousing<o:p></o:p></span></p>\r\n<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">D.1.ease of identification, 2.QR coding, 3.bar coding </span><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif;\">&nbsp;</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(23, 2, 'VMI stands for', '<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">A.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Vendor material inventory</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">B. Vendor managed inventory</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">C. Variable material inventory</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">D. Valuable material inventory</span></p>', 'B', 1, '2020-06-29'),
(221, 21, 'Safety inventory is \"buffer stock\" that protects you against certainties. Customers might not suddenly demand more goods than expected. A supplier might not deliver parts on time. Safety inventory does not allow you to continue production when the unexpected happens.', '<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">A. True </span></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\"><span lang=\"EN-IN\" style=\"font-family:&#10;&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. False</span></p>', 'B', 1, '2021-06-27'),
(222, 21, 'A construction company is having problems with an unreliable supplier. Deadlines are being missed because the supplies aren^t arriving to building sites on time. Because of this, the company decides to start maintaining extra stocks. What type of inventory is this?', '<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif; font-size: 12pt;\">A. Seasonal</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto\"><span style=\"font-size:12.0pt;line-height:115%;&#10;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">B. In transit<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto\"><span style=\"font-size:12.0pt;line-height:115%;&#10;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#494B43\">C. Safety<o:p></o:p></span></p>', 'C', 1, '2021-06-27'),
(238, 22, 'A 3 sigma process will have', '<p><span style=\"font-family: Arial, sans-serif;\">A. 233 ppm</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. 6210 ppm<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. 308770 ppm<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. 66810 ppm<o:p></o:p></span></p>', 'D', 1, '2021-07-26'),
(224, 22, 'Sum Square of Error is equal to:', '<p>A. Sum Squares due to Pure Error + Sum Squares due to Lack of Fit&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Sum Squares due to Pure Error - Sum Squares due to Lack of Fit&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Sum Squares due to Lack of Fit-Sum Squares due to Pure Error&nbsp;</p>\r\n<p class=\"MsoNormal\">D. None of the above</p>', 'A', 1, '2021-07-26'),
(225, 22, 'Which of the following cannot be considered as an acceptable reason for deploying a Six Sigma DMAIC project?', '<p>A. Reduce Cost of Quality&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Increase Customer Satisfaction&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Reduce internal problems&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Improve the Design</p>', 'D', 1, '2021-07-26'),
(226, 22, 'Which of these is considered a technique to collect data or comments from customers?', '<p>A. Multivoting&nbsp; &nbsp;</p>\r\n<p class=\"MsoNormal\">B. Customer needs prioritization</p>\r\n<p class=\"MsoNormal\">C. Focus Groups&nbsp;&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Nominal Group Technique</p>', 'C', 1, '2021-07-26'),
(227, 22, 'Which of the following tools is most commonly used in the define phase of a project?', '<p>A. Affinity diagram</p>\r\n<p class=\"MsoNormal\">B. Control chart&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Failure mode and effects analysis</p>\r\n<p class=\"MsoNormal\">D. Data collection checklist</p>', 'A', 1, '2021-07-26'),
(228, 22, 'When samples are drawn out of a population randomly, what is said to be true?', '<p>A. The sample mean is always the same as population mean&nbsp;</p>\r\n<p class=\"MsoNormal\">B. The sample standard deviation will be the same as population standard deviation&nbsp;</p>\r\n<p class=\"MsoNormal\">C. The sampling distribution approaches normality with increase in sample size&nbsp;</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. The sampling distribution would be triangular if population is distributed as triangular distribution</span></p>', 'C', 1, '2021-07-26'),
(229, 22, 'What is the key benefit of multi-vari charting?', '<p>A. It keeps track of the time when measurements were made</p>\r\n<p class=\"MsoNormal\">B. It graphically displays the variation in a process</p>\r\n<p class=\"MsoNormal\">C. It assists in the breakdown of components of variation&nbsp;</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. It is much easier to plot than most control charts<br />\r\n<!--[if !supportLineBreakNewLine]--><br />\r\n<!--[endif]--></span></p>', 'C', 1, '2021-07-26'),
(230, 22, 'What is Lean philosophy?', '<p>A. Provide perfect value to the customer through a perfect value creation process that has zero waste</p>\r\n<p class=\"MsoNormal\">B. Continuous improvement</p>\r\n<p class=\"MsoNormal\">C. Higher output by encouraging people to work hard and have targets</p>\r\n<p class=\"MsoNormal\">D. Reducing cost and improving purchasing power for the individuals</p>', 'A', 1, '2021-07-26'),
(231, 22, 'Deciding to collect sample from a population is often:', '<p>A. A personal decision</p>\r\n<p class=\"MsoNormal\">B. An economical decision</p>\r\n<p class=\"MsoNormal\">C. Risky decision</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. Team decision</span></p>', 'B', 1, '2021-07-26'),
(232, 22, 'A company making rubber tires is evaluated on 5 opportunities per product; in 1000 products manufactured in a month if 100 defects are observed, the Rolled Throughput Yield is:', '<p>A. 98 %&nbsp;</p>\r\n<p class=\"MsoNormal\">B. 99 %&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p class=\"MsoNormal\">C. 97 %&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p class=\"MsoNormal\">D. 96 %</p>', 'A', 1, '2021-07-26'),
(233, 22, 'The purpose of \"rolled throughput yield\" in Six Sigma would NOT be to:', '<p>A. Analyze a process flow for improvement ideas</p>\r\n<p class=\"MsoNormal\">B. Spot significant differences in yield&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Use the calculation for customer analysis&nbsp;&nbsp;</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. Provide a baseline metric</span></p>', 'C', 1, '2021-07-26'),
(234, 22, 'In embracing Six Sigma, what has been the principal motivating factor from the point of view of top management?', '<p>A. Bottom line results</p>\r\n<p class=\"MsoNormal\">B. Market share growth</p>\r\n<p class=\"MsoNormal\">C. Defect reductions</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. Customer focus<br />\r\n<!--[endif]--></span></p>', 'A', 1, '2021-07-26'),
(235, 22, 'Which of the below mentioned tools is considered best to inform employees of their work roles, in terms of ease of understanding and implementation?', '<p>A. Written Instructions</p>\r\n<p class=\"MsoNormal\">B. Job Description</p>\r\n<p class=\"MsoNormal\">C. Process Flow Maps</p>\r\n<p class=\"MsoNormal\">D. Standardized Work Templates</p>', 'A', 1, '2021-07-26'),
(236, 22, 'Cause and Effect Diagram when used with 5 WHY helps you in understanding the root cause of the problem. In doing so, what does the Six Sigma team wish to know?', '<p>A. The assignable causes&nbsp;&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Causes attributable to categories</p>\r\n<p class=\"MsoNormal\">C. Categories that can be ignored</p>\r\n<p class=\"MsoNormal\">D. None of the above</p>', 'A', 1, '2021-07-26'),
(237, 22, 'A Six Sigma project had a lot of improvement measures suggested on training people, setting standardized job instructions, getting surveys done from employees, and so on. Who would be the focused audience for whom this project was aimed at?', '<p>A. External customers</p>\r\n<p class=\"MsoNormal\">B. Stakeholders</p>\r\n<p class=\"MsoNormal\">C. Internal customers</p>\r\n<p class=\"MsoNormal\">D. All the above</p>', 'C', 1, '2021-07-26'),
(239, 22, 'A correlation analysis is used to provide a numeric value for which ot the following types of relationships between two variables?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Random</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Linear<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Curvilinear<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Causation<o:p></o:p></span></p>', 'B', 1, '2021-07-27'),
(24, 2, 'What are procurement costs?', '<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">A.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">The costs of purchased goods</span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">B.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">The costs associated with placing orders and purchasing goods<o:p></o:p></span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">C.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">The costs of storing the goods<o:p></o:p></span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">D.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">The costs of lost sales<o:p></o:p></span></p>', 'B', 1, '2020-06-29'),
(240, 22, 'A measurement system analysis is designed to assess the statistical properties of:', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. gage variation<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. process performance<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. process stability<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. engineering tolerances<o:p></o:p></span></p>', 'A', 1, '2021-07-27'),
(25, 2, 'The fastest and most costly mode of transport', '<p><span style=\"font-size: large;\">A. Air transport</span></p>\r\n<p><span style=\"font-size: large;\">B. Water transport</span></p>\r\n<p><span style=\"font-size: large;\">C. Ropeways</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'A', 1, '2020-06-29'),
(161, 21, 'In Supply Chain Management, ATP stands for _________.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Acquire Track &amp; Perform</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Available To Promise<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Active Transport Protocol<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Access To Point<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(162, 21, 'The purpose of supply chain management is to_______.', '<p>&nbsp;<span style=\"color: windowtext;\">A. increase the production level</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. manage and integrate supply and demand management<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. enhance the quality of a product and services<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. provide satisfaction to the customer<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(26, 2, 'What can cause stock-out costs?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. An unexpected increase in customer      demand<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. A shortage of inventory <o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. An increase in supplier      administration costs<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. An increase in warehouse insurance<o:p></o:p></span></p>', 'B', 1, '2020-06-29'),
(241, 22, 'Cause and effect diagram is not known as:', '<p><span style=\"font-family: Arial, sans-serif;\">A. Ishikawa diagram</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. 4-M<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Affinity diagram<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. None of the above<o:p></o:p></span></p>', 'C', 1, '2021-07-27'),
(242, 22, 'Cause and effect diagram is used for:', '<p><span style=\"font-family: Arial, sans-serif;\">A. Identifying root cause</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Generating ideas<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Reducing duplicate ideas<o:p></o:p></span></p>', 'A', 1, '2021-07-27'),
(27, 2, 'Due to small change in customer demands, inventory oscillations become progressively larger looking through the supply chain. This is known as', '<p><span lang=\"EN-IN\" style=\"text-indent: 0in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">A. Bullwhip effect</span></p>\r\n<p><span lang=\"EN-IN\" style=\"text-indent: 0in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">B. Netchain analysis</span></p>\r\n<p><span lang=\"EN-IN\" style=\"text-indent: 0in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">C. Reverse logistics</span></p>\r\n<p><span lang=\"EN-IN\" style=\"text-indent: 0in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">D. Reverse suply-chain&nbsp;</span></p>', 'A', 1, '2020-06-29'),
(258, 22, 'What is the correct order of six sigma phases?', '<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Define, Analyze, Improve, Control, Measure<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Define, Analyze, Measure, Improve, Control<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Define, Measure, Analyze, Improve, Control<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Define, Measure, Analyze, Control, Improve<o:p></o:p></span></p>', 'C', 1, '2021-07-27'),
(244, 22, 'For a normal distribution, 2 standard deviations on each side of the mean would include what percentage of the total population?', '<p><span style=\"font-family: Arial, sans-serif;\">A. 95%</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. 68%<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. 47% </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D</span><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">.34%</span></p>', 'A', 1, '2021-07-27'),
(249, 22, 'Statistical process control is best defined as the use of:', '<p><span style=\"font-family: Arial, sans-serif;\">A. Pareto charts to understand and control a process</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. inputs to control critical and complex processes<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. statistical methods to identify and remove manufacturing errors<o:p></o:p></span></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:&#10;EN-IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">D. statistical methods to understand and control a process</span></p>', 'D', 1, '2021-07-27'),
(245, 22, 'In order for value inflow analysis to be effective, a team must take which of the following steps first?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Define the value stream</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Eleminate backlogs in the value stream<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Identify overlapping&nbsp; functions in the value stream<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Identify specific work practices within the value stream<o:p></o:p></span></p>', 'A', 1, '2021-07-27'),
(246, 22, 'It is a technique to trace the rule responsible for the problem and break the assumption for the process:', '<p><span style=\"font-family: Arial, sans-serif;\">A. Assumption busting</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif;\">B. Analogy technique<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif;\">C. Benchmarking<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif;\">D. Constrained Brain writing</span></p>', 'A', 1, '2021-07-27'),
(247, 22, 'Positional, cyclical, and temporal variations are most commonly analyzed in', '<p><span style=\"font-family: Arial, sans-serif;\">A. SPC charts</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. multi-vari charts<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. cause and effect diagrams<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. run charts<o:p></o:p></span></p>', 'B', 1, '2021-07-27'),
(250, 22, 'The critical path for a project is best described as:', '<p><span style=\"font-family: Arial, sans-serif;\">A. sequence of steps with the highest costs</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. tasks in the project that have the highest risk of failure<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. some of the tasks with the shortest time requirements<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. longest path from the start to the completion of the project<o:p></o:p></span></p>', 'D', 1, '2021-07-27'),
(251, 22, 'The DMAIC model is defined as:', '<p><span style=\"font-family: Arial, sans-serif;\">A. Deliver, measure, analyze, install and control</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Define, measure, analyse, improve and control<o:p></o:p></span></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:&#10;EN-IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">C. Define, measure, analyze, initiate and control&nbsp;</span></p>', 'B', 1, '2021-07-27'),
(252, 22, 'The statistics that summarize a population are referred to as:', '<p><span style=\"font-family: Arial, sans-serif;\">A. categorical statistics</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. descriptive statistics<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. probablistic statistics<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. control statistics<o:p></o:p></span></p>', 'B', 1, '2021-07-27'),
(253, 22, 'The team prepares Data Management Plan during which of the following phase?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Define phase</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Measure phase<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Improve phase<o:p></o:p></span></p>', 'B', 1, '2021-07-27'),
(254, 22, 'To calculate 99.97% statistical control limits, the practical use of sigma level should be: ', '<p><span style=\"font-family: Arial, sans-serif;\">A. +/- 3 sigma</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. +/- 2 sigma<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. +/- 1 sigma<o:p></o:p></span></p>', 'A', 1, '2021-07-27'),
(255, 22, 'What are the ways of capturing VOC?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Surveys</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Focus groups<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Brainstorming<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. A &amp; B<o:p></o:p></span></p>', 'D', 1, '2021-07-27'),
(28, 2, 'What questions do you need to ask when managing inventory?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. How much inventory do I need to      meet demand?<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. When do I need to order more      inventory?<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Which customers are going to use my      inventory?<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. How can I more efficiently use my      inventory in production?<o:p></o:p></span></p>', 'A', 1, '2020-06-29'),
(29, 2, 'What does the EOQ enable you to calculate?', '<p>&nbsp;<span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">A.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">The best value supplier</span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">B.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">The best time to reorder<o:p></o:p></span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">C.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">The optimal amount to order to minimize costs<o:p></o:p></span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">D.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">The most reliable supplier<o:p></o:p></span></p>', 'C', 1, '2020-06-29'),
(259, 22, 'What type of data is illustrated by discrete distributions?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Variable data</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Ordinal data<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Continuous data<o:p></o:p></span></p>', 'B', 1, '2021-07-27'),
(30, 2, 'A car company has an annual demand for 10,000  car mirrors in inventory. It costs $50 to place a single order, and the annual holding cost per mirror is $4. What is the EOQ? The formula is the square root of two A times Cp divided by Ch.', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Five hundred<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Five thousand<o:p></o:p></span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size: 12pt; font-family: Arial, sans-serif;\">C. </span><span lang=\"EN-IN\" style=\"font-size: 12pt; font-family: Arial, sans-serif; font-weight: normal;\">Reorder point (ROP)</span><span lang=\"EN-IN\" style=\"font-size: 12pt; font-family: Arial, sans-serif;\"><o:p></o:p></span></p>', 'A', 1, '2020-06-29'),
(260, 22, 'When the sampling method used creates a difference between the result obtained from the sample and the actual population value, the difference is known as:', '<p><span style=\"font-family: Arial, sans-serif;\">A. correlation</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. precision<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. accuracy </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. bias</span></p>', 'D', 1, '2021-07-27'),
(261, 22, 'Which of the following is a commonly accepted level for alpha risk?', '<p><span style=\"font-family: Arial, sans-serif;\">A. 0.05</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. 0.5<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. 0.7&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. 0.95&nbsp;</span></p>', 'A', 1, '2021-07-27'),
(31, 2, 'What is the ROP?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. The minimum amount of inventory      your company should reach<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. The predicted level of sales<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. The estimated delivery time for      supplies<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. The date on which you should      reorder supplies<o:p></o:p></span></p>', 'A', 1, '2020-06-29'),
(262, 22, 'Which of the following is a non-parametric test?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Regression</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. 2 tailed 2 sample t test<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. ANOVA<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Kruksal test<o:p></o:p></span></p>', 'D', 1, '2021-07-27'),
(32, 2, 'A car company uses 100 mirrors each day. The lead time is 7 days. And the company has a safety stock of 300 mirrors. What is the ROP? The formula is usage multiplied by lead time, plus safety stock.', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. 1,000<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. 100<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. 10,000<o:p></o:p></span></p>', 'A', 1, '2020-06-29'),
(263, 22, 'Which of the following is the key objective of a six sigma project?', '<p>&nbsp;<span style=\"font-family: Arial, sans-serif;\">A. Developing detailed control charts for critical processes</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Developing a matrix to understand the hows and whats of a problem process<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Reducing variation in critical processes&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Reducing investment costs while improving output quality&nbsp;</span></p>', 'C', 1, '2021-07-27'),
(33, 2, 'Logistics is the part of a supply chain involved with the forward and reverse flow of', '<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">A. Goods</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">B. Services</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">C. Cash</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">D. All of the above</span></p>', 'D', 1, '2020-06-29'),
(264, 22, 'Which of the following measures is increased when process performance is improved?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Variability range</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Capability index<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Repeatability index<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Specification limits<o:p></o:p></span></p>', 'B', 1, '2021-07-27'),
(265, 22, 'Which of the following measure is used to show the ratio of defects to units?', '<p><span style=\"font-family: Arial, sans-serif;\">A. DPU</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. DPO<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. DPMO<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. PPM<o:p></o:p></span></p>', 'A', 1, '2021-07-27'),
(266, 22, 'Which of the following shapes is used to present a termination point in a flowchart?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Rectangle</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Diamond<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Arrow<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Oval<o:p></o:p></span></p>', 'D', 1, '2021-07-27'),
(267, 22, 'Which of the following terms is used to describe the risk of a type I error in a hypothesis test?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Power</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Confidence level<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Level of significance<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Beta risk<o:p></o:p></span></p>', 'C', 1, '2021-07-27');
INSERT INTO `rim_quizquestion` (`Id`, `Quizid`, `Question`, `Answer`, `Correctans`, `Mark`, `Dateofpost`) VALUES
(268, 22, 'Which of the following tools can be used to identify the source of a problem?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Affinity diagram</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Control chart<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Pareto chart<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Quality function deployment<o:p></o:p></span></p>', 'C', 1, '2021-07-27'),
(269, 22, 'Which of the following tools is used extensively in quality function deployment (QFD)?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Affinity diagram</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Matrix diagram<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Cause and effect diagram<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Activity network diagram<o:p></o:p></span></p>', 'B', 1, '2021-07-27'),
(270, 22, 'Which of the following tools is used to identify potential events and contingencies for an implementation plan?', '<p><span style=\"font-family: Arial, sans-serif;\">A. PERT chart</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Process decision program chart<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Fishbone diagram&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. House of quality&nbsp;</span></p>', 'B', 1, '2021-07-28'),
(34, 2, 'Place the steps for implementing an MRP system in order.', '<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">A.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">Create a production schedule</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:15.0pt;text-indent:-.25in;line-height:&#10;130%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">B.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Create a bill of materials<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:15.0pt;text-indent:-.25in;line-height:&#10;130%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">C.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Work out how many materials are needed<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:15.0pt;text-indent:-.25in;line-height:&#10;130%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">D.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Determine when your suppliers can send the materials<o:p></o:p></span></p>', 'D', 1, '2020-07-04'),
(35, 2, 'What are the advantages of the ERP inventory management system?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. It integrates different business      processes<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. It is a simple process to implement<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. It is a cost-effective inventory solution<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. It uses real-time data<o:p></o:p></span></p>', 'A', 1, '2020-07-04'),
(271, 22, 'In the Analyze stage of the Six Sigma DMAIC process, project teams carefully analyze process output and input variables. Is this statement “True” or “False”?', '<p><span style=\"font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-07-28'),
(36, 2, 'What are the characteristics of a JIT inventory management system?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Unused inventory is regarded as      waste<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Supplies are ordered only when      there^s a need for them<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Production schedules focus on      long-term requirements<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Safety stock is maintained against      unexpected delays<o:p></o:p></span></p>', 'A', 1, '2020-07-04'),
(272, 22, 'Multi-varied analysis is a tool that is used within statistical analysis that involves observation and analysis of more than one statistical outcome variable at a time. But, it is not particularly useful within Six Sigma when we have multiple input factors that we are trying to understand how they impact the outcome of our process. Is this statement “True” or “False”?', '<p><span style=\"font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-07-28'),
(273, 22, 'The first use of multi-vari analysis is analyzing patterns of variation. Is this statement “True” or “False”?', '<p><span style=\"font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-07-28'),
(37, 2, 'The purpose of supply chain management is', '<p><span style=\"font-size: large;\"><span style=\"box-sizing: border-box; border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: verdana, geneva; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">A. Provide customer satisfaction</span></span></p>\r\n<p><span style=\"font-size: large;\"><span style=\"box-sizing: border-box; border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: verdana, geneva; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">B. Improve quality of a product</span></span></p>\r\n<p><span style=\"font-size: large;\"><span style=\"box-sizing: border-box; border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: verdana, geneva; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">C. Integrating supply and demand management</span></span></p>\r\n<p><span style=\"font-size: large;\"><span style=\"box-sizing: border-box; border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: verdana, geneva; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">D. Increase production</span></span></p>', 'C', 1, '2020-07-04'),
(163, 21, 'Another important purpose of supply chain management is to ___________.', '<p>&nbsp;<span style=\"color: windowtext;\">A. make inventory readily available</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. delight customers and suppliers<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. create warehouses at various locations<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. to promote supply chain process<o:p></o:p></span></p>', 'A', 1, '2021-06-27'),
(164, 21, '________is mainly deals with all activities associated with the flow and transformation and information of goods from the stage of raw material to the end user i.e. consumption.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Production Line</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Supply Chain<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Inventory management<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Marketing Channel<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(38, 2, 'How important do you think the effective management of purchases is to your company?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Very important&nbsp; </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Moderately important&nbsp; &nbsp;</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Not important</span></p>', 'B', 1, '2020-07-04'),
(39, 2, 'If you understand how to manage purchases of supplies and services, what can this equip you to do?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Reduce costs &ndash; and therefore boost      profits &ndash; for your company<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Improve the quality of services or products of your company<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Enable your company to respond      faster to changes in customer demand<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Allow you to only use local      suppliers<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. Check your balance sheet for any      unnecessary purchasing costs after ordering supplies<o:p></o:p></span></p>', 'C', 1, '2020-07-04'),
(279, 22, 'What is Causation? ', '<p><span style=\"font-family: Arial, sans-serif;\">A. Causation determines which Xs cause which Ys.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Causation identifies the areas where there is a lag in the curve.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Causation explains the Normal Distribution Cure most accurately.<o:p></o:p></span></p>', 'A', 1, '2021-07-28'),
(280, 22, 'Now let us take a closer look at the difference between correlation and causation and why it is important as a Six Sigma team that you look at the statistical significance or the ________ of a correlation coefficient to interpret that correlation in terms of our statistical significance.  Fill up the blank:', '<p><span style=\"font-family: Arial, sans-serif;\">A. t-factor</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. z-factor<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. p-factor<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. None of the above<o:p></o:p></span></p>', 'C', 1, '2021-07-28'),
(40, 2, 'What do you think are examples of leveraging purchases?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Placing a bulk order in return for      a substantial discount<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Signing a long-term service      contract with a supplier to secure lower prices<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Using multiple suppliers to reduce      risk<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Ensuring purchase orders are placed      in good time<o:p></o:p></span></p>', 'B', 1, '2020-07-04'),
(281, 22, 'The statistical significance of correlation helps ensure that the right variables are focused on. Statistical significance is also used to test whether correlation coefficients are subject to chance. It is vital that Six Sigma teams determine the statistical significance of the data being used. And, just because we determine their significance, it positively means that it is an important variable. Is this statement “True” or “False”?', '<p><span style=\"font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-07-28'),
(41, 2, 'Which of the following is true for supply chain management?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. The physical material moves in the direction of the end of chain </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Flow of cash backwards through the chain </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Exchange of information moves in both the direction </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. All of the above&nbsp;</span></p>', 'D', 1, '2020-07-04'),
(282, 22, ' ----- statistics is used to apply to describe the data using numbers, charts, and graphs and the ----------statistics used determine the interrelationship of population parameters. Fill up the blanks:', '<p><span style=\"font-family: Arial, sans-serif;\">A. Descriptive, Inferential</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Descriptive, Statistical<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Descriptive, Programmed<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. None of the above<o:p></o:p></span></p>', 'A', 1, '2021-07-28'),
(42, 2, 'In which ways can purchasing personnel add value to an organization?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. By identifying and selecting the      best suppliers<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. By taking corrective action      whenever suppliers fail to meet agreements<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. By working with suppliers to      determine how to reduce costs or improve value<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. By ensuring suppliers have a feel      for what^s expected of them<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. By always ensuring they use the      suppliers that offer the lowest prices<o:p></o:p></span></p>', 'B', 1, '2020-07-04'),
(283, 26, 'The supply chain concept originated in what discipline?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. marketing<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. operations<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. logistics<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. production<o:p></o:p></span></p>', 'A', 1, '2021-08-03'),
(284, 26, 'The supply chain management philosophy emerged in which decade?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. 1960s<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. 1970s<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. 1980s<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. 1990s<o:p></o:p></span></p>', 'C', 1, '2021-08-03'),
(43, 2, 'What are examples of activities you perform during the first two steps of the purchasing process?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Conduct market research about the      required product or service<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Determine whether user requirements      are absolutely necessary, if you can get a substitute product for a      cheaper price<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Determine the required number of      suppliers<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. Identify a favorite supplier, based      on reputation<o:p></o:p></span></p>', 'C', 1, '2020-07-04'),
(285, 26, 'A_______________	encompasses all activities associated with the flow and transformation of goods from the raw material stage, through to the end-user, as well as the associate information flows.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. production line <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. supply chain <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. marketing <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. channel warehouse<o:p></o:p></span></p>', 'B', 1, '2021-08-03'),
(44, 2, 'The third and fourth steps of the purchasing process are creating bid documents and evaluating and selecting suppliers.  What are examples of activities you should perform as part of these steps?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Detailing exactly what is required      and by when<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Mailing a broad description of what      you require to as many suppliers as possible<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Using the same set of criteria to      judge the suitability of each offer you receive<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Picking the supplier with the      cheapest offer<o:p></o:p></span></p>', 'A', 1, '2020-07-04'),
(288, 26, 'Which one of the following best represents a pure “good”?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Soap<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Fast food<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Attending a play <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Vehicle repair<o:p></o:p></span></p>', 'A', 1, '2021-08-03'),
(45, 2, 'Sequence examples of activities in the purchasing process.', '<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">A. Do some market research on prices and potential suppliers</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Find out how many suppliers you will      need<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Create a bid document detailing      your requirements<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Judge the supplier bids you receive<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. Add any agreed supplier terms to      the contract<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">F. Get user feedback on the purchased      product<o:p></o:p></span></p>', 'D', 1, '2020-07-04'),
(286, 26, 'Which of the following are not key attributes of supply chain management?  ', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. inventory control<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. leveraging technology<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. customer power<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. all are key attributes<o:p></o:p></span></p>', 'C', 1, '2021-08-03'),
(287, 26, 'Positive, long-term relationships between supply chain participants refer to:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. tailored logistics <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. partnerships<o:p></o:p></span></p>\r\n<p><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&#10;Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">C. supply chain management&nbsp;</span></p>\r\n<p>&nbsp;</p>', 'C', 1, '2021-08-03'),
(46, 2, 'The corporate purchasing strategy of a company is to prize quality above all else.   Which purchasing activities are consistent with this corporate plan?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Visiting suppliers^ facilities to      make sure they offer quality services<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Stressing the importance of      communication with suppliers<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Implementing strict quality checks before      accepting supplies<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Negotiating good credit terms with      a supplier<o:p></o:p></span></p>', 'C', 1, '2020-07-04'),
(289, 26, 'The bullwhip effect:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. is an ineffective way to motivate warehouse employees<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. applies to rodeos and has nothing to do with supply chain management<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. refers to the &ldquo;swaying&rdquo; motion associated with triple trailers<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. refers to variability in demand orders among supply chain participants<o:p></o:p></span></p>', 'B', 1, '2021-08-03'),
(47, 2, 'What are the advantages of using multiple supply sources rather than a single source?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Increased competition among      suppliers<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. More loyal relationships with      suppliers<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. The availability of alternatives      when they^re needed<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. A more streamlined purchasing      procedure<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. Access to multiple companies^      expertise<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">F. Greater flexibility in response to      market or economic changes<o:p></o:p></span></p>', 'E', 1, '2020-07-04'),
(290, 26, 'The variability in demand orders among supply chain participants:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. cannot be controlled<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. refers to the bullwhip effect<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. can be controlled with electronic order placement<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. is more pronounced in relational exchanges<o:p></o:p></span></p>', 'D', 1, '2021-08-03'),
(48, 2, 'Anna Is the purchaser for a large hotel group. She is preparing to buy supplies of dining room consumables such as pre-packaged jams and butter. Currently she works with one supplier. The corporate strategy of the hotel group is focused on keeping costs low.', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Use more than one source in case      the one supplier cannot deliver<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Buy the consumables only at a later      stage<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Get the hotel to make the products itself      instead of buy them<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Stock the right amount of product      at any given time<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. Offer the single supplier      incentives for faster delivery<o:p></o:p></span></p>', 'D', 1, '2020-07-04'),
(291, 26, 'Cooperative  supply  chain  relationships  developed  to  enhance  the  overall  business performance of both parties is a definition of:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. third-party logistics <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. supply chain collaboration <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. dovetailing<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. relationship marketing<o:p></o:p></span></p>', 'C', 1, '2021-08-03'),
(292, 26, 'What is a perfect order?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. simultaneous achievement of relevant customer metrics<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. an order that arrives on time<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. an order that arrives undamaged<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. an order that is easy for the receiver to fill<o:p></o:p></span></p>', 'A', 1, '2021-08-03'),
(49, 2, 'In which scenario would you require an SOW?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. You need a new set of chairs for the reception area of your company<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. You need a custom software package      to manage employee productivity&nbsp;</span></p>\r\n<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt;\">C. You need a high-tech security system      installed in your office building</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. You need a word processing package      to support simple typing of documents<o:p></o:p></span></p>', 'B', 1, '2020-07-04'),
(176, 21, 'Safety inventory is extra stock used to protect against sudden, unexpected spikes in demand or delays with suppliers.', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. True<o:p></o:p></span></p>\r\n<p><span style=\"color: windowtext;\">B. False</span>&nbsp;</p>', 'A', 1, '2021-06-27'),
(177, 21, 'Supply Chain Management is the management of the ____________.', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. storage Raw Materials<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. flow of goods and services<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. fulfilment of order<o:p></o:p></span></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. <i>s</i>atisfaction of customer</span>&nbsp;</p>', 'B', 1, '2021-06-27'),
(50, 2, 'You are hosting a conference and you need a printing company to print flyers for advertising.  What is the best description for the print job?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Small color flyers, double-sided,      good-quality paper<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. A6 (4.13 x 5.83 inches) color      flyers, double-sided gloss paper with a base weight of 45 lbs<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. A6 size flyers, printed on both      sides, high-quality gloss paper<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. A6 flyers in color, good-quality      gloss paper<o:p></o:p></span></p>', 'B', 1, '2020-07-04'),
(293, 26, 'An important feature of supply chain management is its application of electronic commerce technology that allows companies to share and operate systems for:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. order processing, transportation scheduling, and inventory management<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. cost-effective flowing of raw materials<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. future purchasing of computer systems future <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. merger opportunities<o:p></o:p></span></p>', 'A', 1, '2021-08-03'),
(51, 2, 'To advertise for the upcoming conference of your company, you need to have the flyers ready for distribution in 20 working days from today. The standard printing process takes 10 working days. You are waiting for details to be finalized so you want to delay printing for as long as possible, while still keeping costs down.  When is the latest you should place the order with the printer?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. 13 working days from today<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. 10 working days from today<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. 17 working days from today<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. 2 working days from today<o:p></o:p></span></p>', 'B', 1, '2020-07-04'),
(52, 2, 'You want to print flyers to promote the upcoming conference of your company. Four thousand flyers should be enough, but a slightly greater quantity could help you promote the event more widely. You hear that print companies offer discounts of up to 15% for orders exceeding 5,000 flyers.  To get the best value out of the deal, how many flyers should you order?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. 4,000<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. 3,500<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. 5,000<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. 8,000<o:p></o:p></span></p>', 'C', 1, '2020-07-04'),
(294, 26, 'A recent consumer survey conducted for a car dealership indicates that, when buying a car, customers are primarily concerned with the salesperson^s ability to explain the car^s features, the salesperson^s friendliness, and the dealer^s honesty. The dealership should be especially concerned with which dimensions of service quality?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. communication, courtesy, and credibility<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. competence, courtesy, and security <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. competence, responsiveness, and reliability<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. communication, responsiveness, and reliability<o:p></o:p></span></p>', 'D', 1, '2021-08-03'),
(53, 2, 'You are drafting a list of print companies that could print flyers for the upcoming conference of your company.  Which criteria must the printer of your choice meet?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Prints posters for lower than      market cost<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Guarantees delivery of the flyers      by the scheduled date<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Can print an additional batch of      flyers within three days of ordering<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Can enhance flyers with custom      artwork<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. Prints high-quality flyers with      less than a 2% error rate<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">F. Prints flyers at market rate or      lower<o:p></o:p></span></p>', 'E', 1, '2020-07-04'),
(295, 26, 'Which one of the following best represents a “pure service”?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Bank loans<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Computer diagnosis and repair <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C, Attending a theatre play <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Fast food restaurant<o:p></o:p></span></p>', 'C', 1, '2021-08-03'),
(296, 26, 'Which one of the following best represents a “pure good”?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Salt<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Fast food<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Attending a play <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Vehicle repair<o:p></o:p></span></p>', 'A', 1, '2021-08-03'),
(54, 2, 'As a manager or leader who makes purchases for your department, you must ensure your departmental-level purchases comply with the overall corporate purchasing strategy of your organization.  What are the key elements to consider when developing your purchasing strategy?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. The quantity of a product or extent      of a service to purchase<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. The required delivery date of the      product or service<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Contact details of suppliers who      previously supplied the product or service<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Supplier selection criteria<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. Description of the required product      or service<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">F. Detailed analysis of possible      suppliers<o:p></o:p></span></p>', 'D', 1, '2020-07-04'),
(297, 26, '____________ is an example of a pure “good”?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Restaurant<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Dentist<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Coal Mining<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Education<o:p></o:p></span></p>', 'C', 1, '2021-08-03'),
(55, 2, 'In the Kraljic matrix, one axis can measure the impact a product you are purchasing may have on your ability to finalize a product.  Select the axis that can measure the importance of a product. The Kraljic matrix is a square split into four sections. The horizontal axis measures supply risk. The vertical axis measures business impact.', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Business impact <o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Supply risk&nbsp;<o:p></o:p></span></p>', 'A', 1, '2020-07-04'),
(298, 26, 'Which of the following is not a typical supply chain member?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Retailer&rsquo;s Creditor <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Wholesaler <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Producer <o:p></o:p></span></p>\r\n<p><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&#10;Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. Customer</span></p>', 'D', 1, '2021-08-03'),
(56, 2, 'Under which conditions do you think supply risk is high?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. There are only a few suppliers in      the market<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. You need a supplier that has      high-level technical expertise<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. The product you want to purchase is      of high value to your company<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. The market is very competitive<o:p></o:p></span></p>', 'B', 1, '2020-07-04');
INSERT INTO `rim_quizquestion` (`Id`, `Quizid`, `Question`, `Answer`, `Correctans`, `Mark`, `Dateofpost`) VALUES
(299, 26, 'When suppliers, distributors, and customers partner with each other to improve the performance of the entire system, they are participating in a', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Channel Of Distribution <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Value Delivery Network <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Supply Chain<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Supply And Demand Chain<o:p></o:p></span></p>', 'A', 1, '2021-08-03'),
(57, 2, 'Supply chain management is followed by:-', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. DELL </span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Dabbawalas of Mumbai</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Both of these</span></p>', 'C', 1, '2020-07-04'),
(165, 21, 'In supply chain management, Inspection, scrap and repair are examples of ________.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Societal Costs</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. External Costs<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Costs of dissatisfaction<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Internal Costs<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(166, 21, '____________ is a Japanese term meaning continuous improvement.', '<p><span style=\"color: windowtext;\">A. JIT</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Kaizen<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. TQM<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Taguchi Map<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(167, 21, 'EOQ stands for ____', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. Electronic Obtained quantity&nbsp; <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Electronic Ordered Quantity <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Equivalent Order Quality <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Economic Order Quantity<o:p></o:p></span></p>', 'D', 1, '2021-06-27'),
(168, 21, 'Organizations or companies manage their supply chains through _______.', '<p>&nbsp;<span style=\"color: windowtext;\">A. Transportation modes</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. The internet<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Information<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Skilled Operators<o:p></o:p></span></p>', 'C', 1, '2021-06-27'),
(169, 21, 'The concept and philosophy of supply chain management evolved or emerged in _______', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. the 1960s<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. the 1970s<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. the 1980s<o:p></o:p></span></p>\r\n<p><span style=\"color: windowtext;\">D. the 1990s</span>&nbsp;</p>', 'C', 1, '2021-06-27'),
(170, 21, 'Full form of MRP in operations and SCM is ___________', '<p>&nbsp;<span style=\"color: windowtext;\">A. Material Return Process</span><span style=\"color: windowtext;\">&nbsp;</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Material Requirement Planning&nbsp; <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Machinery Repairing Planning&nbsp; <o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Material Retention Planning<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(171, 21, 'The concept of Supply Chain Management originated in ________________ discipline.', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. Production Management<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Logistics Management<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Marketing<o:p></o:p></span></p>\r\n<p><span style=\"color: windowtext;\">D. Operations Management</span>&nbsp;</p>', 'B', 1, '2021-06-27'),
(172, 21, 'An example of “Cycle Inventory” is extra beach wear produced for the summer market', '<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">A. True<o:p></o:p></span></p>\r\n<p><span style=\"color: windowtext;\">B. False</span>&nbsp;</p>', 'B', 1, '2021-06-27'),
(58, 2, 'Instead of making several small purchases to acquire the components of a telephone, you want to make one purchase for all the components.  What sourcing structure would you use?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Single<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Multiple<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Delegated<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Parallel<o:p></o:p></span></p>', 'C', 1, '2020-07-04'),
(300, 26, 'A company^s channel decisions directly affect every _______________', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. customer^s choices <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. employee in the channel <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. channel member <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. marketing decision<o:p></o:p></span></p>', 'A', 1, '2021-08-04'),
(59, 2, 'An organizations Finance Department needs to outsource the replacement of its carpets as a result of recent water damage. The policy of the organization is that goods and services over $8,000 need to be sourced by requesting bids or proposals from interested suppliers.  Access the learning aid Carpets Purchase Requisition Form to review the purchase requisition form for this job, and then answer the question.  Which purchasing method should the department use?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Small purchase procedure<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Sealed bid or quote<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Competitive proposal<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Noncompetitive proposal<o:p></o:p></span></p>', 'C', 1, '2020-07-04'),
(301, 26, 'From  the  economic  system^s  point  of  view,  the  role  of  marketing  intermediaries  is  to transform the assortment of products made by producers into the assortment of products wanted by _________channel members.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. manufacturers <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. marketers <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. distributors <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. consumers<o:p></o:p></span></p>', 'C', 1, '2021-08-04'),
(60, 2, 'As part of a proactive approach, what do you think purchasers can do to research suppliers?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Be informed about the latest trends      in the industries suppliers work in</span></p>\r\n<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt;\">B. Use the telephone directory as the      only source of contact information</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Be able to answer questions about      the products they want to buy</span></p>\r\n<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt;\">D. Consider potential suppliers based      on hearsay</span></p>', 'C', 1, '2020-07-04'),
(302, 26, 'Intermediaries play an important role in matching ____________	.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. dealer with customer <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. manufacturer to product <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. information and promotion <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. supply and demand<o:p></o:p></span></p>', 'B', 1, '2021-08-04'),
(61, 2, 'What are the benefits of using a proactive sourcing approach?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. You will be better able to secure the      best deals from suppliers<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. You will secure full control of your      organization^s supply chain<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. You are more likely to succeed in      securing exactly what your organization requires<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. You will be able to source suppliers      globally when doing this can benefit your organization<o:p></o:p></span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. You will eliminate all risks involved      in the supply process</span><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:&#10;#494B43\"><o:p></o:p></span></span></p>', 'D', 1, '2020-07-04'),
(303, 26, 'Marketing logistics involves getting the right product to the right customer in the right place at the right time. Which one of the following is not included in this process?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. implementing the plan for the flow of goods and services <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. planning the physical flow of goods and services<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. controlling the physical flow of goods, services, and information<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. gathering customer^s ideas for new products<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(62, 2, 'What types of information should you obtain about a potential supplier?', '<p>&nbsp;<span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">A.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">The size and location of the supplier</span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">B.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">The length of the supply chain of inventory</span></p>\r\n<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">C.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">Its compliance with legal regulations</span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">D.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Whether it is a distributor or a manufacturer</span></p>\r\n<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">E.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">Shipping costs</span></p>\r\n<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">F.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">Infrastructure and processes</span></p>\r\n<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">G.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">Environmentally friendly practices</span></p>', 'D', 1, '2020-07-04'),
(304, 26, 'Raw materials and specialized services procured are converted into useful service offerings and finally distributed to customers in the following Industry _____________', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Hotel <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Cement <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Sugar <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Refinery<o:p></o:p></span></p>', 'A', 1, '2021-08-04'),
(305, 26, 'Which of the following is not an area of responsibility for a logistics manager?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. inventory <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. purchasing <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. warehousing <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. marketing<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(63, 2, 'What are useful sources for locating information about potential suppliers?', '<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">A. Buyers guides</span></p>\r\n<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt; color: rgb(73, 75, 67);\">B. Hearsay</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Trade association magazines</span></p>\r\n<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt; color: rgb(73, 75, 67);\">D. Suppliers own web sites</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. The Internet</span></p>\r\n<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt; color: rgb(73, 75, 67);\">F. Published studies</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:&#10;     130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">G. Other companies choice of      suppliers<o:p></o:p></span></p>', 'E', 1, '2020-07-04'),
(306, 26, 'To reduce inventory management costs, many companies use a system called _______                  which involves carrying only small inventories of parts or merchandise, often only enough for a few days of operation.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. reduction-inventory management <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. supply chain management <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. economic order quantity<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. just-in-time logistics<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">E. limited inventory logistics<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(307, 26, 'A Supply Chain includes the chain of entities involved in the planning, procurement, production, and ___________ of products and services', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. distribution <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. supply <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. demand <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. transport<o:p></o:p></span></p>', 'A', 1, '2021-08-04'),
(64, 2, 'The sequence of a typical manufacturing supply chain is:', '<p><!--[if !supportLists]--><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:Arial;color:#494B43\">A.&nbsp;</span><span style=\"box-sizing: border-box; border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: verdana, geneva; font-size: 10pt; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Storage&ndash;Supplier&ndash;manufacturing&ndash;storage&ndash;distributor&ndash;retailer&ndash;customer</span></p>\r\n<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif; font-size: 16px;\">B.&nbsp;</span><span style=\"font-family: verdana, geneva; font-size: 10pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;\">Supplier&ndash;Storage-manufacturing&ndash;storage&ndash;distributor&ndash;retailer&ndash;customer</span></p>\r\n<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif; font-size: 16px;\">C.&nbsp;</span><span style=\"font-family: verdana, geneva; font-size: 10pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;\">Supplier&ndash;Storage-manufacturing&ndash; distributor&ndash;storage&ndash;retailer&ndash;customer</span></p>\r\n<p><span style=\"color: rgb(73, 75, 67); font-family: Arial, sans-serif; font-size: 16px;\">D.&nbsp;</span><span style=\"font-family: verdana, geneva; font-size: 10pt; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;\">Supplier&ndash;Storage-manufacturing&ndash;storage&ndash; retailer&ndash;distributor&ndash;customer</span></p>', 'B', 1, '2020-07-04'),
(274, 22, 'A key aspect of our multi-vari analysis is to set up sampling plans. The sampling plans are how we are going to go about as a Six Sigma team collecting our data. And they are very useful in helping us as a Six Sigma team identify the causes of variation. Sampling plans are important when we go through and do our multi-vari analysis because we are testing to see where variation comes from. One of the following is not a guideline for creating sampling plan. Identify?', '<p><span style=\"font-family: Arial, sans-serif;\">A. Make sure that we^re using a sampling method that is normal for the process.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. Sample processes on a structured basis. <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. Obtain new data rather than use historical data.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">D. Select at least two positions per part.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">E. None of the above.<o:p></o:p></span></p>', 'E', 1, '2021-07-28'),
(275, 22, 'Use random sampling only if it is the normal mode during production. Is this statement “True” or “False”?', '<p><span style=\"font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-07-28'),
(276, 22, 'Within Six Sigma, it is important to study and understand your data to determine the type of variation that is present. There are three key types of variation. What are they?', '<p><span style=\"font-family: Arial, sans-serif;\">A. positional variation, cyclical variation, and temporal variation</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. positional variation, specific investigation, and generic variation<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">C. positional variation, cyclical variation, and asymmetrical variation<o:p></o:p></span></p>', 'A', 1, '2021-07-28'),
(277, 22, 'When we look at our correlation analysis, one way to determine our correlation is through the Pearsons coefficient. And in this case, we are solving for a value of r, which is our correlation coefficient. Is this statement “True” or “False”?', '<p><span style=\"font-family: Arial, sans-serif;\">A. True</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'A', 1, '2021-07-28'),
(278, 22, 'It is important, when we talk about Six Sigma and correlation analysis, to understand the difference between correlation and causation because these are really commonly confused with each other. When we talk about causation, what we are not trying to understand is, which Xs, which of our input variables, cause the Ys, our output variables, to happen. Is this statement “True” or “False”?', '<p><span style=\"font-family: Arial, sans-serif;\">A.True</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-07-28'),
(65, 2, 'Alan is an office manager who needs to have an office printer set up on his business premises. He narrows his choice down to three models of printer. He also wants the supplier to install the printer on his office network. He already has a shortlist of suppliers that his business has dealt with in the past.  Which solicitation document will best serve the purchasing needs of Alan?', '<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">A. RFI</span></p>\r\n<p><span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:130%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;&#10;color:#494B43\">B. RFQ</span></p>\r\n<p><span lang=\"EN-IN\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 130%; font-family: Arial, sans-serif; color: rgb(73, 75, 67);\">C. RFP</span></p>', 'C', 1, '2020-07-04'),
(308, 26, 'In a SC, material flows in one direction while________ flows in both directions', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. process <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. information <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. product <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. semi-finished goods<o:p></o:p></span></p>', 'B', 1, '2021-08-04'),
(309, 26, 'Julie Newmar recognizes that her company needs to provide better customer service and trim distribution costs through teamwork, both inside the company and among all the marketing channel organizations. Julie will begin the practice of _____________.      ', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. intermediation<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. customer relationship management <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. supply chain management<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. horizontal marketing system management<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(66, 2, 'A type of logistics costing', '<p><span style=\"font-size: large;\">A. Consumer costing<br />\r\n</span></p>\r\n<p><span style=\"font-size: large;\">B. Employee costing</span></p>\r\n<p><span style=\"font-size: large;\">C. Activity costing</span></p>', 'A', 1, '2020-07-04'),
(175, 21, 'Positive long-term relationships between supply chain participants refer to ______', '<p>&nbsp;<span style=\"color: windowtext;\">A. Supply Chain management</span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">B. Partnerships<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">C. Co operations<o:p></o:p></span></p>\r\n<p class=\"secondlevel-text\" style=\"margin-left:0in;line-height:115%\"><span lang=\"EN-IN\" style=\"color: windowtext;\">D. Co-alliances<o:p></o:p></span></p>', 'B', 1, '2021-06-27'),
(310, 26, 'There are four generic processes involved in any SCM - planning for operations, sourcing decisions, manufacturing related activities, and _______________', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. purchase <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. inventory <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. information <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. distribution<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(68, 3, 'MDNSBFJBDS', '<p>&nbsp;DFSADF</p>', 'A', 1, '2020-07-04'),
(69, 4, '1. Which of these is not one of the constraints of a project?', '<p>a. Scope</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Resources <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Team <o:p></o:p></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;&#10;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;&#10;mso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">d. Budget&nbsp;</span></p>', 'c', 1, '2021-01-27'),
(70, 4, '2. Which of the following is not correct about the initial phase of a project?', '<p>a. The cost associated at the beginning of the project is highest.</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Stakeholders have maximum influence during this phase <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. The highest uncertainty is at this stage of the project.&nbsp;<o:p></o:p></p>', 'a', 1, '2021-01-27'),
(71, 4, '3. The project you are managing has nine stakeholders. How many channels of communication are there between these stakeholders?', '<p>a. 9</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. 8 <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. 45 <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. 36&nbsp;<o:p></o:p></p>', 'd', 1, '2021-01-27'),
(72, 4, '4. Which of the following is not an example of formal communication?', '<p>&nbsp;a. Contract</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. email <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Project status report <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Status meeting&nbsp;<o:p></o:p></p>', 'b', 1, '2021-01-27'),
(73, 4, '5. A Project with total funding of $100,000 finished with a BAC value of $95,000. What term can BEST describe the difference of $5,000?', '<p>a. Cost Variance</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Management Overhead <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Management Contingency Reserve<o:p></o:p></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;&#10;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;&#10;mso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">d. Schedule Variance</span></p>', 'c', 1, '2021-01-27'),
(74, 4, '6. If the Earned Value is equal to Actual Cost, it means:', '<p>a. Project is on budget and on schedule</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Schedule Variance Index is 1 <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. There is no schedule variance <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. There is no cost variance<o:p></o:p></p>', 'd', 1, '2021-01-27'),
(75, 4, '7. Which of the following is the most important element of the Project Management Plan that is useful in the HR Planning process?', '<p>a. Risk Management activities</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Quality Assurance activities <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Activity Resource requirements <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Budget Control activities<o:p></o:p></p>', 'c', 1, '2021-01-27'),
(76, 4, '8. Which of the following types of Organizational Charts can be BEST used to track project costs?', '<p>a. Hierarchical-type Organizational Chart</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Organizational Breakdown Structure <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Resource Breakdown Structure <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Responsibility Assignment Matrix<o:p></o:p></p>', 'c', 1, '2021-01-27'),
(77, 4, '9. Which of the following is not true for a Responsibility Assignment Matrix (RAM)?', '<p>a. Defines what project team is responsible for each WBS component</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Defines what project member is responsible for each activity <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Text description of roles, responsibilities, authorities <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Defines all people associated with each activity<o:p></o:p></p>', 'c', 1, '2021-01-27'),
(78, 4, '10. Process Analysis is a function of:', '<p>a. Performance Analysis</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Quality Metrics <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Process Improvement Plan <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Quality Improvement Plan<o:p></o:p></p>', 'c', 1, '2021-01-27'),
(79, 4, '11. Root Cause Analysis relates to:', '<p>a. Process Analysis</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Quality Audits <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Quality Control Measurements <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Performance Measurements<o:p></o:p></p>', 'a', 1, '2021-01-27'),
(80, 4, '12. A planning phase for an engineering component generated 80 engineering drawings. The QA team randomly selected 8 drawings for inspection. This exercise can BEST be described as an example of:', '<p>a. Inspection</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Statistical Sampling <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Flowcharting <o:p></o:p></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;&#10;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;&#10;mso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">d. Control Charting</span></p>', 'b', 1, '2021-01-27'),
(81, 4, '13. Andrew has joined as the Project Manager of a project. One of the project documents available to Andrew lists down all the risks in a hierarchical fashion. What is this document called?', '<p>a. Risk Management Plan</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. List of risks <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Monte Carlo diagram <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Risk Breakdown Structure<o:p></o:p></p>', 'd', 1, '2021-01-27'),
(82, 4, '14. During which stage of Risk planning are risks prioritized based on probability and impact?', '<p>a. Identify Risks</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Plan Risk responses <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Perform Qualitative risk analysis <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Perform Quantitative risk analysis<o:p></o:p></p>', 'c', 1, '2021-01-27'),
(83, 4, '15. Activity Definition is typically performed by which of the following?', '<p>a. Project Manager who created the WBS</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Project Team Members responsible for the work package <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Project Officer <o:p></o:p></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;&#10;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;&#10;mso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">d. Project Stakeholder</span></p>', 'b', 1, '2021-01-27'),
(84, 4, '16. Which of the following does NOT generate changes to the Project documents?', '<p>a. Define Activities</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Sequence Activities <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Estimate Activity Resources <o:p></o:p></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;&#10;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;&#10;mso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">d. Estimate Activity Durations</span></p>', 'a', 1, '2021-01-27'),
(85, 4, '17. Which of the following refers to drawing network diagrams?', '<p class=\"MsoNormal\">a. Define Activities <o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Activity-on-Arrow <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Estimate Activity Resources <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Estimate Activity Durations<o:p></o:p></p>', 'b', 1, '2021-01-27'),
(86, 4, '18. A scheduled activity may begin 10 days before the predecessor activity finishes. This is an example of:', '<p class=\"MsoNormal\">a. Finish-to-Start <o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Start-to-Finish <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Start-to-Start <o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. Finish-to-Finish<o:p></o:p></p>', 'a', 1, '2021-01-27'),
(87, 4, '19. Sam Consultancy is planning to buy ten desktops for $1500 each from a leading computer store. Which type of contract will get signed in this case?', '<p class=\"MsoNormal\">a. Purchase Order <o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Cost plus Fee <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Fixed cost</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif;\">d. Time and Material</span>&nbsp;</p>', 'a', 1, '2021-01-27'),
(312, 26, 'Most operations produce a mixture of both products and services. Which of the following businesses are closest to producing “pure” services?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Counsellor/Therapist<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Restaurant<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. IT company <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Steel company<o:p></o:p></span></p>', 'A', 1, '2021-08-04'),
(88, 4, '20. Alice is a Project Manager. She is coordinating a bidder conference to allow vendors to get clarification on the work that needs to be performed. Which phase of Project Management is in progress?', '<p class=\"MsoNormal\">a. Conduct Procurements <o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Plan Procurements <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Control Procurements <o:p></o:p></p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p>d. Close Procurements&nbsp;</p>', 'a', 1, '2021-01-27'),
(89, 4, '21. The process of Control Procurements falls under which process group?', '<p class=\"MsoNormal\">a. Planning <o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Closing <o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Monitoring and Control <o:p></o:p></p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p>d. Executing&nbsp;</p>', 'c', 1, '2021-01-27'),
(90, 4, '22. Which of the following refers to a narrative description of the work to be accomplished?', '<p class=\"MsoNormal\" style=\"margin-bottom: 3.7pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">a. The statement of work (SOW)<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.7pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">b. The project specifications<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.7pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">c. The milestone schedule<o:p></o:p></p>\r\n<p><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">d. The work breakdown structure (WBS)</span>&nbsp;</p>', 'a', 1, '2021-01-27'),
(91, 4, '23. Which of the following statements is TRUE for Work breakdown Structure (WBS)?', '<p>a. Project Manager must structure work into small elements that are manageable</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.7pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.7pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">b. Project Manager must structure work into small elements that are independent<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.7pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">c. Project Manager must structure work into small elements that are measurable<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.7pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">d. All of the given options<o:p></o:p></p>', 'd', 1, '2021-01-27'),
(92, 4, '24.  Scope of a project is the …………… total of all of a project’s products and their requirements or features – Fill-up the blank:', '<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">a. Sum</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">b. Product</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">c. Sum and product</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">d. None of the above<o:p></o:p></p>\r\n<p>&nbsp;</p>', 'a', 1, '2021-01-27'),
(93, 4, '25. Which of the following life cycle phases includes brainstorming and common sense at the planning stage?', '<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">a. <span style=\"color: windowtext; text-decoration-line: none;\">Conceptualization</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">b. Feasibility<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">c. Preliminary planning<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">d. Detail planning<o:p></o:p></p>', 'a', 1, '2021-01-27'),
(94, 4, '26. Quality assurance is:', '<p class=\"MsoNormal\" style=\"margin-top:12.0pt\">a. Detection based<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt\">b. Inspection based</p>\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt\">c. <span style=\"color: windowtext; text-decoration-line: none;\">Prevention based</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt\"><o:p></o:p></p>\r\n<p>d. People based&nbsp;</p>', 'c', 1, '2021-01-27');
INSERT INTO `rim_quizquestion` (`Id`, `Quizid`, `Question`, `Answer`, `Correctans`, `Mark`, `Dateofpost`) VALUES
(95, 4, '27. The three general preconditions for achieving lasting success as a project manager are:', '<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:&#10;0cm;margin-left:0cm;margin-bottom:.0001pt\">a. Technical Skills, Ability, Human Skills, and Design Skill<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">b. <span style=\"color: windowtext; text-decoration-line: none;\">Ability, Motivation to manage, and Opportunity</span><o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">c. Motivation to manage, Opportunity, and Conceptual Skill<o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><o:p></o:p></p>\r\n<p>d. Ability, Capacity and Supervision&nbsp;</p>', 'b', 1, '2021-01-27'),
(96, 4, '28. Which of the following statements gives the technical definition of Project Planning?', '<p>a. Working out of sub-components in some degree of detail</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\">b. To cover the area of government legislation &amp; regulation related to &ldquo;use of resources&rdquo;<o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Planned use of any /all resources&rdquo;- Succession of five year plans<o:p></o:p></p>\r\n<p class=\"MsoNormal\">d. A structured sequence of events leading to the desired set of objectives<o:p></o:p></p>', 'b', 1, '2021-01-27'),
(97, 4, '29. Which of the following require input from a large number of functional units and usually control vast resources?', '<p class=\"MsoNormal\">a. Individual projects<o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Staff projects<o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Special projects<o:p></o:p></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;&#10;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;&#10;mso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">d. Matrix or aggregate projects</span>&nbsp;</p>', 'd', 1, '2021-01-27'),
(98, 4, '30. Which of the following is the responsibility of the proposed project manager?', '<p class=\"MsoNormal\">a. Project Plan &amp; strategy<o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Description of Project Organization<o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Development of organizational Chart</p>\r\n<p class=\"MsoNormal\"><o:p></o:p></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;&#10;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;&#10;mso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">d. All of the given options</span>&nbsp;</p>', 'd', 1, '2021-01-27'),
(99, 4, '31. Which of the following is the discount rate that equates to the present values of the two sets of flows?', '<p class=\"MsoNormal\">a. Discounted Cash Flow<o:p></o:p></p>\r\n<p class=\"MsoNormal\">b. Pay Back Period<o:p></o:p></p>\r\n<p class=\"MsoNormal\">c. Discounted Cash Flow&nbsp;</p>\r\n<p>d, Internal rate of return&nbsp;</p>', 'd', 1, '2021-01-27'),
(100, 4, '32. Which of the following items involves the quantitative aspects of planning?', '<p><span style=\"font-size:11.0pt;line-height:115%;&#10;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:&#10;Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;&#10;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;&#10;mso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">a. Budget development</span></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-IN;mso-fareast-language:&#10;EN-IN;mso-bidi-language:AR-SA\">b. Project administration</span></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-IN;mso-fareast-language:&#10;EN-IN;mso-bidi-language:AR-SA\">c. Leadership styles</span></p>\r\n<p><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">d. Conflict management</span>&nbsp;</p>', 'a', 1, '2021-01-27'),
(101, 4, '33. The main purpose of a _______________ is to function as a blueprint for the group’s business operations – Fill-up the blank:', '<p style=\"margin: 0cm 0cm 3.7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\">a. Business plan</span></p>\r\n<p style=\"margin: 0cm 0cm 3.7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\">b. Scope statement</span></p>\r\n<p style=\"margin: 0cm 0cm 3.7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\"> c. Feasibility study</span><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-IN;mso-fareast-language:&#10;EN-IN;mso-bidi-language:AR-SA\"> </span></p>\r\n<p style=\"margin: 0cm 0cm 3.7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-IN;mso-fareast-language:&#10;EN-IN;mso-bidi-language:AR-SA\">d. Work breakdown structure</span>&nbsp;</p>', 'a', 1, '2021-01-27'),
(102, 4, '34. ___________ is the lowest level of quality development.', '<p><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">a. Quality Assurance</span></p>\r\n<p><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:&#10;minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;&#10;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\">b. Quality Management</span></p>\r\n<p><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">c. Inspection</span></p>\r\n<p><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\">d. Total Quality Management</span></p>', 'd', 1, '2021-01-27'),
(311, 26, 'Today, a growing number of firms now outsource some or all of their logistics to intermediaries such as___________.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. competitors<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. third-party logistics providers <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. channel members<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. cross-functional teams<o:p></o:p></span></p>', 'B', 1, '2021-08-04'),
(103, 4, '35. Fredrick Taylor- Father of Scientific Management was a _______________', '<p style=\"margin: 0cm 0cm 3.7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\">a. </span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: windowtext; text-decoration-line: none;\">Mechanical Engineer</span><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\"> </span></p>\r\n<p style=\"margin: 0cm 0cm 3.7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\">b. Chemical Engineer</span></p>\r\n<p style=\"margin: 0cm 0cm 3.7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\"> c. Technical Engineer</span>&nbsp;</p>\r\n<p style=\"margin: 0cm 0cm 3.7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi\"> d. Electrical Engineer<o:p></o:p></span></p>', 'a', 1, '2021-01-27'),
