(130, 2, 'A furniture manufacturer is opening a factory in a new area. The factory needs to find suppliers of the raw materials for the furniture that it creates.  Identify the incorrect action amongst the following:', '<p class=\"MsoNormal\">A. A team consisting of a designer, a carpenter, a quality manager, and a purchaser decide what is required of the raw material and the supplier.</p>\r\n<p class=\"MsoNormal\">B. An administrator sources a list of logging companies using referrals and the Internet.</p>\r\n<p class=\"MsoNormal\">C. The quality manager reviews potential suppliers^ processes against required regulations and criteria.</p>\r\n<p class=\"MsoNormal\">D. A supplier that meets the minimum criteria is approved and a contract is drawn up and signed.</p>\r\n<p class=\"MsoNormal\">E. An alternate supplier is identified for occasions when the main supplier is unable to meet the demand.</p>\r\n<p class=\"MsoNormal\">F. A team draws up a plan to certify the supplier that promises to deliver wood at the lowest cost.</p>', 'F', 1, '2021-02-01'),
