(315, 26, 'If two potential suppliers can deliver a part with the same quality and prices, the selection should be based on:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Age of the firms <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. A coin flip <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Outside evaluation<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. The capabilities and flexibilities of the firms<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(316, 26, 'Just-in-time/SCM purchasing requires the following condition:', '<p><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\">A. Many suppliers</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Short-term contracts<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Cooperation between purchasing and suppliers<o:p></o:p></span></p>\r\n<p><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&#10;Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. Continuous competitive bidding</span></p>', 'C', 1, '2021-08-04'),
(317, 26, 'The amount of inventory kept at each stock point in a warehouse network is usually based on:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Minimizing transportation costs <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Constant demand<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Tradeoffs between warehousing, inventory, and transportation costs<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Product pricing strategy<o:p></o:p></span></p>', 'C', 1, '2021-08-04'),
(318, 26, 'A company^s channel decisions directly affect every_________________', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. customer^s choices<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. employee in the channel<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. channel member<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. competitor^s actions<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(319, 26, 'When suppliers, distributors, and customers collaborate to improve the performance of the entire system, they are participating in a _______________', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. channel of distribution<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. value delivery network<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. supply chain<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. supply and demand chain<o:p></o:p></span></p>', 'B', 1, '2021-08-04'),
(320, 26, 'A supply chain is a sequence of firms that perform activities required:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. to find similar products<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. to facilitate wholesalers&rsquo; inventory selections<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. to create synergy in their training programs<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. to create and deliver goods to consumers<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(321, 26, 'A supply chain is essentially a sequence that links:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. customer and prospects<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. supplier and manufacturer<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. suppliers and customers<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. warehousing and wholesaling units<o:p></o:p></span></p>', 'C', 1, '2021-08-04'),
(322, 26, 'Marketing logistics involves getting the right product to the right customer in the right place at the right time. Which one of the following is not included in this process?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. implementing the plan for the flow of goods and services<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. planning the physical flow of goods and services<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. controlling the physical flow of goods, services, and information<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. gathering customer^s ideas for new products<o:p></o:p></span></p>', 'D', 0, '2021-08-04'),
(323, 26, 'To reduce inventory management costs, many companies use a system called _____________, which involves carrying only small inventories of parts or merchandise, often only enough for a few days of operation.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. reduction-inventory management<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. supply chain management<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. economic order quantity<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. just-in-time logistics<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(324, 26, 'Companies manage their supply chains through___________.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. information<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. transportation modes<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. competitors<o:p></o:p></span></p>\r\n<p><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&#10;Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. the Internet</span></p>', 'A', 1, '2021-08-04'),
(325, 26, 'A restaurant is an example of a ______________', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. major service with accompanying goods and services<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. hybrid<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. pure service<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. pure tangible good<o:p></o:p></span></p>', 'B', 1, '2021-08-04'),
(326, 26, 'A __________  encompasses all activities associated with the flow and transformation of goods from the raw material stage, through to the end-user, as well as the associated information flows.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. production line<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. supply chain<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. marketing channel<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. warehouse<o:p></o:p></span></p>', 'B', 1, '2021-08-04'),
(327, 26, 'Which of the following are not key attributes of supply chain management?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. inventory control<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. leveraging technology<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. customer power<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. all are key attributes<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(328, 26, 'Positive, long-term relationships between supply chain participants refer to:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. competition<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. tailored logistics<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. partnerships<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. supply chain management<o:p></o:p></span></p>', 'C', 1, '2021-08-04'),
(329, 26, 'The bullwhip effect:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. is an ineffective way to motivate warehouse employees<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. applies to rodeos and has nothing to do with supply chain management<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. refers to the &ldquo;swaying&rdquo; motion associated with triple trailers<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. refers to variability in demand orders among supply chain participants<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(330, 26, 'Cooperative  supply  chain  relationships  developed  to  enhance  the  overall  business performance of both parties is a definition of:', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. third-party logistics<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. supply chain collaboration<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. dovetailing<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. relationship marketing<o:p></o:p></span></p>', 'B', 1, '2021-08-04'),
(331, 26, 'What is a perfect order?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. simultaneous achievement of relevant customer metrics<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. an order that arrives on time<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. an order that arrives undamaged<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. an order that is easy for the receiver to fill<o:p></o:p></span></p>', 'A', 1, '2021-08-04'),
(332, 26, 'Which of the following is NOT a reason that companies are depending more on their suppliers?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. More focus on core competencies<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Need for more flexibilities<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Desire to share risks<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. More control over their suppliers<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(333, 26, 'Which of the following is NOT a benefit of SCM Purchasing?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Consistent quality<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. Savings on resources<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Lower costs<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Less dependence on suppliers<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(334, 26, 'What technique deals with the problem of supplying sufficient facilities to production lines or individuals that require uneven service?', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Supply-demand theory<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. PERT<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Inventory theory<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Queuing theory<o:p></o:p></span></p>', 'D', 1, '2021-08-04'),
(335, 26, 'What are the 5 key components of the supply chain?', '', '', 0, '2021-08-04'),
(336, 26, 'What is the key benefit of multi-vari charting?', '<p>A. It keeps track of the time when measurements were made</p>\r\n<p>B. It graphically displays the variation in a process</p>\r\n<p class=\"MsoNormal\">C. It assists in the breakdown of components of variation&nbsp;</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. It is much easier to plot than most control charts</span></p>', 'C', 1, '2021-08-04'),
(337, 26, 'In the following passage what factors that the author is explaining? In the early 1900s, the Ford Motor Company owned mines that provided ore and the mills that turned the ore into steel. It also owned the factories that turned the steel into car parts and the assembly lines that produced the cars.  This made the company self-reliant. It could manufacture basic products in a \"one size fits all\" model. This productive approach to business, paired with the predictability of the market, led to Ford enjoying high profits during this time.  However, by the 1940s, customers were demanding more variety. Mass production failed to achieve customer satisfaction because it couldn^t meet the increasing demand for variety.', '', '', 0, '2021-08-04'),
(338, 26, 'What is the author highlighting in the following passage: Consider a financial transaction for a loan. First,  an application must be completed. Then the completed application must be turned in.  Once those steps are complete, the loan company checks the prospective candidate^s personal information against its loan criteria. It then accepts or rejects the loan request.', '', '', 0, '2021-08-04'),
(339, 26, 'Why would service organizations adopt supply chain management strategies?', '', '', 0, '2021-08-04'),
(340, 26, 'Identify whether the following statement is true or false: Reliance on people is not important to the back office workers involved in producing services. Of equal importance are customer service professionals. Also, services are often created and delivered at a single point by the same employee. Day-to-day interactions of employees facing customers play a crucial role when it comes to a company^s reputation and customer satisfaction.', '<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. True<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. False<o:p></o:p></span></p>', 'B', 1, '2021-08-04'),
(341, 26, 'Explain the term “Differentiation Focus”?', '', '', 0, '2021-08-04'),
(344, 26, 'When determining the appropriate strategy for supply chain management, it^s important to keep in mind that there is \"one size fits all\" approach that will be suitable for all situations. Is this statement “true” or “false”?', '<p class=\"bodytext\" style=\"line-height:115%\">A. True<o:p></o:p></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\">B. False<o:p></o:p></p>', 'B', 1, '2021-08-04'),
(345, 26, 'Before measuring performance, you have to decide what needs to be measured. You must also clarify how performance measurement will help you reach your productivity goals.  Is this statement “true” or “false”?', '<p class=\"bodytext\" style=\"line-height:115%\">A. True<o:p></o:p></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\">B. False<o:p></o:p></p>', 'A', 1, '2021-08-04'),
(343, 26, 'Identify the true statement about the logistics of a supply chain strategy.', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:-3.0pt\"><span style=\"font-size:12.0pt;&#10;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. Companies should choose one strategy and stick to it<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:-3.0pt\"><span style=\"font-size:12.0pt;&#10;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. A Lean strategy is preferable to an agile one<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:-3.0pt\"><span style=\"font-size:12.0pt;&#10;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. Companies must understand the needs of their customers<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:-3.0pt\"><span style=\"font-size:12.0pt;&#10;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">D. Supply chain strategy is not influenced by product lead time<o:p></o:p></span></p>', 'C', 1, '2021-08-04');
INSERT INTO `rim_quizquestion` (`Id`, `Quizid`, `Question`, `Answer`, `Correctans`, `Mark`, `Dateofpost`) VALUES
(346, 26, 'Why should companies measure the performance of their supply chains?', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:-3.0pt;line-height:115%;mso-pagination:&#10;widow-orphan\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A. To identify areas of possible improvement<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:-3.0pt;line-height:115%;mso-pagination:&#10;widow-orphan\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">B. To improve productivity<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:-3.0pt;line-height:115%;mso-pagination:&#10;widow-orphan\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">C. To identify which employees aren^t performing<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-right:30.0pt;&#10;mso-margin-bottom-alt:auto;margin-left:-3.0pt;line-height:115%;mso-pagination:&#10;widow-orphan\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&#10;Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. To find a new supply chain strategy</span></p>', 'A', 1, '2021-08-04'),
(347, 26, 'Expand the acronym SCOR model?', '<p class=\"bodytext\" style=\"line-height:115%\">A. supply chain operations reference<o:p></o:p></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\">B. supply chain objective reference<o:p></o:p></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\">C. supply chain on-going reference<o:p></o:p></p>', 'A', 1, '2021-08-04'),
(348, 26, '____________ refers to full orders that are delivered to customers by the deadlines. Companies will be able to save on costs if they strive for perfect accuracy with every order and mistakes lead to returned goods and customer dissatisfaction.', '<p class=\"bodytext\" style=\"line-height:115%\">A. Scheduled delivery<o:p></o:p></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\">B. Quality delivery<o:p></o:p></p>\r\n<p class=\"bodytext\" style=\"line-height:115%\">C. On-time delivery&nbsp;<o:p></o:p></p>', 'C', 1, '2021-08-04'),
(353, 22, 'The p value for Moods Median test is .02 and the level of significance is set at .05, what decision is made?', '<p>A. reject null hypothesis</p>\r\n<p class=\"MsoNormal\">B. fail to reject null hypothesis</p>\r\n<p class=\"MsoNormal\">C. cannot determine</p>\r\n<p class=\"MsoNormal\">D. use a different test</p>', 'A', 1, '2021-08-31'),
(354, 22, 'What type of waste would the following scenario potentially cause? A clothing manufacturing is producing more items than what the customer has ordered.', '<p>A. Waiting&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Over Production&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Transportation&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Over Processing&nbsp;&nbsp;</p>', 'B', 1, '2021-08-31'),
(355, 22, 'Which of the following variations are identified in control charts?', '<p>A. Random and chance&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Special and assignable &nbsp;</p>\r\n<p class=\"MsoNormal\">C. Normal and Special&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Normal and random</p>', 'C', 1, '2021-08-31'),
(356, 22, 'Which of the following tools helps in visualizing series of causes to an effect?', '<p>A. Cause and Effect Matrix&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Correlation Diagram&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Ishikawa Diagram&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Value Stream Mapping</p>', 'C', 1, '2021-08-31'),
(357, 22, 'Which of the following statistical tests should be used by the Green Belt for testing the means between two inter-related groups?', '<p>A. 2 Sample t assuming equal variances&nbsp;</p>\r\n<p class=\"MsoNormal\">B. 2 Sample t assuming unequal variances&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Paired t test&nbsp;</p>\r\n<p class=\"MsoNormal\">D. z test&nbsp;</p>', 'C', 1, '2021-08-31'),
(358, 22, 'Standard Deviation in Six Sigma applications is referred to as difference from the:', '<p>A. Target&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Specification limits&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Nearest fit value&nbsp;</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. Mean&nbsp; <br />\r\n<!--[if !supportLineBreakNewLine]--><br />\r\n<!--[endif]--></span></p>', 'D', 1, '2021-08-31'),
(359, 22, 'In a typical DFSS Approach, which of these stages figures in most DFSS approaches?', '<p>A. Innovate&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Identify&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Improve&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Control</p>', 'B', 1, '2021-08-31'),
(360, 22, 'Which of the following pairs is the most useful in preparing control charts, when used together, for variables data?', '<p>A. AQL, p-bar&nbsp;</p>\r\n<p class=\"MsoNormal\">B. p, n&nbsp;</p>\r\n<p class=\"MsoNormal\">C. X-bar and R&nbsp;</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. R, sigma</span></p>', 'C', 1, '2021-08-31'),
(361, 22, 'Which of the following activities is NOT non value-added?', '<p>A. Setup&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Rework&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Process&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Inspection&nbsp;&nbsp;</p>', 'C', 1, '2021-08-31'),
(362, 22, 'Repetition helps the Six Sigma team in determining:', '<p>A. Short term variability&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Long term variability&nbsp;</p>\r\n<p class=\"MsoNormal\">C. All of the above&nbsp;</p>\r\n<p class=\"MsoNormal\">D. None of the above&nbsp; &nbsp;</p>', 'A', 1, '2021-08-31'),
(363, 22, 'Identify the most accurate method for quantifying gauge repeatability and reproducibility.', '<p>A. The bias and linearity method&nbsp;</p>\r\n<p class=\"MsoNormal\">B. The range method&nbsp;</p>\r\n<p class=\"MsoNormal\">C. The average and range method&nbsp;</p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;&#10;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:&#10;minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:&#10;EN-US;mso-bidi-language:AR-SA\">D. The ANOVA method&nbsp;&nbsp;</span></p>', 'D', 1, '2021-08-31'),
(364, 22, 'A Six Sigma project can reduce:', '<p>A. Internal Failure Cost&nbsp;</p>\r\n<p class=\"MsoNormal\">B. External Failure Cost&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Total Failure Cost</p>\r\n<p class=\"MsoNormal\">D. None of the above&nbsp;</p>', 'C', 1, '2021-08-31'),
(365, 22, 'Why would Six Sigma activities prompt a re-analysis of measuring systems?', '<p>A. It^s mandated by the MSA (1998) Reference Manual&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Variability may be reduced, requiring more precise measurements&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Six Sigma is a more quality-conscious control technology&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Most six sigma training includes statistical software which requires frequent re-analysis</p>', 'B', 1, '2021-08-31'),
(366, 22, 'What does OEE stands for?', '<p>A. Overall Equipment Effectiveness&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Overall Estimation Effectiveness&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Overall Equipment Estimation&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Overall Effective Estimation&nbsp;&nbsp;</p>', 'A', 1, '2021-08-31'),
(367, 22, 'The house of quality is used to translate customer wants into engineering design variables. The linking or prioritization of customer wants into engineered values occurs in which of the following elements?', '<p>A. Competitive analysis&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Conflict analysis&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Technical review&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Relationship matrix&nbsp;&nbsp;</p>', 'D', 1, '2021-08-31'),
(368, 22, 'What is the name of the condition if you are running a 7-4 fractional experiment? You know factors A, B, C, D, and E are independent of each other, but you suspect factors F and G are not independent. You conducted a small sub-experiment and discovered a high correlation between factors F and G.', '<p>A. Collinearity&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Confounded&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Correlation&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Covariates</p>', 'A', 1, '2021-08-31'),
(369, 22, 'Most of the modern computer programs can perform an analysis of experimental residuals. Which of the following techniques will NOT be employed?', '<p>A. Control Charts&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Histograms&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Normal probability plots&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Dot plots&nbsp;</p>', 'A', 1, '2021-08-31'),
(370, 22, 'If an experiment has an alias, you could say that the two factor effects are:', '<p>A. Confounded&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Blocked&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Misnamed&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Mixtures</p>', 'A', 1, '2021-08-31'),
(371, 22, 'What types of variation does a process have if it is \"in control\"?', '<p>A. Process has assignable causes&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Process has assignable and chance causes&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Process has random causes only&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Process has assignable or chance cause</p>', 'C', 1, '2021-08-31'),
(372, 22, 'For 4 factors and 3 levels, the DOE setup has 32 runs. What type of experiment is being conducted?', '<p>A. Half fractional factorial&nbsp;</p>\r\n<p class=\"MsoNormal\">B. Full factorial&nbsp;</p>\r\n<p class=\"MsoNormal\">C. Quarter fractional factorial&nbsp;</p>\r\n<p class=\"MsoNormal\">D. Response Surface&nbsp;&nbsp;</p>', 'A', 1, '2021-08-31'),
(373, 4, 'A company is considering two projects, Alpha and Beta. Project Alpha is expected to result in a $50 million net profit, while project Beta and is expected to net $45 million. Both projects could be very lucrative and rewarding. However, the financial controller has stated that the company can only invest in one of these projects.  If project Alpha is selected, what will be the opportunity cost?', '<p><span style=\"font-family: &quot;source sans pro&quot;; background-color: rgb(251, 251, 251); color: rgb(75, 75, 75); font-size: 16px;\">$95 million</span></p>\r\n<div class=\"uk-block-secondary_code\" style=\"color: rgb(75, 75, 75); font-family: &quot;Source Sans Pro&quot;; font-size: 16px; background-color: rgb(251, 251, 251);\"><label for=\"6110002_B\" class=\"cls-opt\" style=\"cursor: pointer; line-height: 23px; display: inline-table; margin: 0px; font-family: &quot;source sans pro&quot;; max-width: 90%;\">$50 million</label></div>\r\n<div class=\"uk-block-primary_code\" style=\"color: rgb(75, 75, 75); font-family: &quot;Source Sans Pro&quot;; font-size: 16px; background-color: rgb(251, 251, 251);\"><label for=\"6110002_C\" class=\"cls-opt\" style=\"cursor: pointer; line-height: 23px; display: inline-table; margin: 0px; font-family: &quot;source sans pro&quot;; max-width: 90%;\">$45 million</label></div>\r\n<div class=\"uk-block-secondary_code\" style=\"margin-bottom: 0px; color: rgb(75, 75, 75); font-family: &quot;Source Sans Pro&quot;; font-size: 16px; background-color: rgb(251, 251, 251);\"><label for=\"6110002_D\" class=\"cls-opt\" style=\"cursor: pointer; line-height: 23px; display: inline-table; margin: 0px; font-family: &quot;source sans pro&quot;; max-width: 90%;\">$05 million</label></div>', 'B', 1, '2021-11-14'),
(374, 4, 'A project has a 60% chance of a $100,000 profit and a 40 percent of a US $100,000 loss. The Expected Monetary Value for the project is:', '<p><span style=\"color: rgb(81, 86, 94);\">A. $100,000 profit</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\"><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">B. $60,000 loss</span></span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">C. $ 20,000 profit</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">D. $40,000 loss<o:p></o:p></span></p>', 'B', 1, '2021-11-14'),
(375, 4, 'Assuming that the ends of a range of estimates are +/- 3 sigma from the mean, which of the following range estimates involves the LEAST risk?', '<p><span style=\"color: rgb(81, 86, 94);\">A. 30 days, plus or minus 5 days</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. 22 &ndash; 30 days</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. Optimistic = 26 days, most likely = 30 days, pessimistic = 33 days</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">D. Mean of 28 days</span></p>', 'C', 1, '2021-11-14'),
(376, 4, 'If a risk has a 20 percent chance of happening in a given month, and the project is expected to last five months, what is the probability that the risk event will occur during the fourth month of the project?', '<p>&nbsp;<span style=\"color: rgb(81, 86, 94);\">A. Less than 1 percent</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. 20 percent</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. 60 percent</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">D. 80 percent</span></p>', 'B', 1, '2021-11-14'),
(377, 4, 'An accepted deadline for project approaches. However, the project manager realizes only 75% percent of the work has been completed. The project manager then issues a change request. What should the change request authorize? ', '<p><span style=\"color: rgb(81, 86, 94);\">A. Additional resources using the contingency fund</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. Escalation approval to use contingency funding</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. Team overtime to meet schedule</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">D. Corrective action based on causes</span></p>', 'D', 1, '2021-11-14'),
(378, 4, 'What is meant by RACI?', '<p><span style=\"color: rgb(81, 86, 94);\">A. Responsible, Accountable, Confirm, Inform</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. Recommended, Accountable, Consulted, Inform</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. Responsible, Accountant, Consulted, Inform</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">D. Responsible, Accountable, Consulted, Inform</span></p>', 'D', 1, '2021-11-14'),
(379, 4, 'Which of the following statement is true about a Program?', '<p><span style=\"color: rgb(81, 86, 94);\">A. A Program is a group of related projects</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. A Program is a group of unrelated projects</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. A Program is a part of a big project</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94); font-family: Arial, &quot;sans-serif&quot;; font-size: 9.5pt;\">D. None of the above</span></p>', 'A', 1, '2021-11-14'),
(380, 4, 'The project manager meets with the project team to review lessons learned from previous projects. In what activity is the team involved?', '<p><span style=\"color: rgb(81, 86, 94);\">A. Performance management</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. Scope identification</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. Risk identification</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">D. Project team status meeting</span></p>', 'C', 1, '2021-11-14'),
(381, 4, 'During a bidder conference, you see that one bidder is your close friend. What should your next step be?', '<p><span style=\"color: rgb(81, 86, 94);\">A. You will pass some confidential info to him</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. You will disclose this relationship to your management</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. You will resign immediately from the bidding process</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">D. You will try not to give the contract to him to prove your integrity</span></p>', 'B', 1, '2021-11-14'),
(382, 4, 'If a risk event has a 90 percent chance of occurring, and the consequences will be the US $ 10,000, what does the US $9,000 represent?', '<p><span style=\"color: rgb(81, 86, 94);\">A. Risk value</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. Present value</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. Expected monetary value</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">D. Contingency budget</span></p>', 'C', 1, '2021-11-14'),
(383, 4, 'Your construction project was damaged by an earthquake. Your contractor says that he cannot fulfill the terms of the contract due to a specific clause you both had signed the contract. He is referring to the:', '<p><span style=\"color: rgb(81, 86, 94);\">A. Force majeure clause</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. Fixed price clause</span></p>\r\n<p><span style=\"mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#51565E\">C. Contract obligation terms</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">D. None of the above</span></p>', 'A', 1, '2021-11-14'),
(384, 4, 'All of the following are ALWAYS inputs to the risk management process EXCEPT:', '<p><span style=\"color: rgb(81, 86, 94);\">A. Historical information</span></p>\r\n<p><span style=\"color: rgb(81, 86, 94);\">B. Lessons learned</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(81, 86, 94);\">C. Work breakdown structure</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. Project status reports<o:p></o:p></span></p>', 'D', 1, '2021-11-14'),
(385, 4, 'When estimating time for activities, a Project Manager should:', '<p><span style=\"color: rgb(81, 86, 94);\">A. Use the best guess and estimate all activities since there will be changes as the project progresses and more information becomes available</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">B. Involve people who will be doing the work to get estimates<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">C. Estimate for what the cost will allow and include buffers<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. None of the above<o:p></o:p></span></p>', 'B', 1, '2021-11-14'),
(386, 4, 'Risk tolerance is determined in order to help:', '<p><span style=\"color: rgb(81, 86, 94);\">A. The team ranks the project risks.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">B. The project manager estimates the project.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">C. The team schedules the project.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. Management knows how other managers will act on the project.<o:p></o:p></span></p>', 'A', 1, '2021-11-14'),
(387, 4, ' You are running a project to engineer and implement a set of business processes and a software solution for customer relationship management. The project involves a large number of organizations?a major corporation and many suppliers of different sizes. During the project, you observe the effects of the differences between the companies’ corporate cultures. This leads to different expectations on how the project should be handled—as well as to frequent misunderstandings between stakeholders. Another effect is a growing degree of distrust and skepticism. What should you try first to integrate the diverse stakeholder groups?', '<p><span style=\"color: rgb(81, 86, 94);\">A. Focus on project work. As a project manager, you should not get distracted by big egos.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">B. Let the problems grow further until they are obvious for all. Then escalate them.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">C. Develop a joint quality policy for the project and seek a commitment by all organizations.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. Analyze the probability and impact of the risks linked with the situation and plan how to respond to them.&nbsp;<o:p></o:p></span></p>', 'D', 1, '2021-11-14'),
(388, 4, ' You are finding it difficult to evaluate the exact cost impact of risk. You should evaluate on a(n) :', '<p><span style=\"color: rgb(81, 86, 94);\">A. Quantitative basis</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">B. Numerical basis<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">C. Qualitative basis<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. Economic basis<o:p></o:p></span></p>', 'C', 1, '2021-11-14'),
(389, 4, 'A project manager is quantifying risk for her project. Several of her experts are offsite but wish to be included. How can this be done?', '<p><span style=\"color: rgb(81, 86, 94);\">A. Do a Monte Carlo analysis using the Internet as a tool</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">B. Apply the critical path method<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">C. Determine options for recommended corrective action<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. Apply the Delphi Technique<o:p></o:p></span></p>', 'D', 1, '2021-11-14'),
(390, 4, 'Being assigned as a project manager, you noticed during project execution that conflicts arise in the team on both technical and interpersonal levels. What is an appropriate way of handling conflicts?', '<p><span style=\"color: rgb(81, 86, 94);\">A. Conflicts distract the team and disrupt the work rhythm. You should always smooth them when they surface.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">B. A conflict should be handled in a meeting so that the entire team can participate in finding a solution.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">C, Conflicts should be addressed early and usually in private, using a direct, collaborative approach.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. You should use your coercive power to quickly resolve conflicts and then focus on goal achievement.<o:p></o:p></span></p>', 'C', 1, '2021-11-14'),
(391, 4, 'During which risk management process is a determination to transfer a risk made?', '<p><span style=\"color: rgb(81, 86, 94);\">A. Identify Risks</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">B. Perform Quantitative Risk Analysis<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">C. Plan Risk Response<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. Monitor and Control Risks<o:p></o:p></span></p>', 'C', 1, '2021-11-14'),
(392, 4, 'When control charts are used, outliers are…', '<p><span style=\"color: rgb(81, 86, 94);\">A. Singular measurements outside the bandwidth between an upper and lower control limit.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">B. A typical result of a rare random cause which is difficult to replicate and to verify.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">C. Insignificant results, often measurement errors, the causes of which should not be further investigated.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 15.6pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#51565E\">D. Measurements are inconsistent with a run of 7 results over or under a mean value.<o:p></o:p></span></p>', 'A', 1, '2021-11-14');
