(377, 4, 127, 'Initiating phase triggers the planning process group. After preparing the required documents and steps for initiating the project the next process group begins.\r\nPlanning phase triggers the execution process group. The project must have a proper planning in order to start the execution phase.\r\nExecution is the phase where the most of the project work is delivered.\r\nMonitoring and controlling is the only project management process group that interacts with all other four. In this phase, the project team checks whether everything is going as planned.\r\nClosing helps to close the project after all objectives are met.', 107, '2021-02-14', 0, 0),
(378, 4, 128, 'Initiating phase triggers the planning process group. After preparing the required documents and steps for initiating the project the next process group begins.\r\nPlanning phase triggers the execution process group. The project must have a proper planning in order to start the execution phase.\r\nExecution is the phase where the most of the project work is delivered.\r\nMonitoring and controlling is the only project management process group that interacts with all other four. In this phase, the project team checks whether everything is going as planned.\r\nClosing helps to close the project after all objectives are met.', 107, '2021-02-14', 0, 0),
(379, 4, 129, 'SWOT is a strategic planning tool used to evaluate the strengths, weaknesses, opportunities, and threats to a project. It involves specifying the objective of the project and identifying the internal and external factors that are favourable and unfavourable to achieving that objective. The strengths and weaknesses usually arise from within an organisation, and the opportunities and threats from external sources.\r\n\r\nThe SWOT analysis is an important part of the project planning process:\r\n\r\nStrengths: attributes of the organisation that help achieve the project objective.\r\nWeaknesses: attributes of the organisation that stop achievement of the project objective.\r\nOpportunities: external conditions that help achieve the project objective.\r\nThreats: external conditions that could damage the project.', 107, '2021-02-14', 0, 0),
