(658, 4, 110, '1. A single definable purpose, end item or result.\r\n2. Every project is unique.\r\n3. Projects are temporary activities.\r\n4. Projects involves unfamiliarity.\r\n5. Projects cut across organizational lines.', 125, '2021-02-14', 0, 0),
(659, 4, 111, '1. Initiating\r\n2. Planning\r\n3. Executing.\r\n4. Monitoring and control\r\n5. Closing.', 125, '2021-02-14', 0, 0),
(660, 4, 113, 'A Work Breakdown Structure (WBS) is a deliverable-oriented hierarchical decomposition of the work to be executed by the project team to accomplish the project objectives and create the required deliverables. A WBS is the cornerstone of effective project planning, execution, controlling, monitoring, and reporting.', 125, '2021-02-14', 0, 0),
(661, 4, 114, '1. Resource planning \r\n2. Cost estimating\r\n3. Cost budgeting\r\n4. Cost control.', 125, '2021-02-14', 0, 0),
(662, 4, 115, 'Business Angels\r\nBusiness Angels have a vast experience in the industry they operate in. Private investors may invest in a company for a capital gain. The investment is for a place on board or an equity stake.\r\n\r\nVenture Capital\r\nVenture capitalists invest in a project for a non-executive position on the board. They provide capital in exchange of an equity share or a position at a strategic level. Once the value of shares increase, they may sell those for a profit.\r\n\r\nLoan for Business\r\nApart from secured lending, a company can choose unsecured business loan that comes for a fixed tenure with a repayment plan. The cost of loan is determined by estimating the returns from the project. The interest payment is tax deductible in some cases. An agreement is made between the financial institution and the borrower for a specific loan amount and tenure.\r\n\r\nOverdrafts\r\nOverdrafts are ideal for a short-term finance. The period of overdraft facility is for a year or less. The interest is only charged on the amount spent from the person’s account. Such financing can be arranged quickly like business loans.\r\n\r\nShare Capital\r\nThe shareholders get profits from dividend. This share of profit is derived from ordinary shares (owned by business owners who can share profits of an organization from dividends) or preference shares (does not belong to company owners but a third-party). Capital gain is expected from selling the shares in future. It is the company shareholders who raise the Share Capital.\r\n\r\nDebentures\r\nDebenture loans come with a fixed or a floating rate and provided against an organization’s assets. The debenture holders receive payment of interest before the shareholders receive their dividend payment. If the business fails, then these holders are liable as preferential creditors.', 125, '2021-02-14', 0, 0),
(663, 4, 116, 'A benefit-cost ratio (BCR) is a ratio used in a cost-benefit analysis to summarize the overall relationship between the relative costs and benefits of a proposed project. ... If a project has a BCR greater than 1.0, the project is expected to deliver a positive net present value to a firm and its investors.', 125, '2021-02-14', 0, 0),
(664, 4, 117, 'from the growing sickness in industry and rapid increase in non-performing assets (NPAS) of. Banks and  Value (NPV), Internal Rate of Return (IRR) and Benefit-Cost ratio. ... Both CPM and PERT describe the work plan of project where arrows and circles Network Diagram is an acronym for Programe Evaluation.', 125, '2021-02-14', 0, 0),
(665, 4, 118, '9 steps on how to create a project plan online.\r\nStep 1: Identify all stakeholders. \r\nStep 2: Define roles and responsibilities. \r\nStep 3: Hold a kickoff meeting. \r\nStep 4: Define project scope, budget, and timeline. .\r\nStep 5: Set and prioritize goals.\r\nStep 7: Create a project schedule.', 125, '2021-02-14', 0, 0),
(666, 4, 119, 'A project schedule is an outline of a project that organizes tasks and activities, estimates their durations, identifies their dependencies, sets overall milestones and places all that information on a timeline. It also defines the resources needed to complete these tasks.\r\n', 125, '2021-02-14', 0, 0),
(667, 4, 120, 'An event is that particular instant of time at which some specific part of project is to be achieved while an activity is the actual performance of a task. An activity requires time and resources for its completion. Events are generally described by such words as complete, start, issue, approves, taste etc.', 125, '2021-02-14', 0, 0),
(668, 4, 121, 'In project management, a critical path is the sequence of project network activities which add up to the longest overall duration, regardless if that longest duration has float or not. This determines the shortest time possible to complete the project.', 125, '2021-02-14', 0, 0),
(669, 4, 122, 'Normal time is the amount of time initially planned to complete the activity. Crash time is the amount of time that activity will take if the additional resources are expended. Crash time is NOT the time saved, rather it is the reduced time applied. Crash time will always be a number smaller than normal time.', 125, '2021-02-14', 0, 0),
(670, 4, 123, 'Hierarchical org structure.\r\nFunctional org structure.\r\nHorizontal or flat org structure.\r\nDivisional org structures (market-based, product-based, geographic)\r\nMatrix org structure.\r\nTeam-based org structure.\r\nNetwork org structure.\r\n', 125, '2021-02-14', 0, 0),
(671, 4, 124, 'The real need of the project in this case is to establish better relationship with local community and improve the company image within it. You must be able to determine and understand the project needs in order to come up with the right project tasks and activities in project plan.', 125, '2021-02-14', 0, 0),
