(895, 4, 110, 'project is an estimate or forecast on basis of data\r\nexample : to build garage\r\nproject is temporary and is unique\r\n1. scope : it defines what will be covered in a project\r\n2. resource : it defines what can be used to meet the needs like materials\r\n3. time : it defines the priority of the tasks\r\n4. quality : it defines the variance of actual and derived results\r\n5. risk : it defines the uncertaninty which happens in advance to drive the plan', 119, '2021-02-14', 0, 0),
(896, 4, 112, 'Project coordination is a process day to day mangement of tasks within your department. \r\nThe whole process is to be coordinating with all project work and streamline the work\r\nIt shows who is responsible for any work. It delegates roles and repsonsibilties\r\nfeatures :\r\ncommunicating important content\r\nstreamlining communication\r\nminimizing risk\r\nenhanching client feedback\r\nstaying on schedule and within budget', 119, '2021-02-14', 0, 0),
(897, 4, 113, 'work break down structure :\r\n A wbs in project management is a deliverable oriented breakdown of projecr into smaller componennts which are independent and are manageable\r\nuses :\r\n1. It facilitates quick development of project.\r\n2. It is used to identify scope\r\n3. It identifys communication points\r\n4. It can assist with resource allocation\r\n5. It provides with cost estimation\r\n6. It can help identifying risk\r\n7. It provides brainstorming and collabration in teams as tool', 119, '2021-02-14', 0, 0),
(898, 4, 114, 'Project cost :\r\nIt is the sum total of all the costs incurred in development of project which are reasonable and necessray\r\ncomponents :\r\n1. Material cost : \r\nCost involved in procurement of raw materials , tools , equipment etc \r\neg : In building project - bricks is main material\r\n2. Human Resource :\r\nThe cost of labor or staff such a s project manager or team member etc.\r\nThe cost is for the value of their skillset\r\neg : In building project - project manager is a cost\r\n3. Pre palnning cost :\r\nThe cost involved in prepartion of proposal making or market research , bidding cost , hiring cost ,licencising cost, necessary permits etc\r\n4. Operating cost :\r\nThe cost associated for daily expense and expense such as rental cost , energy cost , inspection cost , running machinery in daily usage etc', 119, '2021-02-14', 0, 0),
