(954, 4, 111, 'Initiating-  helps in visualistaio  of what to be accomplished.\r\nplanning- this process guides to stakeholder on where and how to undertake the project.it is project plan are documented, deliverable and requirements are defined.\r\nExecuting- it is known as implementation phase, in which plan design in the previous phase activity put into action.\r\nMonitoring and Control- involves comparing actual performance and planned performance and taking corrective measures to yield the desire.\r\nClosing- last process , in this phase the emphasis is on releasing the final deliverables to the customer, handing over the project documentation to the business.', 109, '2021-02-14', 0, 0),
