(957, 4, 114, '1. material cost- this cost associated with the procurement of item such s tools, raw material. etc\r\n2.human resources- the labor cost or staff cost which includes all the human capital to work in that project such as manager, team members.\r\n3. pre-planning- include proposal making costs, proof of concept costs, market research etc.\r\n4.operating cost- it consist fees associated for purchasing project supplies , rental cost etc.', 109, '2021-02-14', 0, 0),
