(1248, 4, 110, 'a single definable purpose, \r\nEvery project is unique,\r\nproject are temporary activities \r\nproject cut across organizational time \r\nproject involves unfamiliarity  ', 123, '2021-02-14', 0, 0),
(1249, 4, 111, 'initiating \r\nplanning\r\nexecuting\r\nmonitoring\r\nclosing', 123, '2021-02-14', 0, 0),
(1250, 4, 112, 'project management is the process of leading the work of team to achieve goals and meet success criteria at a specific time ', 123, '2021-02-14', 0, 0),
(1251, 4, 113, 'A work-breakdown structure (WBS) in project management and systems engineering, is a deliverable-oriented breakdown of a project into smaller components', 123, '2021-02-14', 0, 0),
(1252, 4, 114, 'Resource planning\r\nCost estimating\r\nCost budgeting\r\nCost control', 123, '2021-02-14', 0, 0),
(1253, 4, 115, 'Sources of finance for business are equity, debt, debentures, retained earnings, term loans, working capital loans, letter of credit, euro issue, venture funding etc. These sources of funds are used in different situations.', 123, '2021-02-14', 0, 0),
(1254, 4, 116, 'A benefit-cost ratio (BCR) is a ratio used in a cost-benefit analysis to summarize the overall relationship between the relative costs and benefits of a proposed project', 123, '2021-02-14', 0, 0),
(1255, 4, 117, 'from the growing sickness in industry and rapid increase in non-performing assets (NPAS) of. Banks and Value (NPV), Internal Rate of Return (IRR) and Benefit-Cost ratio. ... Both CPM and PERT describe the work plan of project where arrows and circles. Network Diagram is an acronym for Program Evaluation.', 123, '2021-02-14', 0, 0),
(1256, 4, 118, 'Step 1: Identify & Meet with Stakeholders.\r\nStep 2: Set & Prioritize Goals.\r\nStep 3: Define Deliverables. ...\r\nStep 4: Create the Project Schedule. ...\r\nStep 5: Identify Issues and Complete a Risk Assessment. \r\nStep 6: Present the Project Plan to Stakeholders.', 123, '2021-02-14', 0, 0),
(1257, 4, 119, 'A project schedule is an outline of a project that organizes tasks and activities, estimates their durations, identifies their dependencies, sets overall milestones and places all that information on a timeline. It also defines the resources needed to complete these tasks', 123, '2021-02-14', 0, 0),
(1258, 4, 120, 'An event is that particular instant of time at which some specific part of project is to be achieved while an activity is the actual performance of a task. An activity requires time and resources for its completion', 123, '2021-02-14', 0, 0),
(1259, 4, 121, 'In project management, a critical path is the sequence of project network activities which add up to the longest overall duration, regardless if that longest duration has float or not. This determines the shortest time possible to complete the project.', 123, '2021-02-14', 0, 0),
(1260, 4, 122, 'Normal time is the amount of time initially planned to complete the activity. Crash time is the amount of time that activity will take if the additional resources are expended', 123, '2021-02-14', 0, 0),
(1261, 4, 123, 'Hierarchical org structure. \r\nFunctional org structure. \r\nHorizontal or flat org structure.\r\nDivisional org structure\r\nMatrix org structure. ...\r\nTeam-based org structure. \r\nNetwork org structure.', 123, '2021-02-14', 0, 0),
(1262, 4, 124, 'Project evaluation is a systematic and objective assessment of an ongoing or completed project. 1 The aim is to determine the relevance and level of achievement of project objectives, development effectiveness, efficiency, impact and sustainability.', 123, '2021-02-14', 0, 0),
