(1308, 4, 110, 'The project is temporary with a certain starting & ending date.\r\nThe opportunities and teams of the project are also for a temporary duration.\r\nProjects are ended when the goals are accomplished or when the goals are not achieved.\r\nOften projects continue for many years but still, their duration is finite.\r\nMultiple resources are involved in the projects along with close coordination.\r\nInterdependent activities are involved in the project.\r\n', 124, '2021-02-14', 0, 0),
(1309, 4, 111, 'Identification Phase: This is the first stage of project life cycle. It is also known as initiation phase. In this stage project objectives are identified and requirements are clarified\r\nPlanning Phase: In project planning phase, scope of the project is defined more accurately.\r\nImplementation, Monitoring and Controlling Phase: This is the third stage of project life cycle.', 124, '2021-02-14', 0, 0),
(1310, 4, 112, 'Project coordination is a project management method of assigning a person or a team to ensure that all aspects of the project are are completed in a timely manner, that snags are fixed and problems solved, and the project is finished on time and on budget.', 124, '2021-02-14', 0, 0),
(1311, 4, 113, 'A Work Breakdown Structure (WBS) is a deliverable-oriented hierarchical decomposition of the work to be executed by the project team to accomplish the project objectives and create the required deliverables. A WBS is the cornerstone of effective project planning, execution, controlling, monitoring, and reporting.\r\nThe first two levels of the WBS (the root node and Level 2) define a set of planned outcomes that collectively and exclusively represent 100% of the project scope. At each subsequent level, the children of a parent node collectively and exclusively represent 100% of the scope of their parent node.', 124, '2021-02-14', 0, 0),
(1312, 4, 114, 'Land and site development: The cost of land and site development is the sum of the following:-\r\n\r\nBasis cost of land including conveyance and other allied charges;\r\nPremium payable on leasehold and conveyance charge;\r\nCost of leveling and development.\r\nBuilding and civil works: Building and civil works cover the following:\r\n\r\nBuilding for the main plant and equipment;\r\nGodowns, warehouse, and open yard facilities;\r\nCanteen, guesthouse, time office etc.\r\nPlant and machinery: The cost of plant and machinery typically the most significant of the project cost consists of the following;\r\n\r\nCost of imported machinery;\r\nCost of indigenous machinery;', 124, '2021-02-14', 0, 0),
(1313, 4, 115, 'The sources of project finance will differ to a certain extent between the different types of project and such difference is prominent for projects belonging to different sectors. Even within the sectors, the sources will vary according to the project sizes and/or the gestation periods of the projects.', 124, '2021-02-14', 0, 0),
(1314, 4, 116, 'A benefit cost ratio greater than one indicates that projects generates more benefits than the cost incurred. You use the benefit cost ratio method to identify relationship between possible benefits and costs of the project. You use this method to measure qualitative as well as the quantitative factors.', 124, '2021-02-14', 0, 0),
(1315, 4, 117, 'Difference Between NPV and IRR\r\nLast updated on July 26, 2018 by Surbhi S\r\n\r\nnpv vs irrNPV or otherwise known as Net Present Value method\r\nIRR, i.e. internal rate of return is a rate of interest which matches present value of future cash flows with the initial capital outflow\r\n', 124, '2021-02-14', 0, 0),
