(1488, 4, 110, 'A project is a short-term activity\r\nIt is unique\r\nPurpose based activity\r\nHas a definite start and end time', 106, '2021-02-14', 0, 0),
(1489, 4, 111, 'Initiation\r\nplanning\r\nExecution\r\nMonitoring and controlling\r\nClosure', 106, '2021-02-14', 0, 0),
(1490, 4, 112, 'It is an activity to complete a given task by coordinating, analyzing and prioritizing various aspects regarding and related to a project', 106, '2021-02-14', 0, 0),
(1491, 4, 113, 'A WBS is a structured tool which allows the project manager to assign the tasks or resposibility to every team member. It is an interactive activity based on the skill sets of an employee to get the desired outputs.\r\n\r\n', 106, '2021-02-14', 0, 0),
(1492, 4, 114, 'While determining the cost of a project it is important to have a cost management approach, estimation of the cost, cost baseline, budget of the project, cost variance plan, etc.', 106, '2021-02-14', 0, 0),
(1493, 4, 115, 'Capital, retained earnings, debt capital, equity capital.', 106, '2021-02-14', 0, 0),
(1494, 4, 116, 'The Benefit-to-cost ratio is to estimate and validate the overall cost incurred to the benefit post spending. it is an analysis of money spent to achieved utility.', 106, '2021-02-14', 0, 0),
(1495, 4, 117, 'NPV stands for Net present value\r\nIRR stands for Internal rate of return\r\nPERT is an acronym for Project evaluation review technique\r\nCPM stands for critical path method', 106, '2021-02-14', 0, 0),
(1496, 4, 118, 'Define the scope of the project\r\nIdentify key stakeholders\r\nCreate a project schedule\r\nSet and prioritize goals\r\nDefining deliverables\r\nRisk assessment', 106, '2021-02-14', 0, 0),
(1497, 4, 119, 'It can be defined as a critical step to keep all the tasks and teams aligned to the schedule to get the desired output in time. It involves Planning a schedule, Defining activities, Sequencing of activities, Estimating the duration of activities, and planning for procurement of resources ', 106, '2021-02-14', 0, 0),
(1498, 4, 120, 'Event is something which may occur with or without any prior notice whereas an activity is an ongoing process which can be operational, administrative, etc.', 106, '2021-02-14', 0, 0),
(1499, 4, 121, 'A critical path is the longest sequence of tasks which must be completed in order to complete the project. The activities in a critical must be completed in time in order to complete the project without any delay or lags.', 106, '2021-02-14', 0, 0),
(1500, 4, 122, 'Normal time is the time that was planned at an initial stage for an activity to finish whereas crash time is allocating additional resources to that activity to reduce the completion time.', 106, '2021-02-14', 0, 0),
(1501, 4, 123, 'An organization may differ in the activities they are involved in but can be categorized in the following ways.\r\n1. A functional organization structure\r\n2. A hierarchical organization structure\r\n3. Team based organization structure, etc.', 106, '2021-02-14', 0, 0),
(1502, 4, 124, 'Evaluation is conducted to understand the resources required for a project, to verify the deliverables, monitor the progress of the project, and how efficiently the project activities were undertaken.', 106, '2021-02-14', 0, 0),
(1503, 4, 125, 'Communication is a way of expressing and exchanging ideas. Effective or good communication involves be clear and specific about everything you say. For the success of any project or organization, effective communication is a must. It helps in avoiding misinterpretation, clarifying the project details, and avoiding conflicts. ', 106, '2021-02-14', 0, 0),
(1504, 4, 126, 'The PMBOK guide specifies knowledge about areas like \r\n1. Project scope management\r\n2. Cost management \r\n3. Resource management\r\n4. Quality management\r\n5. Risk management\r\n6. Resource management, etc', 106, '2021-02-14', 0, 0),
(1505, 4, 127, 'Project initiation\r\nProject planning\r\nProject execution\r\nProject monitoring and control\r\nProject closing', 106, '2021-02-14', 0, 0),
(1506, 4, 128, '1. Approach\r\n2. Roles and responsibilities\r\n3. Work breakdown structure\r\n4. Scope verification\r\n5. Scope control', 106, '2021-02-14', 0, 0),
