(1548, 4, 110, 'A project has a defined start and endpoint\r\nt has a set of requirements that needs to be fulfilled with the particular time period \r\nA project is not something which happens in a forever lopp...there are various stages in it \r\nIt is basically for a customer which we prepare a project for\r\nIt always has temporary activities\r\nThey cut across organizational lines\r\nThey have to be unique product or service that has to meet the objectives and signed of by the stake holders', 128, '2021-02-14', 0, 0),
(1549, 4, 111, 'There are basically five stages in a project cycle\r\n1. Initiating - We have a vision of what needs to be done\r\n2. Planning- Where we plan the time...reesources, budget, manpoweretc...this is a crucial process in the project\r\n3. Executing - Here we execute what exactly we planned in a proper format\r\n4. Monitoring and control - all the factors need to be closely monitored in the project\r\n5. Closure - There should always be a proper closure where we need to meet the requirements of the client and had it over to them', 128, '2021-02-14', 0, 0),
(1550, 4, 112, 'Project coordination is something where we keep track of the flow of day-to-day tasks within our department.\r\nIt helps to streamline the workflow of your tasks.\r\nEvery individual has a responsibility of each department, they have their own targets and deadlines. It actually helps in communicating areas of importance. The proper flow of work is maintained. \r\nIncreases productivity, maintains budget as we keep ourselves on schedule.\r\nWe can manage risks and we can ensure the feedback from our respective clients', 128, '2021-02-14', 0, 0),
(1551, 4, 113, 'Work break down structure is generally how we divide our work to be executed by each and every person in the team working for the project. It is a hierarchical tree structure that breaks the bigger work into manageable portions. It basically helps to understand the work in precise. It helps in having a proper vision on project objectives. It is a major important factor for planning, execution, controlling, reporting, etc. We can also have a better estimation of budget, risk, time and cost as you work from smaller tasks to bigger. ', 128, '2021-02-14', 0, 0),
(1552, 4, 114, '1. cost estimation\r\n2. cost baseline\r\n3. project budget\r\n4. change process control\r\n5. cost control\r\n6. change control \r\n7. cost management approach\r\n8. cost variance plan\r\n', 128, '2021-02-14', 0, 0),
(1553, 4, 115, '1. Venture capital\r\n2. Loan for business\r\n3. Over drafts\r\n4. Business angels\r\n5. Equity financing\r\n6. Debentures\r\n7. Share capital\r\n8. Debt capital\r\n9. Retained earnings\r\n10. Term loans and work capital loans', 128, '2021-02-14', 0, 0),
(1554, 4, 117, 'NPV - Net present value\r\nIRR - internal rate of return\r\nPERT - Program evaluation and review technique\r\nCPM - Cost per mille', 128, '2021-02-14', 0, 0),
