(1728, 4, 111, 'Initiation phase- during this phase project objective or need is identified.\r\nPlanning phase- this is the phase where the project solution is further developed in much detail.\r\nImplementation phase- during this phase the project plan in put into motion and the work of the project is performed.\r\nMonitoring and control phase- in this phase the process oversees all the task and metrics needed  to guarantee that the agreed and approved project that undertaken is within scope, on time and within budget.\r\nClosing phase- this is considered to be last phase of the  project activity cycle. in phase project is formally closed and then a report is produced.', 118, '2021-02-14', 0, 0),
(1729, 4, 113, 'A WBS is a tool that can be used for projects, programs, and even initiatives to understand the work that has to be done to successfully produce a deliverable. the benefits of  creating a WBS includes: it defines and organizes the work  required.', 118, '2021-02-14', 0, 0),
