(1786, 4, 111, 'The first few weeks of the project will consist of a small team of people working on a project . \r\nBelow are the stages in a project life cycle . \r\ni)Initiation \r\nii) Planning \r\niii) Execution\r\niv) Monitoring and controlling\r\nv) Closure \r\n\r\ni) INITIATION-This is perhaps the most important stage of any project as it setsthe terms of reference within which the project will be run .\r\nii) PLANNING- The key to a successful project is in the planning. Creating a project plan is the first task you should do when undertaking any project \r\niii) EXECUTION- This is where the work to deliver the product, service or wanted result is carried out \r\niv)MONITORING & CONTROL- Once the project is running it is important the project manager keeps control\r\nv)CLOSURE- Often neglected, it is important to make sure the project is closed properly .  ', 122, '2021-02-14', 0, 0),
(1787, 4, 113, 'WBS benifts :- \r\n.it defines and organizes the work required. \r\n.it facilitates the quick development of a schedule by allocating effort estimates to specific sections of the WBS \r\n.it can be used to identify potential scope risks if it has a branch that is not well defined.\r\n.it provides a visual ofnentire scope ', 122, '2021-02-14', 0, 0),
(1788, 4, 114, 'The main 4 elements are as follows:- \r\n1) material costs\r\n2)Human Resource\r\n3)Pre-pnning cost \r\n4)Operating Cost\r\n\r\n1)Material costs - This is cost that is associated with the procurement of items such as equipment, tools, raw materials ,etc.\r\n2) Human Resource - The labour cost or the staff cost which includes all the human \r\n3) Pre-panning cost', 122, '2021-02-14', 0, 0),
