(2387, 22, 224, 'Multi-vari charts are used to investigate the stability or consistency of a process. The chart consists of a series of vertical lines, or other appropriate schematics, along a time scale. The length of each line or schematic shape represents the range of values found in each sample set', 181, '2021-08-08', 0, 0),
(2388, 22, 225, 'A sampling plan is a detailed outline of which measurements will be taken at what times, on which material, in what manner, and by whom\r\nidentify the parameters to be measured, the range of possible values, and the required resolution.\r\ndesign a sampling scheme that details how and when samples will be taken.\r\nselect sample sizes.\r\ndesign data storage formats.\r\nassign roles and responsibilities.\r\n', 181, '2021-08-08', 0, 0),
(2389, 22, 226, 'Continuous variation refers to the type of genetic variation, which shows an unbroken range of phenotypes of a particular character in the population while discontinuous variation refers to the type of genetic variation, which shows to or more separate forms of a character in the population', 181, '2021-08-08', 0, 0),
(2390, 22, 227, 'The term variance refers to a statistical measurement of the spread between numbers in a data set\r\nVariance is a measurement of the spread between numbers in a data set.\r\nInvestors use variance to see how much risk an investment carries and whether it will be profitable.\r\nVariance is also used to compare the relative performance of each asset in a portfolio to achieve the best asset allocation.', 181, '2021-08-08', 0, 0),
(2391, 22, 228, 'Correlation measures the relationship of the process inputs (x) on the output (y). It is the degree or extent of the relationship between two variables. These studies are used to examine if there is a predictive relationship of the input on the process.\r\nPredicting within the range of the data is called \"interpolating\"\r\nPredicting outside the range of the data is called \"extrapolating\".\r\n', 181, '2021-08-08', 0, 0),
(2392, 22, 229, 'The scatter diagram graphs pairs of numerical data, with one variable on each axis, to look for a relationship between them. If the variables are correlated, the points will fall along a line or curve. The better the correlation, the tighter the points will hug the line. This cause analysis tool is considered one of the seven basic quality tools.\r\nWhen you have paired numerical data\r\nWhen your dependent variable may have multiple values for each value of your independent variable\r\nWhen trying to determine whether the two variables are related, such as:\r\nWhen trying to identify potential root causes of problems\r\nAfter brainstorming causes and effects using a fishbone diagram to determine objectively whether a particular cause and effect are related\r\nWhen determining whether two effects that appear to be related both occur with the same cause\r\nWhen testing for autocorrelation before constructing a control chart', 181, '2021-08-08', 0, 0),
(2393, 22, 230, 'A positive correlation coefficient indicates that an increase in the first variable would correspond to an increase in the second variable, thus implying a direct relationship between the variables. A negative correlation indicates an inverse relationship whereas one variable increases, the second variable decreases.', 181, '2021-08-08', 0, 0),
(2394, 22, 231, 'time order, co-occurrence, preceding causation, sufficiency, interaction, and alteration. The cause precedes the effect (time order). The cause co-occurs with the unaffected entity in space and time (co-occurrence).\r\n', 181, '2021-08-08', 0, 0),
(2395, 22, 232, 'Simple Hypothesis.\r\nComplex Hypothesis.\r\nWorking or Research Hypothesis.\r\nNull Hypothesis.\r\nAlternative Hypothesis.\r\nLogical Hypothesis.\r\nStatistical Hypothesis.', 181, '2021-08-08', 0, 0),
(2396, 22, 233, 'There are many different parameters that you can test. There is a test for the mean, such as was introduced with the z-test. There is also a test for the population proportion, p. This is where you might be curious if the proportion of students who smoke at your school is lower than the proportion in your area. Or you could question if the proportion of accidents caused by teenage drivers who do not have a drivers’ education class is more than the national proportion.', 181, '2021-08-08', 0, 0),
(2397, 22, 235, 'A chi-square (?2) statistic is a test that measures how a model compares to actual observed data. The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample.', 181, '2021-08-08', 0, 0),
(2398, 22, 236, 'The paired sample t-test, sometimes called the dependent sample t-test, is a statistical procedure used to determine whether the mean difference between two sets of observations is zero. In a paired sample t-test, each subject or entity is measured twice, resulting in pairs of observations. Common applications of the paired sample t-test include case-control studies or repeated-measures designs. Suppose you are interested in evaluating the effectiveness of a company training program. One approach you might consider would be to measure the performance of a sample of employees before and after completing the program, and analyze the differences using a paired sample t-test.', 181, '2021-08-08', 0, 0),
(2399, 22, 237, 'Analysis of variance (ANOVA) is an analysis tool used in statistics that splits an observed aggregate variability found inside a data set into two parts: systematic factors and random factors. The systematic factors have a statistical influence on the given data set, while the random factors do not.', 181, '2021-08-08', 0, 0),
