(2441, 22, 226, 'The term \"variation\" refers to a lack of consistency. The numerical value used to illustrate how broadly individuals in a group differ can be defined as variation.\r\n\r\nWhen processes fail to follow a specific pattern, process variation occurs.\r\n\r\nIn a process, there are two forms of variation that might occur.\r\n\r\n1. Variation in Common Causes\r\n2. Variation in Special Causes\r\n\r\nCommon causes of variance have the following characteristics:\r\n\r\nVariation is probabilistically predictable.\r\nPhenomena that are now occurring in the system\r\nVariation within a non-regular historical experience base\r\nIndividual high and low numbers have no relevance.\r\n\r\nSpecific Cause Variation- Special Cause of Variance, on the other hand, refers to unexpected glitches that affect a process. The term Special Cause of Variance was coined by W. Edwards Deming and is also known as an “Assignable Cause.” These are variations that were not observed previously and are unusual, non-quantifiable variations.\r\n\r\nCharacteristics of Special Causes of Variation are:\r\n\r\nNew and unanticipated or previously neglected episode within the system\r\nThis kind of variation is usually unpredictable and even problematic\r\nThe variation has never happened before and is thus outside the historical experience base', 178, '2021-08-08', 0, 0),
(2442, 22, 228, 'Correlation studies and dependencies tend to be greater when there is more data and a larger range of data.\r\nHowever, visualising the data set can demonstrate that the correlations between the samples are likely to differ. There could be a link inside a tighter range, yet a separate link could be discovered in a different range.\r\n\r\nThe Pearson Product Moment Correlation, also known as the Coefficient of Correlation (COC), measures only a linear relationship between two variables and is denoted by a \"r\" value. There are several correlation coefficients in use, but the most commonly used is the Pearson Product Moment Correlation, also known as the Coefficient of Correlation (COC).\r\n\r\nThe \"r\" value is used to measure the linear correlation and it will always range from -1.0 (anticorrelation) to +1.0. As the value approaches 0 there is less linear correlation, or dependence, of the variables.\r\n\r\nIf the value:\r\n\r\nof one variable increases when the value of the other increases, they are said to be positively linearly correlated.\r\nof the output (y) decreases when the value of the input (x) increases, they are said to be negatively linearly correlated.\r\nof the output increases when as the input value increase then they are said to be positively correlated. \r\n', 178, '2021-08-08', 0, 0),
(2443, 22, 229, 'Scatter Diagrams are useful tools for analysing the relationship between two random variables. They are a type of sheet of paper on which the data points corresponding to the variables of interest are scattered, as the name implies. We can identify the relationship between the two variables based on the shape of the pattern formed by the data points on this sheet of paper.\r\n\r\nThe Scatter Diagrams between two random variables feature the variables as their x and y-axes. We can take any variable as the independent variable in such a case (the other variable being the dependent one), and correspondingly plot every data point on the graph (xi,yi ). The totality of all the plotted points forms the scatter diagram.\r\n\r\nBased on the different shapes the scatter plot may assume, we can draw different inferences. We can calculate a coefficient of correlation for the given data. It is a quantitative measure of the association of the random variables. Its value is always less than 1, and it may be positive or negative.\r\n\r\n', 178, '2021-08-08', 0, 0),
(2444, 22, 230, 'Strength: The greater the absolute value of the correlation coefficient, the stronger the relationship.\r\nThe extreme values of -1 and 1 indicate a perfectly linear relationship where a change in one variable is accompanied by a perfectly consistent change in the other. For these relationships, all of the data points fall on a line. In practice, you won’t see either type of perfect relationship.\r\nA coefficient of zero represents no linear relationship. As one variable increases, there is no tendency in the other variable to either increase or decrease.\r\nWhen the value is in-between 0 and +1/-1, there is a relationship, but the points don’t all fall on a line. As r approaches -1 or 1, the strength of the relationship increases and the data points tend to fall closer to a line.\r\nDirection: The sign of the correlation coefficient represents the direction of the relationship.\r\nPositive coefficients indicate that when the value of one variable increases, the value of the other variable also tends to increase. Positive relationships produce an upward slope on a scatterplot.\r\nNegative coefficients represent cases when the value of one variable increases, the value of the other variable tends to decrease. Negative relationships produce a downward slope.\r\nStatisticians consider Pearson’s correlation coefficients to be a standardized effect size because they indicate the strength of the relationship between variables using unitless values that fall within a standardize range of -1 to +1. Effect sizes help you understand how important the findings are in a practical sense. To learn more about unstandardized and standardized effect sizes, read my post about Effect Sizes in Statistics.', 178, '2021-08-08', 0, 0),
(2445, 22, 231, 'One factor or event leading to another; this could indicate dependence – as in, factor A must occur in order for factor B to occur – or simply be one of the ways something occurs (even without factor A, factors C, D, E, or F could all lead to factor B independently). The main point is that one thing occurs as a result of another.', 178, '2021-08-08', 0, 0),
(2446, 22, 232, 'Hypothesis testing is an act in statistics whereby an analyst tests an assumption regarding a population parameter. The methodology employed by the analyst depends on the nature of the data used and the reason for the analysis. Hypothesis testing is used to assess the plausibility of a hypothesis by using sample data.\r\nThere are six forms of hypothesis and they are:\r\n\r\nSimple hypothesis\r\nComplex hypothesis\r\nDirectional hypothesis\r\nNon-directional hypothesis\r\nNull hypothesis\r\nAssociative and casual hypothesis', 178, '2021-08-08', 0, 0),
(2447, 22, 233, 'The two-sample Z test of proportions is used to see if two populations differ significantly on certain features. To put it another way, compare the proportion of two populations that share a common trait. It determines the range of values that are likely to include the population proportions discrepancy.\r\nThe purpose of two sample Z test is to compare the random samples of two populations. Use two sample z test of proportion for large sample size and Fisher exact probability test is an excellent non-parametric test for small sample sizes.\r\nNull hypothesis: The difference between population proportions is equal to hypothesized difference\r\nAlternative hypothesis: The difference between population proportions is not equal to hypothesized difference (two -tailed)\r\nThe difference between population proportions is greater than hypothesized difference (right-tailed)\r\nThe difference between population proportions is less than hypothesized difference (left -tailed)', 178, '2021-08-08', 0, 0),
(2448, 22, 234, 'A paired t-test (also known as a Paired T Distribution, Paired T Test, Paired Comparison Test, or Paired Sample Test) analyses the mean and standard deviation of two matched groups to see if there is a significant difference. In other words, it determines whether the average difference between the two measurements differs from zero statistically.\r\nStudent’s T distribution is used for finding confidence intervals for the population mean when the sample size is less than 30, and the population standard deviation is unknown.  Further, Students’ t-test is divided into paired and unpaired t-test.', 178, '2021-08-08', 0, 0),
(2449, 22, 235, 'A chi-square (?2) statistic is a test that measures how a model compares to actual observed data. The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample. For example, the results of tossing a fair coin meet these criteria.\r\nChi-square tests are often used in hypothesis testing. The chi-square statistic compares the size any discrepancies between the expected results and the actual results, given the size of the sample and the number of variables in the relationship. For these tests, degrees of freedom are utilized to determine if a certain null hypothesis can be rejected based on the total number of variables and samples within the experiment. As with any statistic, the larger the sample size, the more reliable the results.', 178, '2021-08-08', 0, 0),
(2450, 22, 236, 'A paired t-test is used when we are interested in the difference between two variables for the same subject.\r\n\r\nOften the two variables are separated by time. For example, in the Dixon and Massey data set we have cholesterol levels in 1952 and cholesterol levels in 1962 for each subject. We may be interested in the difference in cholesterol levels between these two time points.\r\n\r\nHowever, sometimes the two variables are separated by something other than time. For example, subjects with h ACL tearstext annotation indicator may be asked to balance on their leg with the torn ACL and then to balance again on their leg without the torn ACL. Then, for each subject, we can then calculate the difference in balancing time between the two legs.\r\nThe p-value gives the probability of observing the test results under the null hypothesis. The lower the p-value, the lower the probability of obtaining a result like the one that was observed if the null hypothesis was true. Thus, a low p-value indicates decreased support for the null hypothesis.', 178, '2021-08-08', 0, 0),
(2451, 22, 237, 'systematic factors and random factors are two types of observed aggregate variability detected within a data set. Random factors have no statistical impact on the supplied data set, whereas systematic influences do. In a regression research, analysts utilise the ANOVA test to examine the impact of independent factors on the dependent variable.', 178, '2021-08-08', 0, 0),
