(2553, 22, 229, 'You interpret a scatterplot by looking for trends in the data as you go from left to right: If the data show an uphill pattern as you move from left to right, this indicates a positive relationship between X and Y. As the X-values increase (move right), the Y-values tend to increase (move up).', 174, '2021-08-08', 0, 0),
(2554, 22, 230, 'Correlation coefficients describe the strength and direction of an association between variables. A Pearson correlation is a measure of a linear association between 2 normally distributed random variables. A Spearman rank correlation describes the monotonic relationship between 2 variables.', 174, '2021-08-08', 0, 0),
(2555, 22, 231, 'here are six fundamental characteristics of causation: time order, co-occurrence, preceding causation, sufficiency, interaction, and alteration', 174, '2021-08-08', 0, 0),
(2556, 22, 232, 'an idea or explanation for something that is based on known facts but has not yet been proved\r\nTypes of hypothesis testing are :\r\na)Simple Hypothesis.\r\nb)Complex Hypothesis.\r\nc)Working or Research Hypothesis.\r\nd)Null Hypothesis.\r\ne)Alternative Hypothesis.\r\nf)Logical Hypothesis. etc', 174, '2021-08-08', 0, 0),
(2557, 22, 233, '(i) The numbers a, b, c and d are in proportional if the ratio of the first two quantities is equal to the ratio of the last two quantities, i.e., a : b : : c : d and is read as ‘a is to b is as c is to d’. The symbol ‘ : : ‘ stands for ‘is as’.\r\n\r\n(ii) Each quantity in a proportion is called its term or its proportional.\r\n\r\n(iii) In a proportion; the first and the last terms are called the extremes; whereas the second and the third terms are called the means.\r\n\r\nIf four numbers a, b, c and d are in proportional (i.e., a : b : : c : d), then a and d are known as extreme terms and b and c are called middle terms.\r\n\r\n(v) The fourth term of a proportion is called fourth proportional.\r\n\r\n', 174, '2021-08-08', 0, 0),
(2558, 22, 234, 'A paired t-test is used when we are interested in the difference between two variables for the same subject.\r\nt Test compares the means of two measurements taken from the same individual, object, or related units.', 174, '2021-08-08', 0, 0),
(2559, 22, 235, 'The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample. \r\nA chi-square (?2) statistic is a test that measures how a model compares to actual observed data. The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample. Chi-square tests are often used in hypothesis testing.\r\n', 174, '2021-08-08', 0, 0),
(2560, 22, 236, 'dont know the answer', 174, '2021-08-08', 0, 0),
(2561, 22, 237, 'Analysis of variance, or ANOVA, is a statistical method that separates observed variance data into different components to use for additional tests. A one-way ANOVA is used for three or more groups of data, to gain information about the relationship between the dependent and independent variables.\r\n', 174, '2021-08-08', 0, 0),
