(2603, 22, 224, 'A Multi-Vari Studyis an overarching study that encompasses many other Lean Sigma tools. At the highest level a study comprises 1. Data capture of Xs and the corresponding level of Ys at various times from the process (see \"KPOVs and Data\" in this chapter) 2. Examination of the data using graphs to identify potential relationships between the Xs and the Ys 3. Validation of the potential relationships using the appropriate statistical tools ', 170, '2021-08-08', 0, 0),
(2604, 22, 225, 'identify the parameters to be measured, the range of possible values, and the required resolution\r\ndesign a sampling scheme that details how and when samples will be taken\r\nselect sample sizes\r\ndesign data storage formats\r\nassign roles and responsibilities', 170, '2021-08-08', 0, 0),
(2605, 22, 226, 'In a variation if variables change proportionately i.e. they either increase or decrease together then it is direct variations. Therefore, if X is in direct variation with Y, then you can symbolically write it as X ? Y.\r\n\r\nIn inverse or indirect variations, the variables change disproportionately. Further, this means that when one of the variables increases, the other one decreases. So the behavior of the variables is just the opposite of direct variations. Therefore, if X is in indirect variations with Y, then you can symbolically write it as X ? 1Y.\r\n\r\nIf more than two variables share a direct relationship or one variable changes with the change product of two or more variables, it is joint variations. Therefore, if X is in joint variation with Y and Z, you can symbolically write it as X ? YZ.\r\n\r\nCombined variations are a combination of direct, joint and indirect variations. So, in this case, three or more variables exist. Therefore, if X is in combined variation with Y and Z, you can symbolically write it as X ? YZ or X ? ZY.\r\n\r\nWhen two variables are in relation with a formula or a variable is related by the sum of two or more variables, then it is a partial variation. X = KY + C (where K and C are constants) is a straight line equation which is an example of partial variation.', 170, '2021-08-08', 0, 0);
INSERT INTO `rim_quizscore` (`Id`, `Quizid`, `Quesid`, `Answer`, `Userid`, `Dateofscored`, `Durbalmin`, `Durbalsec`) VALUES
(2606, 22, 228, '. Correlation refers to any statistical relationship involving dependence. In a correlation study, the Six Sigma practitioner would be looking for a correlation coefficient. The probability runs from -1 to +1. In other words, if two random variables are 100% correlated, the correlation coefficient would be +1 or -1. If there is no correlation, the correlation coefficient would be zero (0).\r\n\r\nUse: Understanding the formula Y = (function) of x (or multiple x’s) means that if there are a number of factors (x’s), you might want to know if one of the factors (factor A) will have an effect on your response of interest (response Y). For example, if you wanted to know whether the probability of rain is dependent upon the level of humidity, you might plot various levels of humidity against various probabilities of rain using paired comparisons.\r\n\r\nLet’s say the favorable response is for more rain (Y). You want more rain because you are a farmer and the crops need rain. The humidity level is (x). You might find that there is a positive correlation – meaning that as the level of humidity rises, the probability of rain goes up. You also might find that there is a negative correlation, meaning that as the level of humidity goes up, the probability of rain decreases. You also might find that there is no correlation between the level of humidity and the probability of rain.', 170, '2021-08-08', 0, 0),
(2607, 22, 229, 'The scatter diagram graphs pairs of numerical data, with one variable on each axis, to look for a relationship between them. If the variables are correlated, the points will fall along a line or curve. The better the correlation, the tighter the points will hug the line. This cause analysis tool is considered one of the seven basic quality tools.A scatter diagram is primarily used when you want to determine if a pair of numerical data points have a cause-and-effect relationship with each other. A scatter diagram is effective at showing a relationship because it does a good job of showing the range of data points at any section. If we were to use a bar or line chart, the best we could derive would be the trend of the data. We would miss out on a lot of other potential insights. Let’s look at an example:', 170, '2021-08-08', 0, 0),
(2608, 22, 230, 'Correlation in the broadest sense is a measure of an association between variables. In correlated data, the change in the magnitude of 1 variable is associated with a change in the magnitude of another variable, either in the same (positive correlation) or in the opposite (negative correlation) direction. Most often, the term correlation is used in the context of a linear relationship between 2 continuous variables and expressed as Pearson product-moment correlation. The Pearson correlation coefficient is typically used for jointly normally distributed data (data that follow a bivariate normal distribution). For nonnormally distributed continuous data, for ordinal data, or for data with relevant outliers, a Spearman rank correlation can be used as a measure of a monotonic association. Both correlation coefficients are scaled such that they range from -1 to +1, where 0 indicates that there is no linear or monotonic association, and the relationship gets stronger and ultimately approaches a straight line (Pearson correlation) or a constantly increasing or decreasing curve (Spearman correlation) as the coefficient approaches an absolute value of 1. Hypothesis tests and confidence intervals can be used to address the statistical significance of the results and to estimate the strength of the relationship in the population from which the data were sampled. The aim of this tutorial is to guide researchers and clinicians in the appropriate use and interpretation of correlation coefficients.', 170, '2021-08-08', 0, 0),
(2609, 22, 231, 'Causation is implying that A and B have a cause-and-effect relationship with one another. You’re saying A causes B.\r\n\r\nCausation is also known as causality.\r\n\r\nFirstly, causation means that two events appear at the same time or one after the other.\r\nAnd secondly, it means these two variables not only appear together, the existence of one causes the other to manifest.Causation is also known as causality. Firstly, causation means that two events appear at the same time or one after the other. And secondly, it means these two variables not only appear together, the existence of one causes the other to manifest.', 170, '2021-08-08', 0, 0),
(2610, 22, 232, 'Hypothesis testing refers to a formal process of investigating a supposition or statement to accept or reject it. The econometricians examine a random sample from the population. If it is consistent with the hypothesis, it is accepted. Otherwise it is rejected\r\nimple hypothesis\r\nComplex hypothesis\r\nDirectional hypothesis\r\nNon-directional hypothesis\r\nNull hypothesis\r\nAssociative and casual hypothesis', 170, '2021-08-08', 0, 0),
(2611, 22, 233, 'e are now going to develop the hypothesis test for the difference of two proportions for independent samples. The hypothesis test follows the same steps as one group.\r\n\r\nThese notes are going to go into a little bit of math and formulas to help demonstrate the logic behind hypothesis testing for two groups. If this starts to get a little confusion, just skim over it for a general understanding! Remember we can rely on the software to do the calculations for us, but it is good to have a basic understanding of the logic!\r\n\r\nWe will use the sampling distribution of  as we did for the confidence interval.\r\n\r\nFor a test for two proportions, we are interested in the difference between two groups. If the difference is zero, then they are not different (i.e., they are equal). Therefore, the null hypothesis will always be:\r\n\r\n\r\nAnother way to look at it is . This is worth stopping to think about. Remember, in hypothesis testing, we assume the null hypothesis is true. In this case, it means that  and  are equal. Under this assumption, then  and  are both estimating the same proportion. Think of this proportion as .\r\n\r\nTherefore, the sampling distribution of both proportions,  and , will, under certain conditions, be approximately normal centered around , with standard error , for .\r\n\r\nWe take this into account by finding an estimate for this  using the two-sample proportions. We can calculate an estimate of  using the following formula:\r\n\r\n\r\nThis value is the total number in the desired categories  from both samples over the total number of sampling units in the combined sample .\r\n\r\nPutting everything together, if we assume , then the sampling distribution of  will be approximately normal with mean 0 and standard error of , under certain conditions.\r\n\r\nTherefore,\r\n\r\n\r\n...will follow a standard normal distribution.', 170, '2021-08-08', 0, 0),
(2612, 22, 234, 'A paired samples t-test is used to compare the means of two samples when each observation in one sample can be paired with an observation in the other sample.\r\nA paired samples t-test is commonly used in two scenarios:\r\n\r\n1. A measurement is taken on a subject before and after some treatment – e.g. the max vertical jump of college basketball players is measured before and after participating in a training program.\r\n\r\n2. A measurement is taken under two different conditions – e.g. the response time of a patient is measured on two different drugs.\r\n\r\nIn both cases we are interested in comparing the mean measurement between two groups in which each observation in one sample can be paired with an observation in the other sample.\r\nA paired samples t-test always uses the following null hypothesis:\r\n\r\nH0: ?1 = ?2 (the two population means are equal)\r\nThe alternative hypothesis can be either two-tailed, left-tailed, or right-tailed:\r\n\r\nH1 (two-tailed): ?1 ? ?2 (the two population means are not equal)\r\nH1 (left-tailed): ?1 < ?2 (population 1 mean is less than population 2 mean)\r\nH1 (right-tailed): ?1> ?2 (population 1 mean is greater than population 2 mean)', 170, '2021-08-08', 0, 0),
(2613, 22, 235, 'A chi-squared test (symbolically represented as ?2) is basically a data analysis on the basis of observations of a random set of variables. Usually, it is a comparison of two statistical data sets. This test was introduced by Karl Pearson in 1900 for categorical data analysis and distribution. So it was mentioned as Pearson’s chi-squared test.\r\n\r\nThe chi-square test is used to estimate how likely the observations that are made would be, by considering the assumption of the null hypothesis as true.\r\n\r\nA hypothesis is a consideration that a given condition or statement might be true, which we can test afterwards. Chi-squared tests are usually created from a sum of squared falsities or errors over the sample variance.', 170, '2021-08-08', 0, 0),
(2614, 22, 236, 'p-value from left-tailed t-test: p-value = cdf t,d (t score)\r\np-value from right-tailed t-test: p-value = 1 - cdf t,d (t score)\r\np-value from two-tailed t-test: p-value = 2 * cdf t,d (?|t score |) or, equivalently: p-value = 2 - 2 * cdf t,d (|t score |)', 170, '2021-08-08', 0, 0),
(2615, 22, 237, 'Analysis of variance (ANOVA) is a method for testing the hypothesis that there is no difference between two or more population means. There may be variation between samples and also within sample items. ANOVA consists in splitting the variance for analytical purposes.', 170, '2021-08-08', 0, 0),
