(2714, 22, 227, 'understanding the variance\r\n- calculated by taking the difference between each number in the data set and the mean, then squaring the difference to make them positive, and finally dividing the sum of the squares by the number of values in the data set', 166, '2021-08-08', 0, 0),
(2715, 22, 228, '1.identify the parameters to be measured, the range of possible values, and the required resolution.\r\n2.design a sampling scheme that details how and when samples will be taken.\r\n3.select sample sizes.\r\n4.design data storage formats.\r\n5.assign roles and responsibilities.', 166, '2021-08-08', 0, 0),
(2716, 22, 229, 'scatter diagrams are convenient mathematical tools to study the correlation between 2 random variables. \r\nwe can take any variables as the independent variable in such a case and correspondingly plot every data point on the graph. The totality of all the plotted points forms the scatter diagram.  Based on the different shapes the scatter plot may assume, we can draw different inferences. We can calculate a coefficient correlation for the given data. ', 166, '2021-08-08', 0, 0),
(2717, 22, 230, 'Correlation analysis is a method to measure the strength of the linear relationship between 2 or more variables.\r\n\r\nThis is used to identify the key input variables of a process i.e. the input variables that have the highest impact on the process output.\r\n\r\nThe correlation analysis can be done using two methods 1) using a scatter plot or 2) using a correlation matrix.\r\n\r\nA positive correlation coefficient indicates that an increase in the first variable would correspond to an increase in the second variable, thus implying a direct relationship between the variables. A negative correlation indicates an inverse relationship whereas one variable increases, the second variable decreases.', 166, '2021-08-08', 0, 0),
(2718, 22, 231, 'time order, co-occurrence, preceding causation, sufficiency, interaction and alteration.\r\nWe suggest that there are six fundamental characteristics of causation: time order, co-occurrence, preceding causation, sufficiency, interaction, and alteration. The cause precedes the effect (time order). The cause co-occurs with the unaffected entity in space and time (co-occurrence).Causation can only be determined from an appropriately designed experiment. In such experiments, similar groups receive different treatments, and the outcomes of each group are studied. We can only conclude that a treatment causes an effect if the groups have noticeably different outcomes.', 166, '2021-08-08', 0, 0),
(2719, 22, 232, 'A hypothesis is an approximate explanation that relates to the set of facts that can be tested by certain further investigations. There are basically two types, namely, null hypothesis and alternative hypothesis', 166, '2021-08-08', 0, 0),
(2720, 22, 233, '1.The sampling method is simple random sampling.\r\n2.Each sample point can result in just two possible outcomes. ... \r\n3.The sample includes at least 10 successes and 10 failures.\r\n4.The population size is at least 20 times as big as the sample size', 166, '2021-08-08', 0, 0),
(2721, 22, 234, 'The paired sample t-test, sometimes called the dependent sample t-test, is a statistical procedure used to determine whether the mean difference between two sets of observations is zero. In a paired sample t-test, each subject or entity is measured twice, resulting in pairs of observations.', 166, '2021-08-08', 0, 0),
(2722, 22, 235, 'A chi-square (?2) statistic is a test that measures how a model compares to actual observed data. The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample', 166, '2021-08-08', 0, 0),
(2723, 22, 236, 'The p-value gives the probability of observing the test results under the null hypothesis. The lower the p-value, the lower the probability of obtaining a result like the one that was observed if the null hypothesis was true. Thus, a low p-value indicates decreased support for the null hypothesis.', 166, '2021-08-08', 0, 0),
(2724, 22, 237, 'Analysis of variance (ANOVA) is an analysis tool used in statistics that splits an observed aggregate variability found inside a data set into two parts: systematic factors and random factors. The systematic factors have a statistical influence on the given data set, while the random factors do not.', 166, '2021-08-08', 0, 0),
