(2766, 22, 224, 'The multi-vari chart is a very useful tool for analyzing all three types of variation. Multi-vari charts are used to investigate the stability or consistency of a process. The chart consists of a series of vertical lines, or other appropriate schematics, along a time scale.\r\n1.Show most of your variations.\r\n2.Assist you in breaking down the components of variation.\r\n3.Show all measurements recorded.', 168, '2021-08-08', 0, 0),
(2767, 22, 225, 'A sampling plan is a detailed outline of which measurements will be taken at what times, on which material, in what manner, and by whom. Sampling plans should be designed in such a way that the resulting data will contain a representative sample of the parameters of interest and allow for all questions, as stated in the goals, to be answered.\r\nThe steps involved in developing a sampling plan are:\r\n1.identify the parameters to be measured, the range of possible values, and the required resolution\r\n2.design a sampling scheme that details how and when samples will be taken\r\n3.select sample sizes\r\n4.design data storage formats\r\n5.assign roles and responsibilities', 168, '2021-08-08', 0, 0),
(2768, 22, 226, 'Common cause variation – All processes have common cause variation. This variation, also known as noise, is a normal part of any process. ...\r\nSpecial cause variation – This variation is not normal to the process. It is the result of exceptions in the process environment.', 168, '2021-08-08', 0, 0),
(2769, 22, 227, 'it’s a lack of consistency. Imagine that you’re manufacturing an item. Say, a certain sized screw. Firstly, you want the parameters to be the same in every single screw that you produce. Material strength, length, diameter and thread frequency all need to be uniform. Secondly, your customers want a level of consistency. They want a certain size of screw to all be the same. Using a screw that’s the wrong size might have serious consequences in a construction environment. So a lack of consistency in our products is bad.', 168, '2021-08-08', 0, 0),
(2770, 22, 228, 'Correlation measures the relationship of the process inputs (x) on the output (y). It is the degree or extent of the relationship between two variables. These studies are used to examine if there is a predictive relationship of the input on the process.\r\nCorrelation analysis is a method to measure the strength of the linear relationship between 2 or more variables. This is used to identify the key input variables of a process i.e. the input variables that have the highest impact on the process output.', 168, '2021-08-08', 0, 0),
(2771, 22, 229, 'A Scatter Analysis is used when you need to compare two data sets against each other to see if there is a relationship. Scatter plots are a way of visualizing the relationship; by plotting the data points you get a scattering of points on a graph. The analysis comes in when trying to discern what kind of pattern – if any – is present. And what that pattern means.\r\n1.Pairs of numerical figures are present\r\n2.Dependent variables have multiple values for each figure associated with the independent variable\r\n3.Defining if there is a relationship between two variables', 168, '2021-08-08', 0, 0),
(2772, 22, 230, 'To determine whether the correlation between variables is significant, compare the p-value to your significance level. Usually, a significance level (denoted as ? or alpha) of 0.05 works well. An ? of 0.05 indicates that the risk of concluding that a correlation exists—when, actually, no correlation exists—is 5%.\r\n\r\nA positive correlation coefficient indicates that an increase in the first variable would correspond to an increase in the second variable, thus implying a direct relationship between the variables. A negative correlation indicates an inverse relationship whereas one variable increases, the second variable decreases.', 168, '2021-08-08', 0, 0),
(2773, 22, 231, 'One factor or event leading to another; this could illustrate dependence – as in factor A is necessary for factor B to happen – or simply be one of the ways in which something happen (even without factor A, factors C, D, E, or F could all lead to factor B independently). The main takeaway is that one thing is happening because of another.', 168, '2021-08-08', 0, 0),
(2774, 22, 232, 'Hypothesis testing is an act in statistics whereby an analyst tests an assumption regarding a population parameter. The methodology employed by the analyst depends on the nature of the data used and the reason for the analysis.\r\n\r\n\r\nHypothesis testing is used to assess the plausibility of a hypothesis by using sample data. Such data may come from a larger population, or from a data-generating process. The word \"population\" will be used for both of these cases in the following descriptions.\r\nThe types of hypotheses are as follows:\r\nSimple Hypothesis.\r\nComplex Hypothesis.\r\nWorking or Research Hypothesis.\r\nNull Hypothesis.\r\nAlternative Hypothesis.\r\nLogical Hypothesis.\r\nStatistical Hypothesis.', 168, '2021-08-08', 0, 0),
(2775, 22, 233, 'Let us consider the parameter p of population proportion. For instance, we might want to know the proportion of males within a total population of adults when we conduct a survey. A test of proportion will assess whether or not a sample from a population represents the true proportion from the entire population.', 168, '2021-08-08', 0, 0),
(2776, 22, 234, 'Step 1: Determine a confidence interval for the population mean difference. First, consider the mean difference, and then examine the confidence interval. ...\r\nStep 2: Determine whether the difference is statistically significant. ...\r\nStep 3: Check your data for problems.', 168, '2021-08-08', 0, 0),
(2777, 22, 235, '\r\nThe basic idea behind the tests is that you compare the actual data values with what would be expected if the null hypothesis is true. The test statistic involves finding the squared difference between actual and expected data values, and dividing that difference by the expected data values.\r\nA chi-square (?2) statistic is a test that measures how a model compares to actual observed data. The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample.', 168, '2021-08-08', 0, 0),
(2778, 22, 236, 'Step 1: Determine a confidence interval for the population mean difference. First, consider the mean difference, and then examine the confidence interval. ...\r\nStep 2: Determine whether the difference is statistically significant. ...\r\nStep 3: Check your data for problems.\r\n\r\nThe p-value gives the probability of observing the test results under the null hypothesis. The lower the p-value, the lower the probability of obtaining a result like the one that was observed if the null hypothesis was true. Thus, a low p-value indicates decreased support for the null hypothesis.', 168, '2021-08-08', 0, 0),
(2779, 22, 237, 'Analysis of variance (ANOVA) is an analysis tool used in statistics that splits an observed aggregate variability found inside a data set into two parts: systematic factors and random factors. The systematic factors have a statistical influence on the given data set, while the random factors do not.\r\nANOVA, which stands for Analysis of Variance, is a statistical test used to analyze the difference between the means of more than two groups. A one-way ANOVA uses one independent variable, while a two-way ANOVA uses two independent variables.\r\nANOVA checks the impact of one or more factors by comparing the means of different samples. ... Another measure to compare the samples is called a t-test. When we have only two samples, t-test and ANOVA give the same results. However, using a t-test would not be reliable in cases where there are more than 2 samples.\r\n\r\nThere are two types of ANOVA that are commonly used, the One-Way ANOVA and the Two-Way ANOVA. This article will explore this important statistical test and the difference between these two types of ANOVA.', 168, '2021-08-08', 0, 0),
