(2825, 22, 229, 'Scatter diagram are convenient mathematical tools to study the correlation between two random variables. As the name suggested, they are the form of a sheet of paper upon which the data points corresponding to the variables of interest, are scattered. judging by the shape of the pattern that the data points from in the sheet of paper, we can determine the association between the two variables, we can further apply the best suitable correlation analysis technique.', 176, '2021-08-08', 0, 0),
(2826, 22, 230, 'The correlation between variables indicates that as one variable change in value, the other variables tends to change in a specific direction. understand the relationship is useful because we can use the value of one variable to predict the value of the other variable. for example- a height increases, weight is also tends to increase, consequently, if we observe an individual who is unusually tall, we can predict that his weight is also above the average.', 176, '2021-08-08', 0, 0),
