(2879, 22, 228, 'correlation measures the relationship of the process inputs(x) on the output(y). it is the degree or extent of the relationship between two variables. these studies are used to examine if there is a predictive relationship of input on the process.  ', 185, '2021-08-08', 0, 0),
(2880, 22, 229, 'A scatter diagram is a graphical tool that shows whether or not there is a correlation between two variables. \r\nUSE- when using a scatter diagram there are two types of variables - a dependant variable and an independent variable. the independent variable is usually plotted along the horizontal axis.\r\nINFER- we can interpret a scatterplot by looking for trends in the data as we go from left to right. if the data shows an uphill pattern as we move from left to right this indicates a positive relationship between X and Y. as the x-values increase ( move right), the y- values tend to increase ( move up).', 185, '2021-08-08', 0, 0),
(2881, 22, 230, 'A positive correlation coefficient indicates that an increase in the first variable would correspond to an increase in the second variable, thus implying a direct relationship between the variables. a negative correlation indicates an inverse relationship whereas one variable increases the second variable decreases', 185, '2021-08-08', 0, 0),
(2882, 22, 231, 'A control chart can show two different types of variations, special cause variation (points out of limits or non-random pattern of variation) and common cause variation.\r\n common cause variation is present when the control chart of process measures shows  random pattern of variation with all points within the control limits. when a control chart shows common cause variation, a process measure is said to be in statistical control or stable.\r\n fundamental changes to our critical process components, such as machinery, material, personnel, environment, or measurements are necessary if we want to reduce common cause variation.', 185, '2021-08-08', 0, 0),
(2883, 22, 232, 'A hypothesis is a tentative statement about the relationship between two or more variables. it is a specific, testable prediction about what you expect to happen in a study.\r\nbasically there are two types of hypothesis namely, \r\n1. null hypothesis.\r\n2. alternative hypothesis.\r\nResearch generally starts with a problem. next, these hypotheses provide the researchers with some specific restatements and clarifications of the research problem.', 185, '2021-08-08', 0, 0),
(2884, 22, 233, 'A test of proportions will assess whether or not a sample from a population represents the true proportions from the entire population.\r\nThe one-sampled proportions test is used to access whether population proportion(p1) is significantly different from a hypothesized value(PO). this is called the hypothesis of inequality.', 185, '2021-08-08', 0, 0),
(2885, 22, 234, 'A paired t-test is used to compare two populations means where you have two samples in which observations in one sample can be paired with observations in the other samples. before and after observations on the same subjects (e.g. student diagnostic test results before and after a particular module or course).\r\n The t- critical value is the cutoff between retaining or rejecting the null hypothesis. whenever the t-statistic is farther from 0 than the t-critical value, the null hypothesis is rejected, otherwise, the null hypothesis is retained.', 185, '2021-08-08', 0, 0),
(2886, 22, 235, 'the basic idea behind the tests is that you compare the actual data values with what would be expected if the null hypothesis is true. the test statistic involves finding the squared difference between actual and expected data values and dividing that difference by the expected data value ', 185, '2021-08-08', 0, 0),
(2887, 22, 236, 'the p-value gives the probability of observing the test results under the null hypothesis. the lower the p-value, the lower the probability of obtaining a result like that one that was observed if the null hypothesis was true. thus, a low p-value indicates decreased support for the null hypothesis.', 185, '2021-08-08', 0, 0),
(2888, 22, 237, 'ANOVA- (analysis of variance) is an analysis tool used in statistics that splits an observed aggregate variability found inside a data set into two parts -\r\n1. systematic factors.\r\n2. random factors.\r\nthe systematic factors have a statistical influence on the given data set, while the random factors do not.', 185, '2021-08-08', 0, 0),
