(2930, 22, 224, '1.Multiple Regression Analysis:It examines the relationship between a single metric dependent variable and two or more metric independent variables. \r\n2.Logistic Regression Analysis: allows for the prediction of an event.\r\n3.Discriminant Analysis: to correctly classify observations or people into homogeneous groups.\r\n4.Multivariate Analysis of Variance:the relationship between several categorical independent variables and two or more metric dependent variables.\r\n5.Factor Analysis: it is often helpful to reduce the variables to a smaller set of factors\r\n6.Cluster Analysis:to reduce a large data set to meaningful subgroups of individuals or objects\r\n7.Multidimensional Scaling:to transform consumer judgments of similarity into distances represented in multidimensional space. \r\n8.Correspondence Analysis:for dimensional reduction of object ratings on a set of attributes, resulting in a perceptual map of the ratings.\r\n9.Conjoint Analysis: it allows for the evaluation of objects and the various levels of the attributes to be examined.\r\n10.Canonical Correlation:canonical correlation simultaneously correlates several independent variables and several dependent variables.\r\n11.Structural Equation Modeling: examines multiple relationships between sets of variables simultaneously', 175, '2021-08-08', 0, 0);
INSERT INTO `rim_quizscore` (`Id`, `Quizid`, `Quesid`, `Answer`, `Userid`, `Dateofscored`, `Durbalmin`, `Durbalsec`) VALUES
(2931, 22, 225, 'General plant sampling guidelines\r\nAt a minimum the plant information should give an indication of the biomass input into the\r\nsystem. For row crops and some horticulture, the species (crop), cropping history, planting date,\r\nrow width, crop rotation, phenological stage or age at time of sampling are important metadata to\r\nbe recorded. Harvestable yield andabove plant biomass should be determined per unit area. Root\r\nbiomass is desirable. Plant biomass should be determined by individual researchers based on the\r\nvegetation/crop sampled. Timing and frequency is system dependent, although the age and\r\nphysiological stage should be recorded.\r\n\r\nPlant aboveground sampling crops:\r\nHarvestable yield can be determined by hand, or with a plot scale or full-scale combine as\r\nappropriate for size of plot used. It is important to include if the yield is reported as dry weight or\r\nstandard moisture, which varies by crop. The standard moisture used needs to be explicitly\r\nstated. An estimate of maximum non-grain biomass produced should be determined at\r\nphysiological maturity (black layer for corn) (Wilhelm et al., 2010) and R6 prior to leaf drop for\r\nsoybean. Narrow row or perennial species can be harvested within a known area, such as a 1-m2\r\nframe or hoop.', 175, '2021-08-08', 0, 0),
(2932, 22, 226, 'Common cause variation is the natural variation in the process. It is a part of the process. There are \"many\" causes of this type of variation, and it is not easy to identify and remove these. You will need to live with them unless drastic action is taken, such as process re-engineering.\r\n\r\nCommon causes are also called natural causes, noise, non-assignable and random causes.\r\n\r\nSpecial cause variation, on the other hand, is the unexpected variation in the process. There is a specific cause that can be assigned to the variation. For that reason, this is also called as the assignable cause. You are required to take action to address these variations.\r\n\r\nSpecial causes are also called assignable causes.', 175, '2021-08-08', 0, 0),
(2933, 22, 227, 'So far, you’ve found any significant variation in your process. However, you haven’t found what its cause might be. Hence, you need to find the source.\r\n\r\nYou can use a formal methodology like Six Sigma DMAIC, Use a multi vari chart to identify the source of variation.\r\nDMAIC methodology is the Six Sigma standard on how to identify variation in a process, analyze the root cause, prioritize the most advantageous way to remove a given variation, and test the fix. The tools you would use depend on the kind of variation and the situation. Typically we see either a “data door” or a “process door” and use techniques that are most appropriate.\r\n\r\nFor a smaller, shorter cycle methodology you could try Lean tools like Kaizen or GE’s Work Out.', 175, '2021-08-08', 0, 0),
(2934, 22, 229, 'The scatter diagram graphs pairs of numerical data, with one variable on each axis, to look for a relationship between them. If the variables are correlated, the points will fall along a line or curve. The better the correlation, the tighter the points will hug the line. This cause analysis tool is considered one of the seven basic quality tools.\r\nWHEN TO USE A SCATTER DIAGRAM\r\nWhen you have paired numerical data\r\nWhen your dependent variable may have multiple values for each value of your independent variable\r\nWhen trying to determine whether the two variables are related, such as:\r\nWhen trying to identify potential root causes of problems\r\nAfter brainstorming causes and effects using a fishbone diagram to determine objectively whether a particular cause and effect are related\r\nWhen determining whether two effects that appear to be related both occur with the same cause\r\nWhen testing for autocorrelation before constructing a control chart\r\n', 175, '2021-08-08', 0, 0),
(2935, 22, 230, 'Pearson’s correlation coefficient is represented by the Greek letter rho (?) for the population parameter and r for a sample statistic. This correlation coefficient is a single number that measures both the strength and direction of the linear relationship between two continuous variables. Values can range from -1 to +1.\r\n\r\nStrength: The greater the absolute value of the correlation coefficient, the stronger the relationship.\r\nThe extreme values of -1 and 1 indicate a perfectly linear relationship where a change in one variable is accompanied by a perfectly consistent change in the other. For these relationships, all of the data points fall on a line. In practice, you won’t see either type of perfect relationship.\r\nA coefficient of zero represents no linear relationship. As one variable increases, there is no tendency in the other variable to either increase or decrease.\r\nWhen the value is in-between 0 and +1/-1, there is a relationship, but the points don’t all fall on a line. As r approaches -1 or 1, the strength of the relationship increases and the data points tend to fall closer to a line.\r\nDirection: The sign of the correlation coefficient represents the direction of the relationship.\r\nPositive coefficients indicate that when the value of one variable increases, the value of the other variable also tends to increase. Positive relationships produce an upward slope on a scatterplot.\r\nNegative coefficients represent cases when the value of one variable increases, the value of the other variable tends to decrease. Negative relationships produce a downward slope.', 175, '2021-08-08', 0, 0),
(2936, 22, 231, 'Causation:  One factor or event leading to another; this could illustrate dependence – as in factor A is necessary for factor B to happen – or simply be one of the ways in which something happen (even without factor A, factors C, D, E, or F could all lead to factor B independently). The main takeaway is that one thing is happening because of another.\r\n\r\nWe suggest that there are six fundamental characteristics of causation: time order, co-occurrence, preceding causation, sufficiency, interaction, and alteration. The cause precedes the effect (time order). The cause co-occurs with the unaffected entity in space and time (co-occurrence).Causation can only be determined from an appropriately designed experiment. In such experiments, similar groups receive different treatments, and the outcomes of each group are studied. We can only conclude that a treatment causes an effect if the groups have noticeably different outcomes.', 175, '2021-08-08', 0, 0),
(2937, 22, 232, 'Hypothesis testing tells us whether there exists statistically significant difference between the data sets for us to consider that they represent different distributions.\r\n\r\nWhat is the difference that can be detected using Hypothesis Testing?\r\nFor Continuous data, hypothesis testing can detect Difference in Average and Difference in Variance. For Discrete data, hypothesis testing can detect Difference in Proportion Defective.\r\n\r\nSteps in Hypothesis Testing:\r\nStep 1: Determine appropriate Hypothesis test\r\nStep 2: State the Null Hypothesis Ho and Alternate Hypothesis Ha\r\nStep 3: Calculate Test Statistics / P-value against table value of test statistic\r\nStep 4: Interpret results – Accept or reject Ho\r\nMechanism:\r\nHo = Null Hypothesis – There is No statistically significant difference between the two groups\r\nHa = Alternate Hypothesis – There is statistically significant difference between the two groups\r\nHypothesis Testing Errors:\r\nType I Error – P (Reject Ho when Ho is true) = ?\r\nIn type I Error, we reject the Null Hypothesis when it is true. It is also called as Alpha error or Producer’s Risk.\r\n\r\nType II Error - P (Accept Ho when Ho is false) = ?\r\nSimilarly, in type II Error, we accept Null Hypothesis when it is false. It is also called as Beta error or Consumer’s Risk\r\n\r\n1.Normal Continuous Y and Discrete X\r\n2.Non-Normal Continuous Y and Discrete X\r\n3.Continuous Y and Continuous X\r\n4.Discrete Y and Discrete X\r\n\r\nNormality: tests for normal distribution in a population sample.\r\n\r\nT-test: tests for a Student’s t-distribution – ie, in a normally distributed population where standard deviation in unknown and sample size is comparatively small. Paired t-tests compare two samples.\r\n\r\nChi-Square Test for Independence: tests for an association of significance between two categorical variables in a population sample. Typically used with random sampling.\r\n\r\nHomogeneity of Variance (HOV): tests the similarity of dispersion parameters in two or more population samples.\r\n\r\nAnalysis of Variance (ANOVA): tests for and analyzes differences between the means in several groups. Often used similarly to a t-test, but for more than two groups.\r\n\r\nMood’s Median: compares the medians of two or more population samples.\r\n\r\nWelch’s T-test: tests for equality of means between two population samples. Also known as Welch’s unequal variances t-test.\r\n\r\nKruskal-Wallis H Test: compares two or more groups with an independent variable, based on a dependent variable. Also known as one-way ANOVA on ranks.\r\n\r\nBox-Cox Power Transformation: transforms a data set into normal distribution.', 175, '2021-08-08', 0, 0),
(2938, 22, 233, 'The One-Sample Proportion Test is used to assess whether a population proportion ... is N. The proportion of items with the characteristic of interest is P.\r\n\r\nA test of proportion will assess whether or not a sample from a population represents the true proportion from the entire population', 175, '2021-08-08', 0, 0),
