(2984, 22, 224, 'The characteristics of multi-vari analysis are-\r\n1. summarization of data.\r\n2. Representation of data.\r\n3. Interpretation of data.\r\nWhen more than one characteristic of each sample unit is measured.', 177, '2021-08-08', 0, 0),
(2985, 22, 225, 'Guidelines of samplings plans are- \r\n1. defining the target population.\r\n2. specifying the sampling frame.\r\n3. specifying the sampling unit.\r\n4.selection of the sampling method.\r\n5. determination of sample size.\r\n6. specifying the sample size.\r\n7. selecting the sample.', 177, '2021-08-08', 0, 0),
(2986, 22, 226, 'Variations are classified either as continuous, or quantitative. \r\n1. Quantitative - smoothly grading between two extremes, with the majority of individuals.\r\n2. Discontinuous or qualitative- composed of well-defined classes as blood groups vary in humans.', 177, '2021-08-08', 0, 0),
