(3039, 22, 225, 'The plan starts with identifying the parameters that are to be measured, the range in which the sample population may fall. \r\nStep 2: Design a sampling frame.\r\nStep 3: Selecting the sample size.\r\nStep 4: Planning a hypothesis.\r\nStep 5: Verifying and validating whether the sample size is suitable or not. ', 167, '2021-08-08', 0, 0),
(3040, 22, 226, 'There are two types of variation \r\n1. Common cause variation: There is a common cause for all the variation in the process. An inefficient process might result a delay in the entire production process.\r\n\r\n2. Special cause variation: This type of variation is caused due to exceptional situation during a process.  ', 167, '2021-08-08', 0, 0),
(3041, 22, 227, 'A variation or coefficient of variation is calculated by taking a difference between different data sets and their means.', 167, '2021-08-08', 0, 0),
(3042, 22, 229, 'The scatter diagram is a graph used to plot data points of two numeric values. These data points help in understanding a pattern the data represents. ', 167, '2021-08-08', 0, 0),
(3043, 22, 230, 'The correlation Coefficient is to understand and measure the association between two or more variables. ', 167, '2021-08-08', 0, 0),
(3044, 22, 231, 'Causation is a factor or event that leads to another thus showing a dependence of two variables.Eg. A leads to B where A is the cause and B is the effect.', 167, '2021-08-08', 0, 0),
(3045, 22, 232, 'The hypothesis is a logical explantion of why things happen in a certain way. This is based on an assumption drawn by comparing two or more variables.', 167, '2021-08-08', 0, 0),
(3046, 22, 233, 'Test of proportions is to understand the relationship between two data sets.', 167, '2021-08-08', 0, 0),
(3047, 22, 234, 'The paired sample t-test, or the dependent sample t-test, is a statistical procedure used to determine whether the mean difference between two sets of observations is zero. In a paired sample t-test, each subject or entity is measured twice, resulting in pairs of observations. Common applications of the paired sample t-test include case-control studies or repeated-measures designs. ', 167, '2021-08-08', 0, 0),
(3048, 22, 235, 'The basic concepts of the Chi-square test are the data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample.', 167, '2021-08-08', 0, 0),
(3049, 22, 236, 'A paired t-test is used when we are interested in the difference between two variables for the same subject. Often the two variables are separated by time.', 167, '2021-08-08', 0, 0),
(3050, 22, 237, 'The Analysis of variance or(ANOVA) is an analysis tool used in statistics that splits an observed aggregate variability found inside a data set into two parts, systematic factors, and random factors. The systematic factors have a statistical influence on the given data set, while the random factors do not.', 167, '2021-08-08', 0, 0),
