(3150, 22, 227, 'by analysing investigation as to the reason for deviation in the financial performence form the stands set by the organization in it bugget\r\n1 metarial variation\r\n2 labour variation\r\nvariable overhead\r\nfixed over head\r\nsales variation\r\n', 171, '2021-08-08', 0, 0),
(3151, 22, 228, 'Correlation analysis is a method to measure the strength of the linear relationship between 2 or more variables. This is used to identify the key input variables of a process i.e. the input variables that have the highest impact on the process output.', 171, '2021-08-08', 0, 0),
(3152, 22, 229, 'The scatter diagram graphs pairs of numerical data, with one variable on each axis, to look for a relationship between them. If the variables are correlated, the points will fall along a line or curve. The better the correlation, the tighter the points will hug the line. This cause analysis tool is considered one of the seven basic quality tools.\r\n\r\nWhen to use a scatter diagram\r\nScatter diagram procedure\r\nScatter diagram example\r\nScatter diagram considerations\r\nScatter diagram resources', 171, '2021-08-08', 0, 0),
(3153, 22, 230, 'A positive correlation coefficient indicates that an increase in the first variable would correspond to an increase in the second variable, thus implying a direct relationship between the variables. A negative correlation indicates an inverse relationship whereas one variable increases, the second variable decreases.', 171, '2021-08-08', 0, 0),
(3154, 22, 231, ' there are six fundamental characteristics of causation: time order, co-occurrence, preceding causation, sufficiency, interaction, and alteration. ', 171, '2021-08-08', 0, 0),
(3155, 22, 232, '\r\nThere are basically two types, namely, null hypothesis and alternative hypothesis.\r\nThe types of hypotheses are as follows:\r\nSimple Hypothesis.\r\nComplex Hypothesis.\r\nWorking or Research Hypothesis.\r\nNull Hypothesis.\r\nAlternative Hypothesis.\r\nLogical Hypothesis.\r\nStatistical Hypothesis', 171, '2021-08-08', 0, 0),
(3156, 22, 233, 'The One Sample Proportion Test is used to estimate the proportion of a population. It compares the proportion to a target or reference value and also calculates a range of values that is likely to include the population proportion. If the sample sizes is less then binomial enumeration gives much more accurate results.', 171, '2021-08-08', 0, 0),
(3157, 22, 234, 'The paired sample t-test, sometimes called the dependent sample t-test, is a statistical procedure used to determine whether the mean difference between two sets of observations is zero. In a paired sample t-test, each subject or entity is measured twice, resulting in pairs of observations. Common applications of the paired sample t-test include case-control studies or repeated-measures designs. Suppose you are interested in evaluating the effectiveness of a company training program. One approach you might consider would be to measure the performance of a sample of employees before and after completing the program, and analyze the differences using a paired sample t-test.', 171, '2021-08-08', 0, 0),
(3158, 22, 235, 'A chi-square (?2) statistic is a test that measures how a model compares to actual observed data. The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample.', 171, '2021-08-08', 0, 0),
(3159, 22, 236, 'The p-value gives the probability of observing the test results under the null hypothesis. The lower the p-value, the lower the probability of obtaining a result like the one that was observed if the null hypothesis was true. Thus, a low p-value indicates decreased support for the null hypothesis.', 171, '2021-08-08', 0, 0),
(3160, 22, 237, 'Analysis of variance (ANOVA) is an analysis tool used in statistics that splits an observed aggregate variability found inside a data set into two parts: systematic factors and random factors. The systematic factors have a statistical influence on the given data set, while the random factors do not.', 171, '2021-08-08', 0, 0),
