(3258, 22, 225, '1.identify the parameters to be measured, the range of possible values, and the required resolution.\r\n2.design a sampling scheme that details how and when samples will be taken.\r\n3.select sample sizes.\r\n4.design data storage formats.\r\n5.assign roles and responsibilities', 180, '2021-08-08', 0, 0),
(3259, 22, 226, 'There are 2 types of variation and the difference between continuous and discontinuous variation is that continuous variation shows an unbroken range of phenotypes of a particular character in the population whereas discontinuous variation shows two or more separate forms of a character in the population. ', 180, '2021-08-08', 0, 0),
(3260, 22, 227, ' It is calculated by taking the differences between each number in the data set and the mean, then squaring the differences to make them positive, and finally dividing the sum of the squares by the number of values in the data set.\r\n\r\n', 180, '2021-08-08', 0, 0),
(3261, 22, 228, 'Correlation analysis is a method to measure the strength of the linear relationship between 2 or more variables.\r\n\r\nThis is used to identify the key input variables of a process i.e. the input variables that have the highest impact on the process output.\r\n\r\nThe correlation analysis can be done using two methods 1) using a scatter plot or 2) using a correlation matrix.', 180, '2021-08-08', 0, 0),
(3262, 22, 229, 'The scatter diagram graphs pairs of numerical data, with one variable on each axis, to look for a relationship between them. If the variables are correlated, the points will fall along a line or curve. The better the correlation, the tighter the points will hug the line. This cause analysis tool is considered one of the seven basic quality tools.\r\n\r\nhe scatter diagram graphs pairs of numerical data, with one variable on each axis, to look for a relationship between them. If the variables are correlated, the points will fall along a line or curve. The better the correlation, the tighter the points will hug the line. This cause analysis tool is considered one of the seven basic quality tools.\r\n', 180, '2021-08-08', 0, 0),
(3263, 22, 230, '.A positive correlation coefficient indicates that an increase in the first variable would correspond to an increase in the second variable, thus implying a direct relationship between the variables. A negative correlation indicates an inverse relationship whereas one variable increases, the second variable decreases', 180, '2021-08-08', 0, 0),
(3264, 22, 231, 'We suggest that there are six fundamental characteristics of causation: time order, co-occurrence, preceding causation, sufficiency, interaction, and alteration. The cause precedes the effect (time order). The cause co-occurs with the unaffected entity in space and time (co-occurrence).Causation can only be determined from an appropriately designed experiment. In such experiments, similar groups receive different treatments, and the outcomes of each group are studied. We can only conclude that a treatment causes an effect if the groups have noticeably different outcomes.', 180, '2021-08-08', 0, 0),
(3265, 22, 232, 'A hypothesis is an approximate explanation that relates to the set of facts that can be tested by certain further investigations. There are basically two types, namely, null hypothesis and alternative hypothesis', 180, '2021-08-08', 0, 0),
(3266, 22, 233, '\r\n1.The sampling method is simple random sampling.\r\n2.Each sample point can result in just two possible outcomes. ... \r\n3.The sample includes at least 10 successes and 10 failures.\r\n4.The population size is at least 20 times as big as the sample size.', 180, '2021-08-08', 0, 0),
(3267, 22, 234, 'The paired sample t-test, sometimes called the dependent sample t-test, is a statistical procedure used to determine whether the mean difference between two sets of observations is zero. In a paired sample t-test, each subject or entity is measured twice, resulting in pairs of observations.', 180, '2021-08-08', 0, 0),
(3268, 22, 235, 'A chi-square (?2) statistic is a test that measures how a model compares to actual observed data. The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample', 180, '2021-08-08', 0, 0),
(3269, 22, 236, 'The p-value gives the probability of observing the test results under the null hypothesis. The lower the p-value, the lower the probability of obtaining a result like the one that was observed if the null hypothesis was true. Thus, a low p-value indicates decreased support for the null hypothesis.', 180, '2021-08-08', 0, 0),
(3270, 22, 237, 'Analysis of variance (ANOVA) is an analysis tool used in statistics that splits an observed aggregate variability found inside a data set into two parts: systematic factors and random factors. The systematic factors have a statistical influence on the given data set, while the random factors do not.', 180, '2021-08-08', 0, 0),
