(3313, 22, 225, '1. identify the parameters to be measured, the range of possible values, and the required resolution.\r\n2.design a sampling scheme that details how and when samples will be taken.\r\n3.select sample sizes.\r\ndesign data storage formats.\r\n5. assign roles and responsibilites.', 172, '2021-08-08', 0, 0),
(3314, 22, 226, 'Variation is of two forms. \r\n1.common cause variation: all process have common cause variation, this variation also known as noise as normal part of any process.\r\n2. special cause variation: this variation is not normal to the process. it the result of exceptions is the process environment.', 172, '2021-08-08', 0, 0),
(3315, 22, 227, 'When the distribution has lower variability, the values in a dataset are more consistent. However, when the variability is higher, the data points are more dissimilar and extreme values become more likely.', 172, '2021-08-08', 0, 0),
(3316, 22, 228, 'Coorelation measures the relationship of the process inputs (x) on the output (y). It is the degree or extent of the relationship between two variables. These stuides are used to examine if there is a predictive relationship of the input on the process.', 172, '2021-08-08', 0, 0),
(3317, 22, 229, 'A scatter diagram is a graphical tool that shows whether or not there is a correlation between two variables. \r\nUSE: When using a scatter diagram there are two types of variables, a dependent variable, and an independent variable.the independent variable is ususlly a plotted along the horizantal axis.\r\nInfer scatter Plot: we can interprete a scatter plot by looking trends in the data as we from left to Right. if the data shows an uphill pattern as we move from left to right this indicates as positive relationship between X and Y. As the X values increases (move right), the Y values tend to increase (move up).', 172, '2021-08-08', 0, 0),
(3318, 22, 230, 'A positive Correlation coiffecient idicates that an increase in the first variable would coresponde to an increase in the second variable. thus, impling a direct relationship between the variables. A negetive correlation indicates an invers relationship where as one variable increases the second variable decreases.', 172, '2021-08-08', 0, 0),
(3319, 22, 231, 'A control chat can show two different types of variations \r\nSpecial cause variation (points of limits or non random pattern of variation) and \r\ncommon cause cause variation: common cause variation is present when the control chat of prosess maesure shows the random pattern of variation with all points within the control limits. When a control chat shows common cause variation, a process measures is said to be in statistical controll or stable', 172, '2021-08-08', 0, 0),
(3320, 22, 232, 'Hypothesis testing tells us whether there exsists statistically significant difference between the data sets for us to consider that they represent different distribution.\r\ntypes of hypothesis tests: Mainly of two types_ Null and Alternative.\r\n1. Simple Hypothesis\r\n2.Complex Hypothesis\r\n3.Working on Research Hypothesis\r\n4.Null Hypothesis\r\n5.Logical Hypothesis\r\n6.Statistical Hypothesis', 172, '2021-08-08', 0, 0),
(3321, 22, 233, 'A test of proportions will access whether or not a samples from a populations represents the truse proportions from the entire populations.\r\nthe one-sampled proportion test is used to access whether population proportion(p1) is significantly different from a hypothesized value (po). this is called the hypothesis inequality.', 172, '2021-08-08', 0, 0);
