(3424, 22, 226, '1.continuous variation \r\n  * no distinct categories \r\n  * no limit on the value\r\n  * tends to be quantitative\r\n  * strongly influenced by environment\r\n2.discontinuous variation\r\n  *distinct categories\r\n  * no in between categories \r\n  * tends to be qualitative\r\n  * unaffected by environment', 169, '2021-08-08', 0, 0),
(3425, 22, 227, 'by analysing investigation as to the reason for deviation in financial performance from the standard set by the organization in its budget\r\n1. material variation \r\n2. labour variation \r\n3. variable overhead\r\n4. fixed overhead\r\n5. sales variation', 169, '2021-08-08', 0, 0),
(3426, 22, 228, 'in order to perform the correlation analysis, there must be sufficient data for the variables under question. Once there is sufficient data, this data was plugged into a formula developed by Karl Pearson. This formula was famously called Karl Pearson’s co-efficient of correlation. This involved complex calculation and mandated the presence of a statistician in the Six Sigma team.', 169, '2021-08-08', 0, 0),
(3427, 22, 229, 'Scatter Diagrams are convenient mathematical tools to study the correlation between two random variables. As the name suggests, they are a form of a sheet of paper upon which the data points corresponding to the variables of interest, are scattered. Judging by the shape of the pattern that the data points form on this sheet of paper, we can determine the association between the two variables, and can further apply the best suitable correlation analysis technique.\r\nBased on the different shapes the scatter plot may assume, we can draw different inferences. We can calculate a coefficient of correlation for the given data. It is a quantitative measure of the association of the random variables. Its value is always less than 1, and it may be positive or negative.\r\n', 169, '2021-08-08', 0, 0),
(3428, 22, 230, 'A correlation between variables indicates that as one variable changes in value, the other variable tends to change in a specific direction.  Understanding that relationship is useful because we can use the value of one variable to predict the value of the other variable. For example, height and weight are correlated—as height increases, weight also tends to increase. Consequently, if we observe an individual who is unusually tall, we can predict that his weight is also above the average.\r\n\r\n', 169, '2021-08-08', 0, 0),
(3429, 22, 231, 'A causative relationship between two events; one caused the other to happen. For example, dropping an egg could cause it to land on the floor. These will also happen at almost the same time, by human observation. But unlike the milk-and-egg example, one – dropping an egg – can be shown to directly cause the other – it landing on the floor.\r\n\r\nSeparate correlation and causation by identifying variables in your procedure (f) or input (x) and, where possible, change only one variable at a time. When you find that changing a makes a difference to the output but changing b doesn’t, you’ve found that a has a causative effect.', 169, '2021-08-08', 0, 0),
(3430, 22, 232, 'T-test: tests for a Student’s t-distribution – ie, in a normally distributed population where standard deviation in unknown and sample size is comparatively small. Paired t-tests compare two samples.\r\n\r\nChi-Square Test for Independence: tests for an association of significance between two categorical variables in a population sample. Typically used with random sampling.\r\n\r\nHomogeneity of Variance (HOV): tests the similarity of dispersion parameters in two or more population samples.\r\n\r\nAnalysis of Variance (ANOVA): tests for and analyzes differences between the means in several groups. Often used similarly to a t-test, but for more than two groups.', 169, '2021-08-08', 0, 0),
(3431, 22, 233, 'The techniques for hypothesis testing depend on\r\n\r\nthe type of outcome variable being analyzed (continuous, dichotomous, discrete)\r\nthe number of comparison groups in the investigation\r\nwhether the comparison groups are independent ', 169, '2021-08-08', 0, 0),
(3432, 22, 234, 'The paired sample t-test, sometimes called the dependent sample t-test, is a statistical procedure used to determine whether the mean difference between two sets of observations is zero. In a paired sample t-test, each subject or entity is measured twice, resulting in pairs of observations. Common applications of the paired sample t-test include case-control studies or repeated-measures designs. Suppose you are interested in evaluating the effectiveness of a company training program. One approach you might consider would be to measure the performance of a sample of employees before and after completing the program, and analyze the differences using a paired sample t-test.', 169, '2021-08-08', 0, 0),
(3433, 22, 235, 'A chi-square (?2) statistic is a test that measures how a model compares to actual observed data. The data used in calculating a chi-square statistic must be random, raw, mutually exclusive, drawn from independent variables, and drawn from a large enough sample. For example, the results of tossing a fair coin meet these criteria.\r\n\r\n\r\nChi-square tests are often used in hypothesis testing. The chi-square statistic compares the size any discrepancies between the expected results and the actual results, given the size of the sample and the number of variables in the relationship. For these tests, degrees of freedom are utilized to determine if a certain null hypothesis can be rejected based on the total number of variables and samples within the experiment. As with any statistic, the larger the sample size, the more reliable the results.', 169, '2021-08-08', 0, 0),
(3434, 22, 236, 'The Paired Samples t Test compares the means of two measurements taken from the same individual, object, or related units. These \"paired\" measurements can represent things like:\r\n\r\nA measurement taken at two different times.\r\nA measurement taken under two different conditions.\r\nMeasurements taken from two halves or sides of a subject or experimental unit.\r\n\r\nThe purpose of the test is to determine whether there is statistical evidence that the mean difference between paired observations is significantly different from zero. The Paired Samples t Test is a parametric test.', 169, '2021-08-08', 0, 0),
(3435, 22, 237, 'In some decision-making situations, the sample data may be divided into various groups i.e. the sample may be supposed to have consisted of k-sub samples. There are interest lies in examining whether the total sample can be considered as homogenous or there is some indication that sub-samples have been drawn from different populations. So, in these situations, we have to compare the mean values of various groups, with respect to one or more criteria. \r\nThe total variation present in a set of data may be partitioned into a number of non-overlapping components as per the nature of the classification. The systematic procedure to achieve this is called Analysis of Variance (ANOVA). With the help of such a partitioning, some testing of hypothesis may be performed. \r\n\r\nInitially, Analysis of Variance (ANOVA) had been employed only for the experimental data from the Randomized Designs but later they have been used for analyzing survey and secondary data from the Descriptive Research. ', 169, '2021-08-08', 0, 0),
