INSERT INTO `testimonial` (`id`, `title`, `location`, `description`, `image`, `dateofpost`, `status`) VALUES
(1, 'GEETA SOLANKE', 'BENGALURU', '<p class=\"MsoNormal\">I passed out of the Certificate Program in Business Analytics.<span style=\"mso-spacerun: yes;\">&nbsp; </span>It fetched me an immediate placement in an MNC. The program is extremely useful, and I am not wrong if I say that it is a must for all management students and working professionals to undergo this program.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Apart from the placement, the program immensely helped me in giving me in-depth exposure to the nuances of Business. <span style=\"mso-spacerun: yes;\">&nbsp;</span>I am keen on taking the Certificate Program on Big-Data Analytics.</p>\r\n<p class=\"MsoNormal\">Thanks, RIMSR.<span style=\"mso-spacerun: yes;\">&nbsp;</span></p>', '', '2020-11-29', 'active'),
(2, 'NAVEEN GOWDA', 'MAGADI', '<p class=\"MsoNormal\">I did not know anything about a computer.&nbsp; I tried going to a school that can help with the basics.&nbsp; All most all of them asked me to pay Rs.15,000/- as a fee.&nbsp; One of my good friends asked me to explore RIMSR.&nbsp; I met the Registrar and she was helpful.&nbsp; She told me at the very beginning that my learning is the only thing that matters.&nbsp; I enrolled myself in the Digital Literacy Program of RIMSR. In the beginning, I found it difficult, because, the tutorials were narrated in US English.&nbsp; I thought of giving up.&nbsp; But, Ms.Rajeshwari counseled me not to and asked me to go through the program.&nbsp; After completing two tutorials, I got used to the narration in US English.&nbsp; Then, it was very easy.&nbsp; The tutorials are highly illustrated and there was no way that I could not understand.&nbsp; The tutorials are exhaustive, very well structured, and easy to follow. After I completed the program I could know almost everything, like the evolution of computers, Windows operating systems, Microsoft Office, and the Tally Program.&nbsp; All this for Rs.99/- for the entire program including examination and certification. With the computer skills I acquired, I could get a job.&nbsp; Most importantly, I am now on my own. I handle the accounts of 6 shops and establishments, and I earn more than Rs. 40,000/- a month.&nbsp; I am so happy, because, I can now look after my sister&rsquo;s education, and I am financially supporting my parents.&nbsp; I am grateful to all the faculty members of RIMSR.&nbsp;</p>', '', '2019-11-12', 'active'),
(3, 'SAVITA', 'BENGALURU', '<p>I am in the XI grade.&nbsp; I used to fail frequently because I could not understand what my teachers taught.&nbsp; My mother and father asked me to stop going to school and take up a job in a garment factory.&nbsp; I cried and cried.&nbsp; My friend Aditi took me to Rajeshwari mam in RIMSR.&nbsp; She gave a lot of confidence and encouraged me to take up the SARAL SHIKSHAK program.&nbsp; I did not have the fee amount of Rs.99/-.&nbsp; Rajeshwari mam put her own money and enrolled me in the program.&nbsp; First, I found it difficult.&nbsp; Rajeshwari mam helped me with the lessons.&nbsp; And, I could pick-up the lessons after 2 to 3 weeks.&nbsp; This program brought a total change.&nbsp; I can study well, I remember what I study, and now I have the confidence to study further.&nbsp; I want to be a doctor.&nbsp; My parents are now very happy and are encouraging me.&nbsp; When I went back to RIMSR to pay back Rs.99/- to Rajeshwari mam, she did not take it back.&nbsp; She asked me to keep the money and help another student who is finding it difficult to learn.&nbsp; Now, I find learning new things is so easy and I am enjoying it.&nbsp; Thanks, Rajeshwari mam, you are like God to me.&nbsp; &nbsp;</p>', '', '2019-11-12', 'active'),
(4, 'KALPESH', 'BENGALURU', '<p>I did my MBA from Alliance University, Bengaluru.&nbsp; I was campus recruited by an IT company.&nbsp; They handle projects of a company in the US. I was posted to the BIG DATA CENTER.&nbsp; I could not follow the head and tail of what the techies were talking about.&nbsp; I really felt ashamed and wanted to leave the job.&nbsp; Then I came to know about RIMSR when I was casually browsing the net. I corresponded with the Registrar of RIMSR, and I decided to take up the Certificate Program on BIG DATA ANALYTICS.&nbsp; Trust me, after I completed the program, my colleagues were stunned to see me meaningfully participating with them in official discussions.&nbsp; The program gave me an in-depth understanding of BIG DATA.&nbsp; Recently, I got a raise in my salary, because my boss finds me very good.&nbsp; Thank you so much RIMSR.&nbsp; I am grateful to you.&nbsp; Please let me know if there is anything I can do to RIMSR.&nbsp; &nbsp;</p>', '', '2019-11-12', 'active'),
(5, 'Dr. Sujatha, M.Ed., M.Phil., Ph,D', 'BENGALURU', '<p>The two programs of RIMSR that I found extremely useful to youth and school children are the Saral Shikshak Program and the Digital Literacy Program.</p>\r\n<p>Both these programs are a must to all the school children. Moreover, school teachers should get trained on these programs, particularly the Saral Shikshak Program.&nbsp; RIMSR should focus on the Training of Trainers.</p>\r\n<p>Great job, RIMSR.&nbsp;</p>', '', '2020-01-30', 'active'),
(6, 'Mrs. Pushpa Nagaraj, M.Sc., B.Ed.', 'BENGALURU', '<p>In over 30 years of my experience as a school teacher, and counselor, I found a program that is essential to all school children; the Saral Shikshak Program.&nbsp; I have observed that more than 50% of school children fail to achieve good grades, not because they are mediocre, but, because of the lack of a format to learn better.&nbsp; The Saral Shikshak Program fills this gap.&nbsp;&nbsp;</p>', '', '2020-01-30', 'active'),
(7, 'Vasantha', 'Vizag', '<p>.......the Business Analytics Program gave me a huge advantage and helped me improve my productivity on-the-job.&nbsp; I recommend this program is a must to all, be it engineers or managers.&nbsp;&nbsp;</p>', '', '2020-04-21', 'active'),
(8, 'Vijayalakshmi', 'Bagakot', '<p>I am a dentist by profession.&nbsp; I have my own clinic.&nbsp; I was keen on getting a hang on knowing basic business skills.&nbsp; Out of sheer curiosity, I logged in to the \\\'Business Simulation Game.\\\'&nbsp; An excellent game.&nbsp; Now I understand, that business is not ad-hoc; it has scientific principles and to be successful we should understand these fundamentals.&nbsp; The game is well designed and gave me hands-on exposure to the basics of business.&nbsp; Everyone should undergo this experience.&nbsp; It benefits a lot.</p>', '', '2020-04-21', 'active'),
(9, 'Sri Ram', 'Haveri', '<p>The program I liked the most is the \\\'Digital Literacy Program.\\\' Till now I used my laptop as a typewriter.&nbsp; I never knew so much could be done on MS-Word.&nbsp; Earlier I was using just 5% of the Word Program and I was happy about it. Now I know it is so helpful a program.&nbsp; I can create my own posters, I have started using the mail-merge facility. It is so helpful. Thanks to \\\'Appuji University\\\' for giving me the \\\'Appuji Scholarship.\\\'&nbsp; I could take the program free of cost.&nbsp; I am now working on spreadsheets and presentations.&nbsp; I request everyone to use this opportunity.&nbsp; &nbsp;</p>', '', '2020-04-21', 'active'),
(10, 'Somnath Hiremutt', 'Gadag', '<p>...Digital Literacy Program is the best I have ever seen.&nbsp; Thanks to Dr. Kuttan from the USA for the scholarship.&nbsp; Thanks once again for your broad-mindedness. Tell me who will give a scholarship that covers 100% of the fee.&nbsp;&nbsp;</p>', '', '2020-04-21', 'active'),
(11, 'Ravi Sharma', 'Mumbai', '<p>......the project management course is amazing.......thanks; I am now ready to take the PMI examination.&nbsp;&nbsp;</p>', '', '2020-07-23', 'active'),
(12, 'Ashwini', 'BENGALURU', '<p>Happy to tell you, just cleared the CISCO certification.&nbsp; The entire credit goes to SUNY\'s certification courses......very, very informative, comprehensive, highly illustrated, and educative......designed exclusively to take certification courses.&nbsp; Thanks, Dr. Kuttan, but for Appuji Scholarships I could not have afforded the course.&nbsp;</p>', '', '2020-11-29', 'active'),
(13, 'Dr. Giriraj', 'BENGALURU', '<p>I am a professor in internal medicine.&nbsp; I took the digital literacy course of the NEF.&nbsp; Well structured, comprehensive, easy to understand tutorials, and above all, I wasn\'t charged a single rupee.&nbsp; I am now thorough in Word, Excel, and Powerpoint.&nbsp; I have asked all of my students, including the PGs to compulsorily take this course.&nbsp; A suggestion, I found 80% for a pass on the higher side.&nbsp; I could get this after three attempts.&nbsp; Consider making it to 70%.&nbsp; Thanks, Dr. Kuttan for your big-heart.&nbsp; Such an excellent program is priceless, and you have given this for free.&nbsp;</p>', '', '2020-07-23', 'active'),
(14, 'Dr. Vedanth', 'BENGALURU', '<p>My professor told me about the Digital Literacy course.&nbsp; I took it, and now I can make excellent presentations.&nbsp; Till today I avoided EXCEL thinking it is for engineers.&nbsp; I am wrong; it\'s one of the most useful tools to improve efficiency.&nbsp; I now keep a lot of data of my patients using EXCEL.&nbsp; Next, I will take the Business Simulation.&nbsp; Thanks to the SUNY team for making available a great program.&nbsp; Thanks Prof. Kuttan.&nbsp; You are a very generous person.&nbsp; People like you are an oasis in a desert.&nbsp; I can\'t imagine that the digital courses are for free, and I feel other institutions would have charged not less than Rs.10,000=00.&nbsp; Here afterwards I would be generous to my patients and charge them as less as possible.</p>', '', '2020-11-29', 'active'),
(15, 'Shwetha Murthy', 'Mysore', '<p>I recently completed the Project Management program of SUNY.&nbsp; &nbsp;The course content and presentation are par excellence.&nbsp; The online mentors were dedicated and were available all the time. In fact, the course that I took is 10 times better than the commercially available courses.&nbsp; The fee too was most affordable.&nbsp; I paid Rs. 1,875/- for the entire course, while my friends ended up paying Rs. 40,000/- for a week\'s program, yet I learned more than them. Thanks, Prof. (Dr.) Kuttan for the scholarships.&nbsp; But for you, I could not have afforded an advanced course in Project Management.&nbsp;&nbsp;</p>', '', '2020-11-29', 'active'),
(16, 'ABHISHEK JAIN', 'NEW DELHI', '<div dir=\"auto\" style=\"text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\">The Project Management Course is a combination of all three project methodologies, that is, PMP, Agile, and PMBOK.&nbsp;</div>\r\n<div dir=\"auto\" style=\"text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\">This helped me in understanding all the dimensions of the Project Management world and the video lectures were brief as well as informative.&nbsp;</div>\r\n<div dir=\"auto\" style=\"text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\">&nbsp;</div>\r\n<div dir=\"auto\" style=\"text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\">Enjoyed doing the course. All in all a good course.</div>\r\n<div dir=\"auto\" style=\"text-shadow: none !important; box-shadow: none !important; border-radius: 0px !important;\">&nbsp;</div>', '', '2020-11-29', 'active'),
(17, 'Prof. (Dr.) Mubashir Angolkar', 'Belagavi', '<div style=\\\"box-sizing: border-box; border-color: #eeeeee; color: #2c363a; font-family: Roboto, sans-serif;\\\">Greetings! Thanks for following up. The courses I am taking are very informative and simple to understand. Course tests are also well designed. I am not having any problems so far except the time limit.......</div>', '', '2020-11-25', 'active'),
(18, 'DR. PAVITRA', 'BENGALURU', '<p class=\"MsoNormal\">When I came to know a course titled <strong>SARAL SHIKSHAK</strong> offered by RIMSR, Bengaluru, I was quite curious as the title sounded different. Once I took this course and completed it, I realized its importance.<span style=\"mso-spacerun: yes;\">  </span>It is one of the great courses which I have ever taken.<span style=\"mso-spacerun: yes;\">  </span>It is basically on the methodology of Dr. Barbara Oakley, that is, <strong>Learning How to Learn.</strong><span style=\"mso-spacerun: yes;\">  </span>The least that I can say is that it’s a course that everyone should get exposed to.<span style=\"mso-spacerun: yes;\">  </span>It greatly helped me learning things better and smarter.<span style=\"mso-spacerun: yes;\">  </span>I am now practicing the techniques of effective learning in my lectures.<span style=\"mso-spacerun: yes;\">  </span>Thanks, Dr. Kuttan for the MIGA scholarship which made the course affordable.<span style=\"mso-spacerun: yes;\">  </span>I suggest this course should be made mandatory in all the schools and colleges. <span style=\"mso-spacerun: yes;\"> </span><span style=\"mso-spacerun: yes;\"> </span>– DR. PAVITRA, ASSOCIATE PROFESSOR, KLE DENTAL COLLEGE, BENGALURU.</p>', '', '2022-01-11', 'active');
